(295, 'FORM_FILLING_SIMPLE_FORM_1', 25, 's1', 'a:22:{s:10:\"RS_FORM_ID\";s:1:\"1\";s:12:\"RS_FORM_NAME\";s:14:\"Обратная связь\";s:15:\"RS_FORM_VARNAME\";s:13:\"SIMPLE_FORM_1\";s:11:\"RS_FORM_SID\";s:13:\"SIMPLE_FORM_1\";s:12:\"RS_RESULT_ID\";s:3:\"410\";s:14:\"RS_DATE_CREATE\";s:19:\"26.07.2019 15:53:08\";s:10:\"RS_USER_ID\";s:18:\"не зарегистрирован\";s:13:\"RS_USER_EMAIL\";s:0:\"\";s:12:\"RS_USER_NAME\";s:0:\"\";s:12:\"RS_USER_AUTH\";s:0:\"\";s:16:\"RS_STAT_GUEST_ID\";s:1:\"0\";s:18:\"RS_STAT_SESSION_ID\";s:1:\"0\";s:19:\"SIMPLE_QUESTION_131\";s:9:\"Joshuamum\";s:23:\"SIMPLE_QUESTION_131_RAW\";s:9:\"Joshuamum\";s:19:\"SIMPLE_QUESTION_208\";s:11:\"89123456789\";s:23:\"SIMPLE_QUESTION_208_RAW\";s:11:\"89123456789\";s:19:\"SIMPLE_QUESTION_666\";s:25:\"alyapova.kristina@mail.ru\";s:23:\"SIMPLE_QUESTION_666_RAW\";s:25:\"alyapova.kristina@mail.ru\";s:19:\"SIMPLE_QUESTION_609\";s:1:\" \";s:23:\"SIMPLE_QUESTION_609_RAW\";s:1:\" \";s:19:\"SIMPLE_QUESTION_244\";s:692:\"Здравствуйте уважаемый администратор сайта. \r\n \r\nЯ копирайтер \r\nМои тексты уже в ТОПе и работают на бизнес \r\n \r\nПредлагаю вам сотрудничество \r\n- Ищу проекты на ведение страниц/групп в соцсетях \r\nСформирую нужный имидж у ЦА, нейтрализую негативные коменты \r\n \r\nПишу также статьи заточеные под конкретные запросы, без переоптимизации, со 100% уникальностью, что способствует продвижению сайта, а также читабельные и подталкивают аудиторию сайта к диалогу. \r\n \r\nМои проекты успешно продвигаются по Москве и области в ТОП 10, в том числе благодаря моим уникальным, сео оптимизированным статьям \r\n \r\nP.S. \r\nЯ убеждена, что вместе мы сможем сделать ваш сайт еще интересней, популярнее и прибыльнее.\";s:23:\"SIMPLE_QUESTION_244_RAW\";s:692:\"Здравствуйте уважаемый администратор сайта. \r\n \r\nЯ копирайтер \r\nМои тексты уже в ТОПе и работают на бизнес \r\n \r\nПредлагаю вам сотрудничество \r\n- Ищу проекты на ведение страниц/групп в соцсетях \r\nСформирую нужный имидж у ЦА, нейтрализую негативные коменты \r\n \r\nПишу также статьи заточеные под конкретные запросы, без переоптимизации, со 100% уникальностью, что способствует продвижению сайта, а также читабельные и подталкивают аудиторию сайта к диалогу. \r\n \r\nМои проекты успешно продвигаются по Москве и области в ТОП 10, в том числе благодаря моим уникальным, сео оптимизированным статьям \r\n \r\nP.S. \r\nЯ убеждена, что вместе мы сможем сделать ваш сайт еще интересней, популярнее и прибыльнее.\";}', '2019-07-26 15:53:08', '2019-07-26 15:53:08', 'Y', 'Y'),
