(15, 3, 1, 5, 5, '', NULL, '', NULL, 'Доброго дня! Хотелось бы узнать о стоимости школьной формы. Учитывая, что у нас в школе учатся дети из малообеспеченных семей. Есть ли какие скидки для оптовых закупок?', 'ДОБРОГО ДНЯ! ХОТЕЛОСЬ БЫ УЗНАТЬ О СТОИМОСТИ ШКОЛЬНОЙ ФОРМЫ. УЧИТЫВАЯ, ЧТО У НАС В ШКОЛЕ УЧАТСЯ ДЕТИ ИЗ МАЛООБЕСПЕЧЕННЫХ СЕМЕЙ. ЕСТЬ ЛИ КАКИЕ СКИДКИ ДЛЯ ОПТОВЫХ ЗАКУПОК?', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
