(20, 4, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте, родители первоклассников 12 мальчиков и 13 девочек, хотим заказать школьную форму, есть ли у вас возможность приехать к нам для показа формы и заказа? Возможно привлечение и других классов.Спасибо.', 'ЗДРАВСТВУЙТЕ, РОДИТЕЛИ ПЕРВОКЛАССНИКОВ 12 МАЛЬЧИКОВ И 13 ДЕВОЧЕК, ХОТИМ ЗАКАЗАТЬ ШКОЛЬНУЮ ФОРМУ, ЕСТЬ ЛИ У ВАС ВОЗМОЖНОСТЬ ПРИЕХАТЬ К НАМ ДЛЯ ПОКАЗА ФОРМЫ И ЗАКАЗА? ВОЗМОЖНО ПРИВЛЕЧЕНИЕ И ДРУГИХ КЛАССОВ.СПАСИБО.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
