(25, 5, 1, 5, 5, '', NULL, '', NULL, 'Добрый день.\r\nМеня зовут Николай.\r\n\r\nЯ хочу рассказать вам о возможности определять профили ВКонтакте у посетителей вашего сайта. То есть посетитель заходит и если он залогинен ВКонтакте – то его профиль определяется.\r\n\r\nЗачем это нужно?\r\n\r\n1. Посетитель заходит на ваш сайт, уходит и потом больше не возвращается\r\n2. Наша система определяет его профиль ВКонтакте\r\n3. Вы пишете человеку и у вас есть возможность:\r\n   а. Выяснить почему он ушел и почему не купил\r\n   б. Продать устранив причины возражений\r\n\r\nПодробности на сайте http://bit.ly/1R41Ev4\r\n (короткий адрес)\r\n\r\nПо всем вопросам звоните 8 800 505 60 74 (бесплатный звонок).', 'ДОБРЫЙ ДЕНЬ.\r\nМЕНЯ ЗОВУТ НИКОЛАЙ.\r\n\r\nЯ ХОЧУ РАССКАЗАТЬ ВАМ О ВОЗМОЖНОСТИ ОПРЕДЕЛЯТЬ ПРОФИЛИ ВКОНТАКТЕ У ПОСЕТИТЕЛЕЙ ВАШЕГО САЙТА. ТО ЕСТЬ ПОСЕТИТЕЛЬ ЗАХОДИТ И ЕСЛИ ОН ЗАЛОГИНЕН ВКОНТАКТЕ – ТО ЕГО ПРОФИЛЬ ОПРЕДЕЛЯЕТСЯ.\r\n\r\nЗАЧЕМ ЭТО НУЖНО?\r\n\r\n1. ПОСЕТИТЕЛЬ ЗАХОДИТ НА ВАШ САЙТ, УХОДИТ И ПОТОМ БОЛЬШЕ НЕ ВОЗВРАЩАЕТСЯ\r\n2. НАША СИСТЕМА ОПРЕДЕЛЯЕТ ЕГО ПРОФИЛЬ ВКОНТАКТЕ\r\n3. ВЫ ПИШЕТЕ ЧЕЛОВЕКУ И У ВАС ЕСТЬ ВОЗМОЖНОСТЬ:\r\n   А. ВЫЯСНИТЬ ПОЧЕМУ ОН УШЕЛ И ПОЧЕМУ НЕ КУПИЛ\r\n   Б. ПРОДАТЬ УСТРАНИВ ПРИЧИНЫ ВОЗРАЖЕНИЙ\r\n\r\nПОДРОБНОСТИ НА САЙТЕ HTTP://BIT.LY/1R41EV4\r\n (КОРОТКИЙ АДРЕС)\r\n\r\nПО ВСЕМ ВОПРОСАМ ЗВОНИТЕ 8 800 505 60 74 (БЕСПЛАТНЫЙ ЗВОНОК).', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
