(30, 6, 1, 5, 5, '', NULL, '', NULL, 'Добрый день. Хочу рассказать вам о доступном способе определять профили ВКонтакте у посетителей вашего сайта, то есть получать конкретный адрес профиля человека, это позволяет выяснить почему человек ушел с сайта так и не совершив покупку, устранить возражения и допродать товар или услугу. Обязательно посетите наш сайт http://bit.ly/1LfcytR\r\n (короткий адрес)', 'ДОБРЫЙ ДЕНЬ. ХОЧУ РАССКАЗАТЬ ВАМ О ДОСТУПНОМ СПОСОБЕ ОПРЕДЕЛЯТЬ ПРОФИЛИ ВКОНТАКТЕ У ПОСЕТИТЕЛЕЙ ВАШЕГО САЙТА, ТО ЕСТЬ ПОЛУЧАТЬ КОНКРЕТНЫЙ АДРЕС ПРОФИЛЯ ЧЕЛОВЕКА, ЭТО ПОЗВОЛЯЕТ ВЫЯСНИТЬ ПОЧЕМУ ЧЕЛОВЕК УШЕЛ С САЙТА ТАК И НЕ СОВЕРШИВ ПОКУПКУ, УСТРАНИТЬ ВОЗРАЖЕНИЯ И ДОПРОДАТЬ ТОВАР ИЛИ УСЛУГУ. ОБЯЗАТЕЛЬНО ПОСЕТИТЕ НАШ САЙТ HTTP://BIT.LY/1LFCYTR\r\n (КОРОТКИЙ АДРЕС)', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
