 МЕНЕДЖЕРАМ \r\nКАК ПОЛНОСТЬЮ ИСПОЛЬЗОВАТЬ УПРАВЛЕНИЕ ТОРГОВЛЕЙ \r\nКАК НАСТРОИТЬ АВТОМАТИЧЕСОЕ ПОПОЛНЕНИЕ СКЛАДА \r\nКАК УСТАНОВИТЬ ЦЕНЫ \r\nКАК ДОБАВИТЬ НОВУЮ ФОРМУ \r\nКАК НАУЧИТЬСЯ РАБОТАТЬ В 1С \r\nКАК ПРАВИЛЬНО ОФОРМИТЬ ВОЗВРАТ ТОВАРА ОТ ПОКУПАТЕЛЯ В 1С 8 2 \r\nКАК КОНТРОЛИРОВАТЬ ДЕБИТОРСКУЮ ЗАДОЛЖЕННОСТЬ \r\n_________ \r\nКАК КОНРОЛИРОВАТЬ СКЛАД \r\nКАК СДЕЛАТЬ ОТДЕЛЬНОЕ МЕСТО КЛАДОВЩИКА \r\nКАК СДЕЛАТЬ ЯЧЕИСТЫЙ СКЛАД \r\n_________ \r\n------ СРМ СИСТЕМА В 1С \r\nКАК СДЕЛАТЬ ВОРОНКУ ПРОДАЖ? \r\nКАК НЕ ТЕРЯТЬ КЛИЕНТОВ \r\n \r\n------+ЧТО УМЕЮ: \r\n1. ДОРАБОТАТЬ ВСЕ, СТО УГОДНО НА ПЛАТФОРМЕ 8 \r\n2. НАСТРОЙКА БИЗНЕСС ПРОЦЕССОВ \r\n3. ПОЛНОЕ ЗНАНИЕ ПО \"УПРАВЛЕНИЕ ТОРГОВЛЕЙ И СРМ\" \r\n4. УПРАВЛЕНИЕ ПРОЕКТАМИ ПО ЕРП \r\n \r\n------+РАБОТАЛ С \r\nНОРИЛЬСКИМ НИКЕЛЕМ, НОРМА КАБЕЛЬ, РАЗВИТИЕ, ГФК, \r\nЭКО-НИВА, БМВ-ЛИЗИНГ, ФСЭ, ФУТЖИТСУ ТЕХНОЛОГИИ СОЛЮШНЗ \r\n \r\n------+ПОЛУЧЕНЫ СЕРТИФИКАТЫ: \r\nКОНСУЛЬТАНТ ПО УПРАВЛЕНИЮ ТОРГОВЛЕЙ, \r\nКОНСУЛЬТАНТ ПО ЗАРПЛАТЕ И УПРАВЛЕНИЮ ПЕРСОНАЛОМ \r\nКУРСОВ МНОГО ПРОЙДЕНО- МОГУ СКИНУТЬ РЕЗЮМЕ. \r\n \r\n------+ЕСЛИ ВАМ ИНТЕРЕСНЫ МОИ УСЛУГИ, ПИШИТЕ! \r\n------------+МОЯ ПОЧТА: PROMASTER1C@GMAIL.COM \r\n------------------+ 7 926 477-22-35', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
