ВСЕХ ЭТАПАХ РАБОТ ОСУЩЕСТВЛЯЕТСЯ КОНТРОЛЬ ПЕРСОНАЛЬНЫМ МЕНЕДЖЕРОМ ЗАКАЗА, КОТОРЫЙ ОПЕРАТИВНО РЕШАЕТ ЛЮБЫЕ ВОПРОСЫ, КУРИРУЕТ ГРАФИК ДОСТАВКИ, КАЧЕСТВО И СРОКИ МОНТАЖНЫХ РАБОТ. \r\n \r\nВСЕМ, КТО ЗАИНТЕРЕСОВАН ПИШИТЕ НА ПОЧТУ: INFO@HOROSHIEOKNA.COM \r\nСАЙТ: HTTP://PARTNER.HOROSHIEOKNA.COM/', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
