(865, 173, 1, 5, 5, '', NULL, '', NULL, 'Добрый день! \r\n \r\nВысылаю Вам материалы по продаже готового комплекта видеонаблюдения. \r\nСтоимость готового комплекта от 5900 руб ! \r\n \r\nОтдельно скажу о возможностях нашей системы видеонаблюдения, которые уже включены в стоимость: \r\n \r\n-Простая установка системы : \r\n \r\n( подробная инструкция прилагается к комплекту ), если у клиента возникнут трудности , то наша служба поддержки поможет Вам настроить систему через интернет Бесплатно ! \r\n \r\n- Удаленный онлайн просмотр. \r\n \r\nПодключив систему к интернету, Вы сможете контролировать, что происходит на месте установки, когда Вас там нет. Это можно делать в любую минуту с телефона, планшета или компьютера из любой точки земного шара. \r\n \r\n- Качественное широкоформатное разрешение изображения (HD). \r\n \r\nВы сможете просматривать запись на больших экранах и видеть все мелкие детали. \r\n \r\n- Запись по датчику движения \r\n \r\nСистема может не записывать все, а автоматически включаться только тогда когда в кадре началось движение. Вы будете просматривать только самое важное + сможете запись до 1,5 месяца. \r\n \r\n-Уведомление на почту \r\n \r\nЕсли сработал датчик движения, система может отправить Вам уведомление на почту о начале записи. С помощью удаленного просмотра Вы сможете сразу посмотреть, что там происходит. \r\n \r\n- Ночная подсветка до 60 метров \r\n \r\nС наступлением темноты, камеры автоматически переходят в черно-белый режим и снимают четкое видео в ночное время суток. \r\n \r\n- Камеры, устойчивые к дождю и пыли \r\n \r\nМеталлический корпус камер соответствует международному классу защиты IP66. Это означает, что корпус камеры полностью исключает попадание в нее пыли или влаги в виде дождя. Вам не надо беспокоиться о камерах в ненастную погоду. \r\n \r\n- Ремонт и гарантия непосредственно от нас \r\n \r\nВ течение гарантийного срока, Вы обращаетесь непосредственно к нам, нежели в какой-то сервисный центр, что гораздо удобнее и оперативнее. \r\n \r\n- Лучшее соотношение цена-качество \r\n \r\nЕсли Вы и найдете оборудование с полностью аналогичными характеристиками, то ГАРАНТИРОВАННО по более высокой цене. Если это все же случится, пришлите предложение нам, и мы ГАРАНТИРУЕМ, что сделаем дешевле. Самое выгодное предложение уже у Вас! \r\n \r\n \r\n \r\n \r\n \r\n \r\nЕсли возникнут вопросы, буду рад внести ясность. Обращайтесь… \r\nС Уважением, Сергей, СВР-видео +7 977) 271-01-93 \r\nПочта: Sergey@svr-video.ru \r\nСайт:neosafe.ru', 'ДОБРЫЙ ДЕНЬ! \r\n \r\nВЫСЫЛАЮ ВАМ МАТЕРИАЛЫ ПО ПРОДАЖЕ ГОТОВОГО КОМПЛЕКТА ВИДЕОНАБЛЮДЕНИЯ. \r\nСТОИМОСТЬ ГОТОВОГО КОМПЛЕКТА ОТ 5900 РУБ ! \r\n \r\nОТДЕЛЬНО СКАЖУ О ВОЗМОЖНОСТЯХ НАШЕЙ СИСТЕМЫ ВИДЕОНАБЛЮДЕНИЯ, КОТОРЫЕ УЖЕ ВКЛЮЧЕНЫ В СТОИМОСТЬ: \r\n \r\n-ПРОСТАЯ УСТАНОВКА СИСТЕМЫ : \r\n \r\n( ПОДРОБНАЯ ИНСТРУКЦИЯ ПРИЛАГАЕТСЯ К КОМПЛЕКТУ ), ЕСЛИ У КЛИЕНТА ВОЗНИКНУТ ТРУДНОСТИ , ТО НАША СЛУЖБА ПОДДЕРЖКИ ПОМОЖЕТ ВАМ НАСТРОИТЬ СИСТЕМУ ЧЕРЕЗ ИНТЕРНЕТ БЕСПЛАТНО ! \r\n \r\n- УДАЛЕННЫЙ ОНЛАЙН ПРОСМОТР. \r\n \r\nПОДКЛЮЧИВ СИСТЕМУ К ИНТЕРНЕТУ, ВЫ СМОЖЕТЕ КОНТРОЛИРОВАТЬ, ЧТО ПРОИСХОДИТ НА МЕСТЕ УСТАНОВКИ, КОГДА ВАС ТАМ НЕТ. ЭТО МОЖНО ДЕЛАТЬ В ЛЮБУЮ МИНУТУ С ТЕЛЕФОНА, ПЛАНШЕТА ИЛИ КОМПЬЮТЕРА ИЗ ЛЮБОЙ ТОЧКИ ЗЕМНОГО ШАРА. \r\n \r\n- КАЧЕСТВЕННОЕ ШИРОКОФОРМАТНОЕ РАЗРЕШЕНИЕ ИЗОБРАЖЕНИЯ (HD). \r\n \r\nВЫ СМОЖЕТЕ ПРОСМАТРИВАТЬ ЗАПИСЬ НА БОЛЬШИХ ЭКРАНАХ И ВИДЕТЬ ВСЕ МЕЛКИЕ ДЕТАЛИ. \r\n \r\n- ЗАПИСЬ ПО ДАТЧИКУ ДВИЖЕНИЯ \r\n \r\nСИСТЕМА МОЖЕТ НЕ ЗАПИСЫВАТЬ ВСЕ, А АВТОМАТИЧЕСКИ ВКЛЮЧАТЬСЯ ТОЛЬКО ТОГДА КОГДА В КАДРЕ НАЧАЛОСЬ ДВИЖЕНИЕ. ВЫ БУДЕТЕ ПРОСМАТРИВАТЬ ТОЛЬКО САМОЕ ВАЖНОЕ + СМОЖЕТЕ ЗАПИСЬ ДО 1,5 МЕСЯЦА. \r\n \r\n-УВЕДОМЛЕНИЕ НА ПОЧТУ \r\n \r\nЕСЛИ СРАБОТАЛ ДАТЧИК ДВИЖЕНИЯ, СИСТЕМА МОЖЕТ ОТПРАВИТЬ ВАМ УВЕДОМЛЕНИЕ НА ПОЧТУ О НАЧАЛЕ ЗАПИСИ. С ПОМОЩЬЮ УДАЛЕННОГО ПРОСМОТРА ВЫ СМОЖЕТЕ СРАЗУ ПОСМОТРЕТЬ, ЧТО ТАМ ПРОИСХОДИТ. \r\n \r\n- НОЧНАЯ ПОДСВЕТКА ДО 60 МЕТРОВ \r\n \r\nС НАСТУПЛЕНИЕМ ТЕМНОТЫ, КАМЕРЫ АВТОМАТИЧЕСКИ ПЕРЕХОДЯТ В ЧЕРНО-БЕЛЫЙ РЕЖИМ И СНИМАЮТ ЧЕТКОЕ ВИДЕО В НОЧНОЕ ВРЕМЯ СУТОК. \r\n \r\n- КАМЕРЫ, УСТОЙЧИВЫЕ К ДОЖДЮ И ПЫЛИ \r\n \r\nМЕТАЛЛИЧЕСКИЙ КОРПУС КАМЕР СООТВЕТСТВУЕТ МЕЖДУНАРОДНОМУ КЛАССУ ЗАЩИТЫ IP66. ЭТО ОЗНАЧАЕТ, ЧТО КОРПУС КАМЕРЫ ПОЛНОСТЬЮ ИСКЛЮЧАЕТ ПОПАДАНИЕ В НЕЕ ПЫЛИ ИЛИ ВЛАГИ В ВИДЕ ДОЖДЯ. ВАМ НЕ НАДО БЕСПОКОИТЬСЯ О КАМЕРАХ В НЕНАСТНУЮ ПОГОДУ. \r\n \r\n- РЕМОНТ И ГАРАНТИЯ НЕПОСРЕДСТВЕННО ОТ НАС \r\n \r\nВ ТЕЧЕНИЕ ГАРАНТИЙНОГО СРОКА, ВЫ ОБРАЩАЕТЕСЬ НЕПОСРЕДСТВЕННО К НАМ, НЕЖЕЛИ В КАКОЙ-ТО СЕРВИСНЫЙ ЦЕНТР, ЧТО ГОРАЗДО УДОБНЕЕ И ОПЕРАТИВНЕЕ. \r\n \r\n- ЛУЧШЕЕ СООТНОШЕНИЕ ЦЕНА-КАЧЕСТВО \r\n \r\nЕСЛИ ВЫ И НАЙДЕТЕ ОБОРУДОВАНИЕ С ПОЛНОСТЬЮ АНАЛОГИЧНЫМИ ХАРАКТЕРИСТИКАМИ, ТО ГАРАНТИРОВАННО ПО БОЛЕЕ ВЫСОКОЙ ЦЕНЕ. ЕСЛИ ЭТО ВСЕ ЖЕ СЛУЧИТСЯ, ПРИШЛИТЕ ПРЕДЛОЖЕНИЕ НАМ, И МЫ ГАРАНТИРУЕМ, ЧТО СДЕЛАЕМ ДЕШЕВЛЕ. САМОЕ ВЫГОДНОЕ ПРЕДЛОЖЕНИЕ УЖЕ У ВАС! \r\n \r\n \r\n \r\n \r\n \r\n \r\nЕСЛИ ВОЗНИКНУТ ВОПРОСЫ, БУДУ РАД ВНЕСТИ ЯСНОСТЬ. ОБРАЩАЙТЕСЬ… \r\nС УВАЖЕНИЕМ, СЕРГЕЙ, СВР-ВИДЕО +7 977) 271-01-93 \r\nПОЧТА: SERGEY@SVR-VIDEO.RU \r\nСАЙТ:NEOSAFE.RU', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
