(875, 175, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте! \r\nПредлагаем ручное размещение коммерческого предложения (КП) от Вашей компании на форумах совместных покупок (СП) в разделе для поставщиков. \r\nПример размещаемой записи: \r\nhttp://63pokupki.ru/forum/phpBB3/viewtopic.php?f=124&t=202794&start=1230#p11286530 \r\n \r\nВ чем преимущества такого размещения? \r\n1. Ваше КП увидит целевая аудитория (посещаемость форумов СП от 1 000 до 700 000 человек в сутки); \r\n2. Приобретение нового канала сбыта; \r\n3. Расширение географии сбыта – о Вашей компании узнают в разных городах РФ; \r\n4. Как минимум – проявление заинтересованности в виде запросов о возможностях сотрудничества, как максимум – реализация Вашей продукции. \r\n5. Реклама не только среди организаторов СП, но и сразу среди потенциальных покупателей. \r\n6. Получение дополнительного трафика с 20-250 форумов и рост авторитета Вашей компании в поиске Яндекса, Гугла. \r\n7. Окупаемость рекламы уже после 2-х оптовых реализаций продукции. \r\n \r\nОбратите внимание, что размещение КП происходит под нашими учетными записями без создания новых (логины/пароли не предоставляются). \r\n \r\nРасценки: \r\nПакет мини: 20 форумов СП - 599 р. \r\nПакет нормал: 125 форумов СП - 3 399 р. \r\nПакет ультра: 250 форумов СП - 6 299 р. \r\n \r\nСоставление текста КП - 399 р. \r\nИсправление ошибок в тексте КП - 199 р. \r\nВыполнение работы за 1 сутки - 399 р. \r\n \r\nВремя выполнения – 3-7 рабочих суток \r\n \r\nЕсли Вас заинтересовало данное предложение - пишите на почту:sppiar@bk.ru или заказ можно оформить на нашем сайте https://sppiar.nethouse.ru \r\nВсегда рады помочь! \r\n-- \r\nС уважением, менеджер «СП Пиар», Кирилл Игоревич', 'ЗДРАВСТВУЙТЕ! \r\nПРЕДЛАГАЕМ РУЧНОЕ РАЗМЕЩЕНИЕ КОММЕРЧЕСКОГО ПРЕДЛОЖЕНИЯ (КП) ОТ ВАШЕЙ КОМПАНИИ НА ФОРУМАХ СОВМЕСТНЫХ ПОКУПОК (СП) В РАЗДЕЛЕ ДЛЯ ПОСТАВЩИКОВ. \r\nПРИМЕР РАЗМЕЩАЕМОЙ ЗАПИСИ: \r\nHTTP://63POKUPKI.RU/FORUM/PHPBB3/VIEWTOPIC.PHP?F=124&T=202794&START=1230#P11286530 \r\n \r\nВ ЧЕМ ПРЕИМУЩЕСТВА ТАКОГО РАЗМЕЩЕНИЯ? \r\n1. ВАШЕ КП УВИДИТ ЦЕЛЕВАЯ АУДИТОРИЯ (ПОСЕЩАЕМОСТЬ ФОРУМОВ СП ОТ 1 000 ДО 700 000 ЧЕЛОВЕК В СУТКИ); \r\n2. ПРИОБРЕТЕНИЕ НОВОГО КАНАЛА СБЫТА; \r\n3. РАСШИРЕНИЕ ГЕОГРАФИИ СБЫТА – О ВАШЕЙ КОМПАНИИ УЗНАЮТ В РАЗНЫХ ГОРОДАХ РФ; \r\n4. КАК МИНИМУМ – ПРОЯВЛЕНИЕ ЗАИНТЕРЕСОВАННОСТИ В ВИДЕ ЗАПРОСОВ О ВОЗМОЖНОСТЯХ СОТРУДНИЧЕСТВА, КАК МАКСИМУМ – РЕАЛИЗАЦИЯ ВАШЕЙ ПРОДУКЦИИ. \r\n5. РЕКЛАМА НЕ ТОЛЬКО СРЕДИ ОРГАНИЗАТОРОВ СП, НО И СРАЗУ СРЕДИ ПОТЕНЦИАЛЬНЫХ ПОКУПАТЕЛЕЙ. \r\n6. ПОЛУЧЕНИЕ ДОПОЛНИТЕЛЬНОГО ТРАФИКА С 20-250 ФОРУМОВ И РОСТ АВТОРИТЕТА ВАШЕЙ КОМПАНИИ В ПОИСКЕ ЯНДЕКСА, ГУГЛА. \r\n7. ОКУПАЕМОСТЬ РЕКЛАМЫ УЖЕ ПОСЛЕ 2-Х ОПТОВЫХ РЕАЛИЗАЦИЙ ПРОДУКЦИИ. \r\n \r\nОБРАТИТЕ ВНИМАНИЕ, ЧТО РАЗМЕЩЕНИЕ КП ПРОИСХОДИТ ПОД НАШИМИ УЧЕТНЫМИ ЗАПИСЯМИ БЕЗ СОЗДАНИЯ НОВЫХ (ЛОГИНЫ/ПАРОЛИ НЕ ПРЕДОСТАВЛЯЮТСЯ). \r\n \r\nРАСЦЕНКИ: \r\nПАКЕТ МИНИ: 20 ФОРУМОВ СП - 599 Р. \r\nПАКЕТ НОРМАЛ: 125 ФОРУМОВ СП - 3 399 Р. \r\nПАКЕТ УЛЬТРА: 250 ФОРУМОВ СП - 6 299 Р. \r\n \r\nСОСТАВЛЕНИЕ ТЕКСТА КП - 399 Р. \r\nИСПРАВЛЕНИЕ ОШИБОК В ТЕКСТЕ КП - 199 Р. \r\nВЫПОЛНЕНИЕ РАБОТЫ ЗА 1 СУТКИ - 399 Р. \r\n \r\nВРЕМЯ ВЫПОЛНЕНИЯ – 3-7 РАБОЧИХ СУТОК \r\n \r\nЕСЛИ ВАС ЗАИНТЕРЕСОВАЛО ДАННОЕ ПРЕДЛОЖЕНИЕ - ПИШИТЕ НА ПОЧТУ:SPPIAR@BK.RU ИЛИ ЗАКАЗ МОЖНО ОФОРМИТЬ НА НАШЕМ САЙТЕ HTTPS://SPPIAR.NETHOUSE.RU \r\nВСЕГДА РАДЫ ПОМОЧЬ! \r\n-- \r\nС УВАЖЕНИЕМ, МЕНЕДЖЕР «СП ПИАР», КИРИЛЛ ИГОРЕВИЧ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
