(915, 183, 1, 5, 5, '', NULL, '', NULL, 'Уважаемые дамы и господа! \r\n<img src=\"http://worldsecurity.com.ua/design/wosec-ws/images/watermark.png.pagespeed.ce.dw2LWiZmqN.png\"\"> \r\nКомпания Мир Безопасности (г.Харьков)  спешит сообщить, что уже лето подошло к концу, а значит и наши летние скидки тоже. \r\nНапоминаем, что уезжая в туры, отпуска, командировки и другие поездки не забывайте про свою безопасность и ваших близких. \r\nНаши специалисты подготовили множество интересного и полезного материала, например,  <a href=https://worldsecurity.com.ua/blog/ustanovka-kamer-nablyudeniya-v-obschestvennyh-mestah>Установка камер наблюдения в общественных местах</a> \r\nМы всегда готовы прийти к Вам на помощь и сделать ваш мир безопасным с использованием технологий европейского уровня, на базе такого современного оборудования систем безопасности, как Dahau, Hikvision, Partizan и др. \r\nОбращаться можно по адресу: 61003, Харьков, пл. Конституции, 1. 8 подъезд, 2 этаж \r\nТелефоны: (057) 755-31-21, (066) 381-31-21viber, (067) 301-36-63, (073) 381-31-21 \r\nВремя работы: Пн-Пт 9:30 - 17:30 \r\nhttps://worldsecurity.com.ua/', 'УВАЖАЕМЫЕ ДАМЫ И ГОСПОДА! \r\n<IMG SRC=\"HTTP://WORLDSECURITY.COM.UA/DESIGN/WOSEC-WS/IMAGES/WATERMARK.PNG.PAGESPEED.CE.DW2LWIZMQN.PNG\"\"> \r\nКОМПАНИЯ МИР БЕЗОПАСНОСТИ (Г.ХАРЬКОВ)  СПЕШИТ СООБЩИТЬ, ЧТО УЖЕ ЛЕТО ПОДОШЛО К КОНЦУ, А ЗНАЧИТ И НАШИ ЛЕТНИЕ СКИДКИ ТОЖЕ. \r\nНАПОМИНАЕМ, ЧТО УЕЗЖАЯ В ТУРЫ, ОТПУСКА, КОМАНДИРОВКИ И ДРУГИЕ ПОЕЗДКИ НЕ ЗАБЫВАЙТЕ ПРО СВОЮ БЕЗОПАСНОСТЬ И ВАШИХ БЛИЗКИХ. \r\nНАШИ СПЕЦИАЛИСТЫ ПОДГОТОВИЛИ МНОЖЕСТВО ИНТЕРЕСНОГО И ПОЛЕЗНОГО МАТЕРИАЛА, НАПРИМЕР,  <A HREF=HTTPS://WORLDSECURITY.COM.UA/BLOG/USTANOVKA-KAMER-NABLYUDENIYA-V-OBSCHESTVENNYH-MESTAH>УСТАНОВКА КАМЕР НАБЛЮДЕНИЯ В ОБЩЕСТВЕННЫХ МЕСТАХ</A> \r\nМЫ ВСЕГДА ГОТОВЫ ПРИЙТИ К ВАМ НА ПОМОЩЬ И СДЕЛАТЬ ВАШ МИР БЕЗОПАСНЫМ С ИСПОЛЬЗОВАНИЕМ ТЕХНОЛОГИЙ ЕВРОПЕЙСКОГО УРОВНЯ, НА БАЗЕ ТАКОГО СОВРЕМЕННОГО ОБОРУДОВАНИЯ СИСТЕМ БЕЗОПАСНОСТИ, КАК DAHAU, HIKVISION, PARTIZAN И ДР. \r\nОБРАЩАТЬСЯ МОЖНО ПО АДРЕСУ: 61003, ХАРЬКОВ, ПЛ. КОНСТИТУЦИИ, 1. 8 ПОДЪЕЗД, 2 ЭТАЖ \r\nТЕЛЕФОНЫ: (057) 755-31-21, (066) 381-31-21VIBER, (067) 301-36-63, (073) 381-31-21 \r\nВРЕМЯ РАБОТЫ: ПН-ПТ 9:30 - 17:30 \r\nHTTPS://WORLDSECURITY.COM.UA/', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
