(920, 184, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте! \r\n \r\nПоставляем промышленное электрооборудование c 1997 года. Восемь часов рабочего времени \r\nпосвящаем исключительно данному оборудованию. Глубокое знание продукта. \r\n \r\nОкажем проф. помощь по выбору ЧРП, УПП, для асинхронных эл. двигателей. \r\nПодберем замену на качественные комплектующие из промышленного электрооборудования. \r\nВышлем опросные листы на сложное оборудование. Окажем тех. поддержку. \r\nБесплатная доставка до терминала трансп комп в Москве, поставка в регионы. \r\n \r\nВ Вашем распоряжении, со склада в Москве: \r\n \r\n-Автоматические выключатели до 6300А включительно \r\n-Автоматы защиты электродвигателя \r\n-Блоки питания \r\n-Выключатели нагрузки \r\n-Датчики промышленные \r\n-Джойстики \r\n-Дифф.автоматы \r\n-ИБП для промышленности \r\n-ИБП для гражданского строительства \r\n-Кнопки и лампочки (светосигнальная арматура) \r\n-Конденсаторные установки \r\n-Контакторы \r\n-Контроллеры \r\n-Устройства плавного пуска \r\n-Частотные преобразователи \r\n-Шкафы и щиты распределительные \r\n \r\nИ многое другое: \r\n \r\nСервоприводы, шаговые двигатели Lexium, Энкодеры, реле Zelio Logic, \r\nблоки питания, Трансформаторы напряжения, твердотельные реле ..., и т. д. \r\n \r\nБудем Рады стать партнером Вашей компании, по поставкам \r\nкомплектующих промышленного назначения. \r\nЗа свой счет доставим до терминала транспортной компании в Москве. \r\n \r\n \r\nhttp://www.electrical-production.ru', 'ЗДРАВСТВУЙТЕ! \r\n \r\nПОСТАВЛЯЕМ ПРОМЫШЛЕННОЕ ЭЛЕКТРООБОРУДОВАНИЕ C 1997 ГОДА. ВОСЕМЬ ЧАСОВ РАБОЧЕГО ВРЕМЕНИ \r\nПОСВЯЩАЕМ ИСКЛЮЧИТЕЛЬНО ДАННОМУ ОБОРУДОВАНИЮ. ГЛУБОКОЕ ЗНАНИЕ ПРОДУКТА. \r\n \r\nОКАЖЕМ ПРОФ. ПОМОЩЬ ПО ВЫБОРУ ЧРП, УПП, ДЛЯ АСИНХРОННЫХ ЭЛ. ДВИГАТЕЛЕЙ. \r\nПОДБЕРЕМ ЗАМЕНУ НА КАЧЕСТВЕННЫЕ КОМПЛЕКТУЮЩИЕ ИЗ ПРОМЫШЛЕННОГО ЭЛЕКТРООБОРУДОВАНИЯ. \r\nВЫШЛЕМ ОПРОСНЫЕ ЛИСТЫ НА СЛОЖНОЕ ОБОРУДОВАНИЕ. ОКАЖЕМ ТЕХ. ПОДДЕРЖКУ. \r\nБЕСПЛАТНАЯ ДОСТАВКА ДО ТЕРМИНАЛА ТРАНСП КОМП В МОСКВЕ, ПОСТАВКА В РЕГИОНЫ. \r\n \r\nВ ВАШЕМ РАСПОРЯЖЕНИИ, СО СКЛАДА В МОСКВЕ: \r\n \r\n-АВТОМАТИЧЕСКИЕ ВЫКЛЮЧАТЕЛИ ДО 6300А ВКЛЮЧИТЕЛЬНО \r\n-АВТОМАТЫ ЗАЩИТЫ ЭЛЕКТРОДВИГАТЕЛЯ \r\n-БЛОКИ ПИТАНИЯ \r\n-ВЫКЛЮЧАТЕЛИ НАГРУЗКИ \r\n-ДАТЧИКИ ПРОМЫШЛЕННЫЕ \r\n-ДЖОЙСТИКИ \r\n-ДИФФ.АВТОМАТЫ \r\n-ИБП ДЛЯ ПРОМЫШЛЕННОСТИ \r\n-ИБП ДЛЯ ГРАЖДАНСКОГО СТРОИТЕЛЬСТВА \r\n-КНОПКИ И ЛАМПОЧКИ (СВЕТОСИГНАЛЬНАЯ АРМАТУРА) \r\n-КОНДЕНСАТОРНЫЕ УСТАНОВКИ \r\n-КОНТАКТОРЫ \r\n-КОНТРОЛЛЕРЫ \r\n-УСТРОЙСТВА ПЛАВНОГО ПУСКА \r\n-ЧАСТОТНЫЕ ПРЕОБРАЗОВАТЕЛИ \r\n-ШКАФЫ И ЩИТЫ РАСПРЕДЕЛИТЕЛЬНЫЕ \r\n \r\nИ МНОГОЕ ДРУГОЕ: \r\n \r\nСЕРВОПРИВОДЫ, ШАГОВЫЕ ДВИГАТЕЛИ LEXIUM, ЭНКОДЕРЫ, РЕЛЕ ZELIO LOGIC, \r\nБЛОКИ ПИТАНИЯ, ТРАНСФОРМАТОРЫ НАПРЯЖЕНИЯ, ТВЕРДОТЕЛЬНЫЕ РЕЛЕ ..., И Т. Д. \r\n \r\nБУДЕМ РАДЫ СТАТЬ ПАРТНЕРОМ ВАШЕЙ КОМПАНИИ, ПО ПОСТАВКАМ \r\nКОМПЛЕКТУЮЩИХ ПРОМЫШЛЕННОГО НАЗНАЧЕНИЯ. \r\nЗА СВОЙ СЧЕТ ДОСТАВИМ ДО ТЕРМИНАЛА ТРАНСПОРТНОЙ КОМПАНИИ В МОСКВЕ. \r\n \r\n \r\nHTTP://WWW.ELECTRICAL-PRODUCTION.RU', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
