(925, 185, 1, 5, 5, '', NULL, '', NULL, 'Приветствую Вас, меня зовут Николай и я частный интернет-маркетолог \r\n \r\nРазвиваюсь в сфере интернет-маркетинга с 2009 года \r\nА точнее: \r\n \r\n— Занимаюсь Seo продвижением сайтов и прекрасно понимаю сколько факторов влияют на рост трафика и позиций в поисковой системе Яндекс и Google. Имею опыт продвижения высоко-конкурентных коммерческих сайтов по региону Москва и МО. Это пластиковые окна, сайт агентств по недвижимости, такси, ремонт квартир и бухгалтерские услуги. \r\n \r\n— Последние годы: \r\nзанимаюсь привлечение трафика путём настройки и ведения контекстной рекламы в Яндекс. Директ и Google. Adwords \r\n \r\n— внедрением CRM систем: AmoCrm и Bitrix24. \r\n*По Bitrix24 являюсь сертифицированным специалистом \r\n \r\n \r\nУмею привлекать трафик | заявки в конкурентных нишах в Москве + по России и СНГ: \r\nСтоимость заявки по Москве и обл: от 43 до 1740 рублей - цена от вашей ниши зависит. \r\n \r\n——Что я могу сделать для Вас: \r\n \r\n— Качественно настроить контекстную рекламу Я.Директ и G.Adwords \r\n• Сроки разработки рекламных компаний — 8 дней; \r\n• Стоимость — 7000 рублей* \r\n*При выделяемом вами рекламном бюджете на 1 месяц не меньше 40 000 рублей. \r\n \r\n—Что входит в работу: \r\n• Разработка детального Midemap под вашу нишу \r\n• Аудит объявлений конкурентов \r\n• Аудит ваших посадочных страниц и составление дельных рекомендаций, для повышения cTR (из посетителя в заявку или звонок) \r\n• Сбор и кластеризация семантики на горячие/теплые/холодные ключевые блоки \r\n• Качественная минусация + крос-мнусация объявлений (устранение не целевого трафика) \r\n• Ведение рекламной компании 7 дней, после проводится доработка за счет собранных данных за эти дни. \r\n \r\nО моей работе есть видео отзывы моих заказчиков. Высылаю по запросу через почту: zns.wiki@gmail.com \r\n \r\nСмотрите. \r\nУ вас наверняка есть и будут вопросы по каким либо направлениям, будь это Seo, контекстная реклама, создание сайта, внедрение Crm системы. \r\nЯ всегда готов оказать Вам бесплатные консультации по вашим вопросам: \r\n \r\nВАЖНО: Пишите на почту: \r\nzns.wiki@gmail.com', 'ПРИВЕТСТВУЮ ВАС, МЕНЯ ЗОВУТ НИКОЛАЙ И Я ЧАСТНЫЙ ИНТЕРНЕТ-МАРКЕТОЛОГ \r\n \r\nРАЗВИВАЮСЬ В СФЕРЕ ИНТЕРНЕТ-МАРКЕТИНГА С 2009 ГОДА \r\nА ТОЧНЕЕ: \r\n \r\n— ЗАНИМАЮСЬ SEO ПРОДВИЖЕНИЕМ САЙТОВ И ПРЕКРАСНО ПОНИМАЮ СКОЛЬКО ФАКТОРОВ ВЛИЯЮТ НА РОСТ ТРАФИКА И ПОЗИЦИЙ В ПОИСКОВОЙ СИСТЕМЕ ЯНДЕКС И GOOGLE. ИМЕЮ ОПЫТ ПРОДВИЖЕНИЯ ВЫСОКО-КОНКУРЕНТНЫХ КОММЕРЧЕСКИХ САЙТОВ ПО РЕГИОНУ МОСКВА И МО. ЭТО ПЛАСТИКОВЫЕ ОКНА, САЙТ АГЕНТСТВ ПО НЕДВИЖИМОСТИ, ТАКСИ, РЕМОНТ КВАРТИР И БУХГАЛТЕРСКИЕ УСЛУГИ. \r\n \r\n— ПОСЛЕДНИЕ ГОДЫ: \r\nЗАНИМАЮСЬ ПРИВЛЕЧЕНИЕ ТРАФИКА ПУТЁМ НАСТРОЙКИ И ВЕДЕНИЯ КОНТЕКСТНОЙ РЕКЛАМЫ В ЯНДЕКС. ДИРЕКТ И GOOGLE. ADWORDS \r\n \r\n— ВНЕДРЕНИЕМ CRM СИСТЕМ: AMOCRM И BITRIX24. \r\n*ПО BITRIX24 ЯВЛЯЮСЬ СЕРТИФИЦИРОВАННЫМ СПЕЦИАЛИСТОМ \r\n \r\n \r\nУМЕЮ ПРИВЛЕКАТЬ ТРАФИК | ЗАЯВКИ В КОНКУРЕНТНЫХ НИШАХ В МОСКВЕ + ПО РОССИИ И СНГ: \r\nСТОИМОСТЬ ЗАЯВКИ ПО МОСКВЕ И ОБЛ: ОТ 43 ДО 1740 РУБЛЕЙ - ЦЕНА ОТ ВАШЕЙ НИШИ ЗАВИСИТ. \r\n \r\n——ЧТО Я МОГУ СДЕЛАТЬ ДЛЯ ВАС: \r\n \r\n— КАЧЕСТВЕННО НАСТРОИТЬ КОНТЕКСТНУЮ РЕКЛАМУ Я.ДИРЕКТ И G.ADWORDS \r\n• СРОКИ РАЗРАБОТКИ РЕКЛАМНЫХ КОМПАНИЙ — 8 ДНЕЙ; \r\n• СТОИМОСТЬ — 7000 РУБЛЕЙ* \r\n*ПРИ ВЫДЕЛЯЕМОМ ВАМИ РЕКЛАМНОМ БЮДЖЕТЕ НА 1 МЕСЯЦ НЕ МЕНЬШЕ 40 000 РУБЛЕЙ. \r\n \r\n—ЧТО ВХОДИТ В РАБОТУ: \r\n• РАЗРАБОТКА ДЕТАЛЬНОГО MIDEMAP ПОД ВАШУ НИШУ \r\n• АУДИТ ОБЪЯВЛЕНИЙ КОНКУРЕНТОВ \r\n• АУДИТ ВАШИХ ПОСАДОЧНЫХ СТРАНИЦ И СОСТАВЛЕНИЕ ДЕЛЬНЫХ РЕКОМЕНДАЦИЙ, ДЛЯ ПОВЫШЕНИЯ CTR (ИЗ ПОСЕТИТЕЛЯ В ЗАЯВКУ ИЛИ ЗВОНОК) \r\n• СБОР И КЛАСТЕРИЗАЦИЯ СЕМАНТИКИ НА ГОРЯЧИЕ/ТЕПЛЫЕ/ХОЛОДНЫЕ КЛЮЧЕВЫЕ БЛОКИ \r\n• КАЧЕСТВЕННАЯ МИНУСАЦИЯ + КРОС-МНУСАЦИЯ ОБЪЯВЛЕНИЙ (УСТРАНЕНИЕ НЕ ЦЕЛЕВОГО ТРАФИКА) \r\n• ВЕДЕНИЕ РЕКЛАМНОЙ КОМПАНИИ 7 ДНЕЙ, ПОСЛЕ ПРОВОДИТСЯ ДОРАБОТКА ЗА СЧЕТ СОБРАННЫХ ДАННЫХ ЗА ЭТИ ДНИ. \r\n \r\nО МОЕЙ РАБОТЕ ЕСТЬ ВИДЕО ОТЗЫВЫ МОИХ ЗАКАЗЧИКОВ. ВЫСЫЛАЮ ПО ЗАПРОСУ ЧЕРЕЗ ПОЧТУ: ZNS.WIKI@GMAIL.COM \r\n \r\nСМОТРИТЕ. \r\nУ ВАС НАВЕРНЯКА ЕСТЬ И БУДУТ ВОПРОСЫ ПО КАКИМ ЛИБО НАПРАВЛЕНИЯМ, БУДЬ ЭТО SEO, КОНТЕКСТНАЯ РЕКЛАМА, СОЗДАНИЕ САЙТА, ВНЕДРЕНИЕ CRM СИСТЕМЫ. \r\nЯ ВСЕГДА ГОТОВ ОКАЗАТЬ ВАМ БЕСПЛАТНЫЕ КОНСУЛЬТАЦИИ ПО ВАШИМ ВОПРОСАМ: \r\n \r\nВАЖНО: ПИШИТЕ НА ПОЧТУ: \r\nZNS.WIKI@GMAIL.COM', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
