(1010, 202, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте, меня зовут Евгений и я частный специалист по настройке контекстной рекламы \r\n— уже 3 года занимаюсь настройкой и ведением рекламных компаний в Яндекс. Директ и Google Adwords \r\n \r\nЯвляюсь сертифицированным специалистом по Я.Директ/Метрика. \r\n \r\nРаботал с нишами (в основном в конкурентной Москве и МО) : \r\n— Недвижимость: Продажа квартир в новостройках \r\n— Подбор персонала: Поиск новых сотрудников (Риэлторов) \r\n— Пластиковые окна: Продажа и установка \r\n— Видеонаблюдение: готовые комплекты и установка \r\n— (ОПТ) Производство газовых баллонов: тороидальные и цилиндрические \r\n— Газовое оборудование на автомобили: Магазин + сервисы установки \r\n— Карнавальные костюмы: для детей и взрослых \r\n— Наружная реклама: производство и монтаж \r\n— (ОПТ) Производство: продажа джута, пакли, нагеля, мешковины, брезенты и тд.. \r\n— (ОПТ) Детские товары: кроватки, комоды, электрокачели, коляски и тд.. \r\n— Салон красоты: полный спектр услуг \r\n— Тату салон: нанесение тату, пирсинг, татуаж \r\n— Стоматологическая клиника: полный спектр услуг \r\n— Ювелирный магазин: продажа золотых и серебренных изделий \r\n— Магазин часов: продажа швейцарских часов \r\n— Фитнес клуб / Ems фитнес / Персональные тренировки \r\n— Автошкола: обучение по категориям A/B/C/D \r\n— Кафе-ресторан \r\n— Студия маникюра \r\n— Продажа бетона \r\n— Строительство загородных домов \r\n— Такси \r\n— Ремонт АКПП \r\n \r\n \r\n-+- Стоимость работ: \r\nНастройка Яндекс. Директ: 5000 рублей, сроки 5 дней \r\nНастройка Google adwords: 5000 рублей, сроки 5 дней \r\nВедение 1 неделю - Бесплатно \r\n \r\nРаботал с рекламными бюджетами до 285 000 рублей в месяц. \r\nРаботаю в долгую. \r\n \r\n \r\nЕсли вы заинтересованы, прошу написать мне на почту: evgen.contex@gmail.com -', 'ЗДРАВСТВУЙТЕ, МЕНЯ ЗОВУТ ЕВГЕНИЙ И Я ЧАСТНЫЙ СПЕЦИАЛИСТ ПО НАСТРОЙКЕ КОНТЕКСТНОЙ РЕКЛАМЫ \r\n— УЖЕ 3 ГОДА ЗАНИМАЮСЬ НАСТРОЙКОЙ И ВЕДЕНИЕМ РЕКЛАМНЫХ КОМПАНИЙ В ЯНДЕКС. ДИРЕКТ И GOOGLE ADWORDS \r\n \r\nЯВЛЯЮСЬ СЕРТИФИЦИРОВАННЫМ СПЕЦИАЛИСТОМ ПО Я.ДИРЕКТ/МЕТРИКА. \r\n \r\nРАБОТАЛ С НИШАМИ (В ОСНОВНОМ В КОНКУРЕНТНОЙ МОСКВЕ И МО) : \r\n— НЕДВИЖИМОСТЬ: ПРОДАЖА КВАРТИР В НОВОСТРОЙКАХ \r\n— ПОДБОР ПЕРСОНАЛА: ПОИСК НОВЫХ СОТРУДНИКОВ (РИЭЛТОРОВ) \r\n— ПЛАСТИКОВЫЕ ОКНА: ПРОДАЖА И УСТАНОВКА \r\n— ВИДЕОНАБЛЮДЕНИЕ: ГОТОВЫЕ КОМПЛЕКТЫ И УСТАНОВКА \r\n— (ОПТ) ПРОИЗВОДСТВО ГАЗОВЫХ БАЛЛОНОВ: ТОРОИДАЛЬНЫЕ И ЦИЛИНДРИЧЕСКИЕ \r\n— ГАЗОВОЕ ОБОРУДОВАНИЕ НА АВТОМОБИЛИ: МАГАЗИН + СЕРВИСЫ УСТАНОВКИ \r\n— КАРНАВАЛЬНЫЕ КОСТЮМЫ: ДЛЯ ДЕТЕЙ И ВЗРОСЛЫХ \r\n— НАРУЖНАЯ РЕКЛАМА: ПРОИЗВОДСТВО И МОНТАЖ \r\n— (ОПТ) ПРОИЗВОДСТВО: ПРОДАЖА ДЖУТА, ПАКЛИ, НАГЕЛЯ, МЕШКОВИНЫ, БРЕЗЕНТЫ И ТД.. \r\n— (ОПТ) ДЕТСКИЕ ТОВАРЫ: КРОВАТКИ, КОМОДЫ, ЭЛЕКТРОКАЧЕЛИ, КОЛЯСКИ И ТД.. \r\n— САЛОН КРАСОТЫ: ПОЛНЫЙ СПЕКТР УСЛУГ \r\n— ТАТУ САЛОН: НАНЕСЕНИЕ ТАТУ, ПИРСИНГ, ТАТУАЖ \r\n— СТОМАТОЛОГИЧЕСКАЯ КЛИНИКА: ПОЛНЫЙ СПЕКТР УСЛУГ \r\n— ЮВЕЛИРНЫЙ МАГАЗИН: ПРОДАЖА ЗОЛОТЫХ И СЕРЕБРЕННЫХ ИЗДЕЛИЙ \r\n— МАГАЗИН ЧАСОВ: ПРОДАЖА ШВЕЙЦАРСКИХ ЧАСОВ \r\n— ФИТНЕС КЛУБ / EMS ФИТНЕС / ПЕРСОНАЛЬНЫЕ ТРЕНИРОВКИ \r\n— АВТОШКОЛА: ОБУЧЕНИЕ ПО КАТЕГОРИЯМ A/B/C/D \r\n— КАФЕ-РЕСТОРАН \r\n— СТУДИЯ МАНИКЮРА \r\n— ПРОДАЖА БЕТОНА \r\n— СТРОИТЕЛЬСТВО ЗАГОРОДНЫХ ДОМОВ \r\n— ТАКСИ \r\n— РЕМОНТ АКПП \r\n \r\n \r\n-+- СТОИМОСТЬ РАБОТ: \r\nНАСТРОЙКА ЯНДЕКС. ДИРЕКТ: 5000 РУБЛЕЙ, СРОКИ 5 ДНЕЙ \r\nНАСТРОЙКА GOOGLE ADWORDS: 5000 РУБЛЕЙ, СРОКИ 5 ДНЕЙ \r\nВЕДЕНИЕ 1 НЕДЕЛЮ - БЕСПЛАТНО \r\n \r\nРАБОТАЛ С РЕКЛАМНЫМИ БЮДЖЕТАМИ ДО 285 000 РУБЛЕЙ В МЕСЯЦ. \r\nРАБОТАЮ В ДОЛГУЮ. \r\n \r\n \r\nЕСЛИ ВЫ ЗАИНТЕРЕСОВАНЫ, ПРОШУ НАПИСАТЬ МНЕ НА ПОЧТУ: EVGEN.CONTEX@GMAIL.COM -', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
