(1055, 211, 1, 5, 5, '', NULL, '', NULL, '23 октября БМ Институт запускает онлайн-марафон «100 лидов». Этот новый формат обучения, который длится 5 недели и включает в себя видеоуроки с заданиями. По каждому выполненному заданию наставник марафона Александр Воловик дает обратную связь в прямом эфире \r\n \r\nЗа 5 дней вы внедрите бесплатные инструменты и запустите трафик. Просто повторите по инструкции и по итогу соберете 100 заявок и звонков в свой бизнес \r\nСмотрите подробности: https://api.institute-bm.com/landing/marathon-100-leads/ \r\n', '23 ОКТЯБРЯ БМ ИНСТИТУТ ЗАПУСКАЕТ ОНЛАЙН-МАРАФОН «100 ЛИДОВ». ЭТОТ НОВЫЙ ФОРМАТ ОБУЧЕНИЯ, КОТОРЫЙ ДЛИТСЯ 5 НЕДЕЛИ И ВКЛЮЧАЕТ В СЕБЯ ВИДЕОУРОКИ С ЗАДАНИЯМИ. ПО КАЖДОМУ ВЫПОЛНЕННОМУ ЗАДАНИЮ НАСТАВНИК МАРАФОНА АЛЕКСАНДР ВОЛОВИК ДАЕТ ОБРАТНУЮ СВЯЗЬ В ПРЯМОМ ЭФИРЕ \r\n \r\nЗА 5 ДНЕЙ ВЫ ВНЕДРИТЕ БЕСПЛАТНЫЕ ИНСТРУМЕНТЫ И ЗАПУСТИТЕ ТРАФИК. ПРОСТО ПОВТОРИТЕ ПО ИНСТРУКЦИИ И ПО ИТОГУ СОБЕРЕТЕ 100 ЗАЯВОК И ЗВОНКОВ В СВОЙ БИЗНЕС \r\nСМОТРИТЕ ПОДРОБНОСТИ: HTTPS://API.INSTITUTE-BM.COM/LANDING/MARATHON-100-LEADS/', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
