(1060, 212, 1, 5, 5, '', NULL, '', NULL, 'Добрый день! \r\nМеня зовут Анастасия, я являюсь менеджером агентства «ПромоХаб» \r\nАгентство наше занимается услугами для бизнеса. \r\nХотела бы предложить Вам начать привлекать поток клиентов с YouTube. А именно предлагаем разработку красивых продающих анимационных роликов с профессиональным диктором. И предлагаем размещение ролика в YouTube в формате рекламы перед видео. То есть данную рекламу обычно видят перед видео с пометкой «Пропустить» через 5 секунд. \r\nРазработка самого ролика стоит от 15000р за 30 секунд. Настройка рекламной кампании в Ютюбе 5000рублей за один ролик. Стоимость за 1 переход по ссылке в ролике будет стоить 2-3 рубля, что дешевле контекстной рекламы в 10-20 раз! За просмотр видео до 29 секунды деньги с кошелька не списываются. После 29 секунд списываются как за клик по ссылке. \r\nДанная реклама невероятно дешево обходится по сравнению с остальными типами рекламы . \r\nА до 5й секунды люди не могут пропустить ролик. То есть реклама не только приводит клиентов, но и бесплатно заставляет людей держать компанию на слуху! Что очень важно в современном бизнесе. \r\nЕсли Вам интересен данный тип современного эффективного продвижения бизнеса, то пишите на почту promohab@inbox.ru \r\nТакже занимаемся многими другими не менее интересными вещами, подробности читайте на promohab.ru', 'ДОБРЫЙ ДЕНЬ! \r\nМЕНЯ ЗОВУТ АНАСТАСИЯ, Я ЯВЛЯЮСЬ МЕНЕДЖЕРОМ АГЕНТСТВА «ПРОМОХАБ» \r\nАГЕНТСТВО НАШЕ ЗАНИМАЕТСЯ УСЛУГАМИ ДЛЯ БИЗНЕСА. \r\nХОТЕЛА БЫ ПРЕДЛОЖИТЬ ВАМ НАЧАТЬ ПРИВЛЕКАТЬ ПОТОК КЛИЕНТОВ С YOUTUBE. А ИМЕННО ПРЕДЛАГАЕМ РАЗРАБОТКУ КРАСИВЫХ ПРОДАЮЩИХ АНИМАЦИОННЫХ РОЛИКОВ С ПРОФЕССИОНАЛЬНЫМ ДИКТОРОМ. И ПРЕДЛАГАЕМ РАЗМЕЩЕНИЕ РОЛИКА В YOUTUBE В ФОРМАТЕ РЕКЛАМЫ ПЕРЕД ВИДЕО. ТО ЕСТЬ ДАННУЮ РЕКЛАМУ ОБЫЧНО ВИДЯТ ПЕРЕД ВИДЕО С ПОМЕТКОЙ «ПРОПУСТИТЬ» ЧЕРЕЗ 5 СЕКУНД. \r\nРАЗРАБОТКА САМОГО РОЛИКА СТОИТ ОТ 15000Р ЗА 30 СЕКУНД. НАСТРОЙКА РЕКЛАМНОЙ КАМПАНИИ В ЮТЮБЕ 5000РУБЛЕЙ ЗА ОДИН РОЛИК. СТОИМОСТЬ ЗА 1 ПЕРЕХОД ПО ССЫЛКЕ В РОЛИКЕ БУДЕТ СТОИТЬ 2-3 РУБЛЯ, ЧТО ДЕШЕВЛЕ КОНТЕКСТНОЙ РЕКЛАМЫ В 10-20 РАЗ! ЗА ПРОСМОТР ВИДЕО ДО 29 СЕКУНДЫ ДЕНЬГИ С КОШЕЛЬКА НЕ СПИСЫВАЮТСЯ. ПОСЛЕ 29 СЕКУНД СПИСЫВАЮТСЯ КАК ЗА КЛИК ПО ССЫЛКЕ. \r\nДАННАЯ РЕКЛАМА НЕВЕРОЯТНО ДЕШЕВО ОБХОДИТСЯ ПО СРАВНЕНИЮ С ОСТАЛЬНЫМИ ТИПАМИ РЕКЛАМЫ . \r\nА ДО 5Й СЕКУНДЫ ЛЮДИ НЕ МОГУТ ПРОПУСТИТЬ РОЛИК. ТО ЕСТЬ РЕКЛАМА НЕ ТОЛЬКО ПРИВОДИТ КЛИЕНТОВ, НО И БЕСПЛАТНО ЗАСТАВЛЯЕТ ЛЮДЕЙ ДЕРЖАТЬ КОМПАНИЮ НА СЛУХУ! ЧТО ОЧЕНЬ ВАЖНО В СОВРЕМЕННОМ БИЗНЕСЕ. \r\nЕСЛИ ВАМ ИНТЕРЕСЕН ДАННЫЙ ТИП СОВРЕМЕННОГО ЭФФЕКТИВНОГО ПРОДВИЖЕНИЯ БИЗНЕСА, ТО ПИШИТЕ НА ПОЧТУ PROMOHAB@INBOX.RU \r\nТАКЖЕ ЗАНИМАЕМСЯ МНОГИМИ ДРУГИМИ НЕ МЕНЕЕ ИНТЕРЕСНЫМИ ВЕЩАМИ, ПОДРОБНОСТИ ЧИТАЙТЕ НА PROMOHAB.RU', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
