(1065, 213, 1, 5, 5, '', NULL, '', NULL, 'Приветствую Вас, меня зовут Александр, и я частный интернет-маркетолог и директолог. \r\nС 2015 года занимаюсь привлечением трафика путём настройки и ведения контекстной рекламы в Яндекс.Директ и Google.Реклама. \r\n \r\nНапишите на почту или позвоните, \r\nПочта: alex2015.marketolog@gmail.com \r\nТелефон: 8(977)463-11-76 \r\n \r\nЗа это время я приобрел большой опыт в создании рекламных компаний, которые показывают реальный результат : увеличивают количество поступающих обращений за счет привлечения новой аудитории. \r\n \r\n \r\nПутем глубокого анализа рекламных компаний, снижаю расходы на рекламу и в разы увеличиваю ее эффективность: \r\n- настраиваю рекламу так, чтобы она показывалась только вашей целевой аудитории \r\n- устраняю нецелевой трафик, который съедает ваш бюджет \r\n \r\nВсе знают, что реклама – двигатель торговли. Этот канал дает клиентов в максимально быстрые сроки. Моя задача — сделать для Вас рекламу прозрачной и финансово выгодной. \r\nПри работе максимально погружаюсь в вашу тематику, веду \r\nплотное взаимодействие с заказчиком и провожу сравнительный анализ конкурентов. \r\nДаю советы по улучшению показателей конверсии сайта. \r\n \r\nЯ работаю с разными клиентами, включая крупных заказчиков с рекламным бюджетом до 400 000 руб. в месяц. \r\n \r\nСильные стороны, которые выделяют во мне заказчики: \r\n1. Высокая эффективность и отличный результат \r\n2. Всегда на связи \r\n3. Оперативное выполнение задач \r\n \r\n--- КОМУ я буду полезен: \r\n- интернет-магазинам \r\n- сайтам с услугами \r\nДля увеличения количества заявок \r\n \r\n--- ЧЕМ я буду Вам полезен: \r\nКачественно настрою эффективную контекстную рекламу Яндекс.Директ, РСЯ или Гугл.Реклама, КМС \r\nСрок разработки рекламных компаний от 3 до 9 дней; \r\nСтоимость 1 рекламной системы 9 900 руб. для тематики услуг и 15 900 руб. для интернет-магазинов. \r\n \r\n--- ДОПОЛНИТЕЛЬНО занимаюсь: \r\nКомплексной поддержкой вашего бизнеса по онлайн маркетингу - это не только реклама, но доработки по сайтам, телефонии, акциям и скидкам \r\n \r\nУ вас наверняка есть и будут вопросы по контекстной рекламе, я буду рад ответить на них. \r\n \r\nНапишите на почту или позвоните, \r\nПочта: alex2015.marketolog@gmail.com \r\nТелефон: 8(977)463-11-76 \r\n \r\nСпасибо Вам за прочтение моего сообщения, жду Ваших обращений.', 'ПРИВЕТСТВУЮ ВАС, МЕНЯ ЗОВУТ АЛЕКСАНДР, И Я ЧАСТНЫЙ ИНТЕРНЕТ-МАРКЕТОЛОГ И ДИРЕКТОЛОГ. \r\nС 2015 ГОДА ЗАНИМАЮСЬ ПРИВЛЕЧЕНИЕМ ТРАФИКА ПУТЁМ НАСТРОЙКИ И ВЕДЕНИЯ КОНТЕКСТНОЙ РЕКЛАМЫ В ЯНДЕКС.ДИРЕКТ И GOOGLE.РЕКЛАМА. \r\n \r\nНАПИШИТЕ НА ПОЧТУ ИЛИ ПОЗВОНИТЕ, \r\nПОЧТА: ALEX2015.MARKETOLOG@GMAIL.COM \r\nТЕЛЕФОН: 8(977)463-11-76 \r\n \r\nЗА ЭТО ВРЕМЯ Я ПРИОБРЕЛ БОЛЬШОЙ ОПЫТ В СОЗДАНИИ РЕКЛАМНЫХ КОМПАНИЙ, КОТОРЫЕ ПОКАЗЫВАЮТ РЕАЛЬНЫЙ РЕЗУЛЬТАТ : УВЕЛИЧИВАЮТ КОЛИЧЕСТВО ПОСТУПАЮЩИХ ОБРАЩЕНИЙ ЗА СЧЕТ ПРИВЛЕЧЕНИЯ НОВОЙ АУДИТОРИИ. \r\n \r\n \r\nПУТЕМ ГЛУБОКОГО АНАЛИЗА РЕКЛАМНЫХ КОМПАНИЙ, СНИЖАЮ РАСХОДЫ НА РЕКЛАМУ И В РАЗЫ УВЕЛИЧИВАЮ ЕЕ ЭФФЕКТИВНОСТЬ: \r\n- НАСТРАИВАЮ РЕКЛАМУ ТАК, ЧТОБЫ ОНА ПОКАЗЫВАЛАСЬ ТОЛЬКО ВАШЕЙ ЦЕЛЕВОЙ АУДИТОРИИ \r\n- УСТРАНЯЮ НЕЦЕЛЕВОЙ ТРАФИК, КОТОРЫЙ СЪЕДАЕТ ВАШ БЮДЖЕТ \r\n \r\nВСЕ ЗНАЮТ, ЧТО РЕКЛАМА – ДВИГАТЕЛЬ ТОРГОВЛИ. ЭТОТ КАНАЛ ДАЕТ КЛИЕНТОВ В МАКСИМАЛЬНО БЫСТРЫЕ СРОКИ. МОЯ ЗАДАЧА — СДЕЛАТЬ ДЛЯ ВАС РЕКЛАМУ ПРОЗРАЧНОЙ И ФИНАНСОВО ВЫГОДНОЙ. \r\nПРИ РАБОТЕ МАКСИМАЛЬНО ПОГРУЖАЮСЬ В ВАШУ ТЕМАТИКУ, ВЕДУ \r\nПЛОТНОЕ ВЗАИМОДЕЙСТВИЕ С ЗАКАЗЧИКОМ И ПРОВОЖУ СРАВНИТЕЛЬНЫЙ АНАЛИЗ КОНКУРЕНТОВ. \r\nДАЮ СОВЕТЫ ПО УЛУЧШЕНИЮ ПОКАЗАТЕЛЕЙ КОНВЕРСИИ САЙТА. \r\n \r\nЯ РАБОТАЮ С РАЗНЫМИ КЛИЕНТАМИ, ВКЛЮЧАЯ КРУПНЫХ ЗАКАЗЧИКОВ С РЕКЛАМНЫМ БЮДЖЕТОМ ДО 400 000 РУБ. В МЕСЯЦ. \r\n \r\nСИЛЬНЫЕ СТОРОНЫ, КОТОРЫЕ ВЫДЕЛЯЮТ ВО МНЕ ЗАКАЗЧИКИ: \r\n1. ВЫСОКАЯ ЭФФЕКТИВНОСТЬ И ОТЛИЧНЫЙ РЕЗУЛЬТАТ \r\n2. ВСЕГДА НА СВЯЗИ \r\n3. ОПЕРАТИВНОЕ ВЫПОЛНЕНИЕ ЗАДАЧ \r\n \r\n--- КОМУ Я БУДУ ПОЛЕЗЕН: \r\n- ИНТЕРНЕТ-МАГАЗИНАМ \r\n- САЙТАМ С УСЛУГАМИ \r\nДЛЯ УВЕЛИЧЕНИЯ КОЛИЧЕСТВА ЗАЯВОК \r\n \r\n--- ЧЕМ Я БУДУ ВАМ ПОЛЕЗЕН: \r\nКАЧЕСТВЕННО НАСТРОЮ ЭФФЕКТИВНУЮ КОНТЕКСТНУЮ РЕКЛАМУ ЯНДЕКС.ДИРЕКТ, РСЯ ИЛИ ГУГЛ.РЕКЛАМА, КМС \r\nСРОК РАЗРАБОТКИ РЕКЛАМНЫХ КОМПАНИЙ ОТ 3 ДО 9 ДНЕЙ; \r\nСТОИМОСТЬ 1 РЕКЛАМНОЙ СИСТЕМЫ 9 900 РУБ. ДЛЯ ТЕМАТИКИ УСЛУГ И 15 900 РУБ. ДЛЯ ИНТЕРНЕТ-МАГАЗИНОВ. \r\n \r\n--- ДОПОЛНИТЕЛЬНО ЗАНИМАЮСЬ: \r\nКОМПЛЕКСНОЙ ПОДДЕРЖКОЙ ВАШЕГО БИЗНЕСА ПО ОНЛАЙН МАРКЕТИНГУ - ЭТО НЕ ТОЛЬКО РЕКЛАМА, НО ДОРАБОТКИ ПО САЙТАМ, ТЕЛЕФОНИИ, АКЦИЯМ И СКИДКАМ \r\n \r\nУ ВАС НАВЕРНЯКА ЕСТЬ И БУДУТ ВОПРОСЫ ПО КОНТЕКСТНОЙ РЕКЛАМЕ, Я БУДУ РАД ОТВЕТИТЬ НА НИХ. \r\n \r\nНАПИШИТЕ НА ПОЧТУ ИЛИ ПОЗВОНИТЕ, \r\nПОЧТА: ALEX2015.MARKETOLOG@GMAIL.COM \r\nТЕЛЕФОН: 8(977)463-11-76 \r\n \r\nСПАСИБО ВАМ ЗА ПРОЧТЕНИЕ МОЕГО СООБЩЕНИЯ, ЖДУ ВАШИХ ОБРАЩЕНИЙ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
