(1080, 216, 1, 5, 5, '', NULL, '', NULL, 'Приветствую Вас, меня зовут Волков Николай. \r\nМоя профессия: интернет-маркетолог. \r\n \r\nЯ делаю массовые рассылки сообщений владельцам сайтов, по средством открытых форм обратной связи, которые есть на сайтах. \r\n \r\n1 рассылка дает результат в размере ~23 заявок. \r\n \r\nВ рассылку я вставляю ваш рекламный текст, после прочтения которого, владельцы сайтов начинают звонить или писать вам на почту. \r\nКлиенты обращаются заинтересованные. \r\n \r\nЕсли Вам интересно пишите на почту: oktrust.ru@gmail.com \r\nИли заходите на мой сайт: oktrust.ru \r\n \r\n \r\nКому подойдет рассылка oKTrust? \r\n \r\n1. Интернет-маркетологам \r\n- Seo специалистам \r\n- Контекстная реклама (Директологам) \r\n- Таргетированная реклама (Таргетологам) \r\n- Ведение соц.сетей (SMM) \r\n- E-mail маркетологам \r\n- Автоворонщикам \r\n- Разработчикам сайтов \r\n- Настройкой и внедрение CRM \r\n- Копирайтерам / Рерайтерам / Контент менеджерам \r\n2. Бухгалтерским компаниям и частникам \r\n3. Прогрессистам 1С \r\n4. Юристам \r\nИ другим, кто может оказывать услуги на аутсорсе!', 'ПРИВЕТСТВУЮ ВАС, МЕНЯ ЗОВУТ ВОЛКОВ НИКОЛАЙ. \r\nМОЯ ПРОФЕССИЯ: ИНТЕРНЕТ-МАРКЕТОЛОГ. \r\n \r\nЯ ДЕЛАЮ МАССОВЫЕ РАССЫЛКИ СООБЩЕНИЙ ВЛАДЕЛЬЦАМ САЙТОВ, ПО СРЕДСТВОМ ОТКРЫТЫХ ФОРМ ОБРАТНОЙ СВЯЗИ, КОТОРЫЕ ЕСТЬ НА САЙТАХ. \r\n \r\n1 РАССЫЛКА ДАЕТ РЕЗУЛЬТАТ В РАЗМЕРЕ ~23 ЗАЯВОК. \r\n \r\nВ РАССЫЛКУ Я ВСТАВЛЯЮ ВАШ РЕКЛАМНЫЙ ТЕКСТ, ПОСЛЕ ПРОЧТЕНИЯ КОТОРОГО, ВЛАДЕЛЬЦЫ САЙТОВ НАЧИНАЮТ ЗВОНИТЬ ИЛИ ПИСАТЬ ВАМ НА ПОЧТУ. \r\nКЛИЕНТЫ ОБРАЩАЮТСЯ ЗАИНТЕРЕСОВАННЫЕ. \r\n \r\nЕСЛИ ВАМ ИНТЕРЕСНО ПИШИТЕ НА ПОЧТУ: OKTRUST.RU@GMAIL.COM \r\nИЛИ ЗАХОДИТЕ НА МОЙ САЙТ: OKTRUST.RU \r\n \r\n \r\nКОМУ ПОДОЙДЕТ РАССЫЛКА OKTRUST? \r\n \r\n1. ИНТЕРНЕТ-МАРКЕТОЛОГАМ \r\n- SEO СПЕЦИАЛИСТАМ \r\n- КОНТЕКСТНАЯ РЕКЛАМА (ДИРЕКТОЛОГАМ) \r\n- ТАРГЕТИРОВАННАЯ РЕКЛАМА (ТАРГЕТОЛОГАМ) \r\n- ВЕДЕНИЕ СОЦ.СЕТЕЙ (SMM) \r\n- E-MAIL МАРКЕТОЛОГАМ \r\n- АВТОВОРОНЩИКАМ \r\n- РАЗРАБОТЧИКАМ САЙТОВ \r\n- НАСТРОЙКОЙ И ВНЕДРЕНИЕ CRM \r\n- КОПИРАЙТЕРАМ / РЕРАЙТЕРАМ / КОНТЕНТ МЕНЕДЖЕРАМ \r\n2. БУХГАЛТЕРСКИМ КОМПАНИЯМ И ЧАСТНИКАМ \r\n3. ПРОГРЕССИСТАМ 1С \r\n4. ЮРИСТАМ \r\nИ ДРУГИМ, КТО МОЖЕТ ОКАЗЫВАТЬ УСЛУГИ НА АУТСОРСЕ!', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
