(1090, 218, 1, 5, 5, '', NULL, '', NULL, 'Приветствую Вас, меня зовут Николай. \r\nМоя профессия: интернет-маркетолог. \r\nРаботаю в сфере интернет-маркетинга уже более 7 лет. \r\nА точнее: \r\n \r\n- 4.6 года я занимаюсь Seo продвижением сайтов и прекрасно понимаю сколько факторов влияют на рост трафика и позиций в поисковой системе Яндекс и Google. Имею опыт продвижения высоко-конкурентных коммерческих сайтов по региону Москва и МО. Это пластиковые окна и сайт агентств по недвижимости. \r\n \r\n- 2.1 года занимаюсь привлечение трафика путём настроек контекстной рекламы в Яндекс.Директ \r\n \r\n- Пол года занимаюсь разработкой одностраничников (Landing Page) - в связи с чем не высокая цена работы. \r\n \r\nЧто я могу сделать для Вас: \r\n \r\n1. Настроить контекстную рекламу Я.Директ \r\n- Сроки разработки рекламных компаний: 3-5 дней; \r\n- Стоимость 3500 руб. \r\n \r\n2. Внутренняя оптимизация сайтов (SEO) \r\n- Сбор семантического ядра с 8 типами данных, в том числе конкурентность запроса. \r\n- Кластеризация семантического ядра - тоесть распределение ключевых запросов по страницам сайта \r\n- Внутренняя оптимизация сайта целиком или постраничный (Мета данные + переработка текстов) \r\n- Аудит всего сайта или аудит конкретных страниц на релевантность страницы под ключевые запросы. \r\n \r\n3. Разработка Landing Page \r\n- Сроки: 7 дней \r\n- Цена: 6500 руб \r\n \r\nСмотрите. \r\nУ вас наверняка есть и будут вопросы по каким либо направлениям, будь это Seo, контекстная реклама или создание сайта, Я всегда готов оказать Вам бесплатные консультации по вашим вопросам: \r\n \r\nТелефон: +89652200882 - Николай \r\nПочта: okseoru@gmail.com', 'ПРИВЕТСТВУЮ ВАС, МЕНЯ ЗОВУТ НИКОЛАЙ. \r\nМОЯ ПРОФЕССИЯ: ИНТЕРНЕТ-МАРКЕТОЛОГ. \r\nРАБОТАЮ В СФЕРЕ ИНТЕРНЕТ-МАРКЕТИНГА УЖЕ БОЛЕЕ 7 ЛЕТ. \r\nА ТОЧНЕЕ: \r\n \r\n- 4.6 ГОДА Я ЗАНИМАЮСЬ SEO ПРОДВИЖЕНИЕМ САЙТОВ И ПРЕКРАСНО ПОНИМАЮ СКОЛЬКО ФАКТОРОВ ВЛИЯЮТ НА РОСТ ТРАФИКА И ПОЗИЦИЙ В ПОИСКОВОЙ СИСТЕМЕ ЯНДЕКС И GOOGLE. ИМЕЮ ОПЫТ ПРОДВИЖЕНИЯ ВЫСОКО-КОНКУРЕНТНЫХ КОММЕРЧЕСКИХ САЙТОВ ПО РЕГИОНУ МОСКВА И МО. ЭТО ПЛАСТИКОВЫЕ ОКНА И САЙТ АГЕНТСТВ ПО НЕДВИЖИМОСТИ. \r\n \r\n- 2.1 ГОДА ЗАНИМАЮСЬ ПРИВЛЕЧЕНИЕ ТРАФИКА ПУТЁМ НАСТРОЕК КОНТЕКСТНОЙ РЕКЛАМЫ В ЯНДЕКС.ДИРЕКТ \r\n \r\n- ПОЛ ГОДА ЗАНИМАЮСЬ РАЗРАБОТКОЙ ОДНОСТРАНИЧНИКОВ (LANDING PAGE) - В СВЯЗИ С ЧЕМ НЕ ВЫСОКАЯ ЦЕНА РАБОТЫ. \r\n \r\nЧТО Я МОГУ СДЕЛАТЬ ДЛЯ ВАС: \r\n \r\n1. НАСТРОИТЬ КОНТЕКСТНУЮ РЕКЛАМУ Я.ДИРЕКТ \r\n- СРОКИ РАЗРАБОТКИ РЕКЛАМНЫХ КОМПАНИЙ: 3-5 ДНЕЙ; \r\n- СТОИМОСТЬ 3500 РУБ. \r\n \r\n2. ВНУТРЕННЯЯ ОПТИМИЗАЦИЯ САЙТОВ (SEO) \r\n- СБОР СЕМАНТИЧЕСКОГО ЯДРА С 8 ТИПАМИ ДАННЫХ, В ТОМ ЧИСЛЕ КОНКУРЕНТНОСТЬ ЗАПРОСА. \r\n- КЛАСТЕРИЗАЦИЯ СЕМАНТИЧЕСКОГО ЯДРА - ТОЕСТЬ РАСПРЕДЕЛЕНИЕ КЛЮЧЕВЫХ ЗАПРОСОВ ПО СТРАНИЦАМ САЙТА \r\n- ВНУТРЕННЯЯ ОПТИМИЗАЦИЯ САЙТА ЦЕЛИКОМ ИЛИ ПОСТРАНИЧНЫЙ (МЕТА ДАННЫЕ + ПЕРЕРАБОТКА ТЕКСТОВ) \r\n- АУДИТ ВСЕГО САЙТА ИЛИ АУДИТ КОНКРЕТНЫХ СТРАНИЦ НА РЕЛЕВАНТНОСТЬ СТРАНИЦЫ ПОД КЛЮЧЕВЫЕ ЗАПРОСЫ. \r\n \r\n3. РАЗРАБОТКА LANDING PAGE \r\n- СРОКИ: 7 ДНЕЙ \r\n- ЦЕНА: 6500 РУБ \r\n \r\nСМОТРИТЕ. \r\nУ ВАС НАВЕРНЯКА ЕСТЬ И БУДУТ ВОПРОСЫ ПО КАКИМ ЛИБО НАПРАВЛЕНИЯМ, БУДЬ ЭТО SEO, КОНТЕКСТНАЯ РЕКЛАМА ИЛИ СОЗДАНИЕ САЙТА, Я ВСЕГДА ГОТОВ ОКАЗАТЬ ВАМ БЕСПЛАТНЫЕ КОНСУЛЬТАЦИИ ПО ВАШИМ ВОПРОСАМ: \r\n \r\nТЕЛЕФОН: +89652200882 - НИКОЛАЙ \r\nПОЧТА: OKSEORU@GMAIL.COM', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
