(1145, 229, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте, \r\nмы профессиональные бухгалтеры, Яна и Ольга. \r\n \r\nЯна (https://www.instagram.com/yanasudina/) \r\nОльга (https://www.instagram.com/olgamoroz5/) \r\n \r\nВедём бухгалтерию и сотрудников, решаем юридические вопросы и выполняем поручения. \r\nВы занимаетесь развитием бизнеса и не делаете то, что можно поручить другим. \r\nС нами вы сделаете больше. \r\n \r\nПоможем: \r\n- разблокировать счет \r\n- решить проблемы с налоговой \r\n- решим юридические вопросы и поможем выиграть суд \r\n- оптимизировать налоги \r\n- минимизировать налоговые риски \r\n \r\nА так же поможем и в этих вопросах: \r\n- Абонентское юридическое обслуживание \r\n- Договорное право \r\n- Трудовое право \r\n- Кадровый аутсорсинг \r\n \r\nОказываем бухгалтерские услуги уже на протяжении 15 лет. \r\nМы помогаем компаниям успешно вести бухгалтерию и экономить на налогах. \r\nС нами вы можете сэкономить на бухгалтерии от 30 до 45% . \r\n \r\nЕсть 4 пакета обслуживания, о них можем рассказать по телефону. \r\n \r\nДля этого прошу Вас написать на почту: yana-sudina@yandex.ru \r\nИли звоните по телефону: 8 (929) 556-73-72 \r\n \r\nСпасибо Вам за прочтение.', 'ЗДРАВСТВУЙТЕ, \r\nМЫ ПРОФЕССИОНАЛЬНЫЕ БУХГАЛТЕРЫ, ЯНА И ОЛЬГА. \r\n \r\nЯНА (HTTPS://WWW.INSTAGRAM.COM/YANASUDINA/) \r\nОЛЬГА (HTTPS://WWW.INSTAGRAM.COM/OLGAMOROZ5/) \r\n \r\nВЕДЁМ БУХГАЛТЕРИЮ И СОТРУДНИКОВ, РЕШАЕМ ЮРИДИЧЕСКИЕ ВОПРОСЫ И ВЫПОЛНЯЕМ ПОРУЧЕНИЯ. \r\nВЫ ЗАНИМАЕТЕСЬ РАЗВИТИЕМ БИЗНЕСА И НЕ ДЕЛАЕТЕ ТО, ЧТО МОЖНО ПОРУЧИТЬ ДРУГИМ. \r\nС НАМИ ВЫ СДЕЛАЕТЕ БОЛЬШЕ. \r\n \r\nПОМОЖЕМ: \r\n- РАЗБЛОКИРОВАТЬ СЧЕТ \r\n- РЕШИТЬ ПРОБЛЕМЫ С НАЛОГОВОЙ \r\n- РЕШИМ ЮРИДИЧЕСКИЕ ВОПРОСЫ И ПОМОЖЕМ ВЫИГРАТЬ СУД \r\n- ОПТИМИЗИРОВАТЬ НАЛОГИ \r\n- МИНИМИЗИРОВАТЬ НАЛОГОВЫЕ РИСКИ \r\n \r\nА ТАК ЖЕ ПОМОЖЕМ И В ЭТИХ ВОПРОСАХ: \r\n- АБОНЕНТСКОЕ ЮРИДИЧЕСКОЕ ОБСЛУЖИВАНИЕ \r\n- ДОГОВОРНОЕ ПРАВО \r\n- ТРУДОВОЕ ПРАВО \r\n- КАДРОВЫЙ АУТСОРСИНГ \r\n \r\nОКАЗЫВАЕМ БУХГАЛТЕРСКИЕ УСЛУГИ УЖЕ НА ПРОТЯЖЕНИИ 15 ЛЕТ. \r\nМЫ ПОМОГАЕМ КОМПАНИЯМ УСПЕШНО ВЕСТИ БУХГАЛТЕРИЮ И ЭКОНОМИТЬ НА НАЛОГАХ. \r\nС НАМИ ВЫ МОЖЕТЕ СЭКОНОМИТЬ НА БУХГАЛТЕРИИ ОТ 30 ДО 45% . \r\n \r\nЕСТЬ 4 ПАКЕТА ОБСЛУЖИВАНИЯ, О НИХ МОЖЕМ РАССКАЗАТЬ ПО ТЕЛЕФОНУ. \r\n \r\nДЛЯ ЭТОГО ПРОШУ ВАС НАПИСАТЬ НА ПОЧТУ: YANA-SUDINA@YANDEX.RU \r\nИЛИ ЗВОНИТЕ ПО ТЕЛЕФОНУ: 8 (929) 556-73-72 \r\n \r\nСПАСИБО ВАМ ЗА ПРОЧТЕНИЕ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
