(1210, 242, 1, 5, 5, '', NULL, '', NULL, 'Приветствую Вас, меня зовут Андрей и я являюсь сертифицированным - Золотым партнером по CMS Bitrix и CRM Bitrix24. \r\n \r\nЯ и моя небольшая команда профессионалов осуществляет техническую поддержку, модернизацию и обслуживание сайтов на Битриксе. Мы работаем над тем, чтобы ваш проект полностью отвечал поставленным целям и задачам с учетом особенностей вашего бизнеса. \r\n \r\nВАЖНО! На все, что мы делаем распространяется гарантия 12 месяцев. \r\n \r\nМАКСИМАЛЬНАЯ ИНТЕГРАЦИЯ \r\nНастроим обмен сайта с 1С даже если нет официального модуля. Разработаем механизмы интеграции с CRM системами, товарными агрегаторами, службами доставки и службами оплаты \r\n \r\nРАБОТА С КОНТЕНТОМ \r\nОбновление и размещение на сайте нового контента больше не будет проблемой. Такие операции как: публикация новостей, размещение статей, обновление каталога товаров и прайс-листов, размещение акций и спецпредложений мы берем на себя. \r\n \r\nПРОГРАММИРОВАНИЕ И ДОРАБОТКА САЙТА \r\nПоможем с доработкой текущего кода и написанием нового. Установим и внедрим модули с Marketplace или напишем собственные под ваши задачи. Проведем аудит кода и устраним все уязвимости, а также проведем автоматизацию ваших бизнес процессов \r\n \r\nРеализовано более 150 сложных проектов. \r\nДоработок выполнено - на более 11 000 часов. \r\nГотов по запросу прислать портфолио работ и сертификаты. \r\nМы в ТОП50 рейтинге по Москве - по созданию и поддержке интернет-магазинов. \r\n \r\nМы знаем, что битрикс дорогая система для обслуживания. \r\nУ нас не Московские цены, а цены г. Ульяновска - Убедитесь сами. \r\n \r\nЕсли у вас имеются вопросы, смело пишите на почту: andrey.1cbitrix@gmail.com \r\nили звоните по номеру: +7 (495) 118-43-49 \r\nИли по Skype: voiimond \r\n \r\nСпасибо за прочтение.', 'ПРИВЕТСТВУЮ ВАС, МЕНЯ ЗОВУТ АНДРЕЙ И Я ЯВЛЯЮСЬ СЕРТИФИЦИРОВАННЫМ - ЗОЛОТЫМ ПАРТНЕРОМ ПО CMS BITRIX И CRM BITRIX24. \r\n \r\nЯ И МОЯ НЕБОЛЬШАЯ КОМАНДА ПРОФЕССИОНАЛОВ ОСУЩЕСТВЛЯЕТ ТЕХНИЧЕСКУЮ ПОДДЕРЖКУ, МОДЕРНИЗАЦИЮ И ОБСЛУЖИВАНИЕ САЙТОВ НА БИТРИКСЕ. МЫ РАБОТАЕМ НАД ТЕМ, ЧТОБЫ ВАШ ПРОЕКТ ПОЛНОСТЬЮ ОТВЕЧАЛ ПОСТАВЛЕННЫМ ЦЕЛЯМ И ЗАДАЧАМ С УЧЕТОМ ОСОБЕННОСТЕЙ ВАШЕГО БИЗНЕСА. \r\n \r\nВАЖНО! НА ВСЕ, ЧТО МЫ ДЕЛАЕМ РАСПРОСТРАНЯЕТСЯ ГАРАНТИЯ 12 МЕСЯЦЕВ. \r\n \r\nМАКСИМАЛЬНАЯ ИНТЕГРАЦИЯ \r\nНАСТРОИМ ОБМЕН САЙТА С 1С ДАЖЕ ЕСЛИ НЕТ ОФИЦИАЛЬНОГО МОДУЛЯ. РАЗРАБОТАЕМ МЕХАНИЗМЫ ИНТЕГРАЦИИ С CRM СИСТЕМАМИ, ТОВАРНЫМИ АГРЕГАТОРАМИ, СЛУЖБАМИ ДОСТАВКИ И СЛУЖБАМИ ОПЛАТЫ \r\n \r\nРАБОТА С КОНТЕНТОМ \r\nОБНОВЛЕНИЕ И РАЗМЕЩЕНИЕ НА САЙТЕ НОВОГО КОНТЕНТА БОЛЬШЕ НЕ БУДЕТ ПРОБЛЕМОЙ. ТАКИЕ ОПЕРАЦИИ КАК: ПУБЛИКАЦИЯ НОВОСТЕЙ, РАЗМЕЩЕНИЕ СТАТЕЙ, ОБНОВЛЕНИЕ КАТАЛОГА ТОВАРОВ И ПРАЙС-ЛИСТОВ, РАЗМЕЩЕНИЕ АКЦИЙ И СПЕЦПРЕДЛОЖЕНИЙ МЫ БЕРЕМ НА СЕБЯ. \r\n \r\nПРОГРАММИРОВАНИЕ И ДОРАБОТКА САЙТА \r\nПОМОЖЕМ С ДОРАБОТКОЙ ТЕКУЩЕГО КОДА И НАПИСАНИЕМ НОВОГО. УСТАНОВИМ И ВНЕДРИМ МОДУЛИ С MARKETPLACE ИЛИ НАПИШЕМ СОБСТВЕННЫЕ ПОД ВАШИ ЗАДАЧИ. ПРОВЕДЕМ АУДИТ КОДА И УСТРАНИМ ВСЕ УЯЗВИМОСТИ, А ТАКЖЕ ПРОВЕДЕМ АВТОМАТИЗАЦИЮ ВАШИХ БИЗНЕС ПРОЦЕССОВ \r\n \r\nРЕАЛИЗОВАНО БОЛЕЕ 150 СЛОЖНЫХ ПРОЕКТОВ. \r\nДОРАБОТОК ВЫПОЛНЕНО - НА БОЛЕЕ 11 000 ЧАСОВ. \r\nГОТОВ ПО ЗАПРОСУ ПРИСЛАТЬ ПОРТФОЛИО РАБОТ И СЕРТИФИКАТЫ. \r\nМЫ В ТОП50 РЕЙТИНГЕ ПО МОСКВЕ - ПО СОЗДАНИЮ И ПОДДЕРЖКЕ ИНТЕРНЕТ-МАГАЗИНОВ. \r\n \r\nМЫ ЗНАЕМ, ЧТО БИТРИКС ДОРОГАЯ СИСТЕМА ДЛЯ ОБСЛУЖИВАНИЯ. \r\nУ НАС НЕ МОСКОВСКИЕ ЦЕНЫ, А ЦЕНЫ Г. УЛЬЯНОВСКА - УБЕДИТЕСЬ САМИ. \r\n \r\nЕСЛИ У ВАС ИМЕЮТСЯ ВОПРОСЫ, СМЕЛО ПИШИТЕ НА ПОЧТУ: ANDREY.1CBITRIX@GMAIL.COM \r\nИЛИ ЗВОНИТЕ ПО НОМЕРУ: +7 (495) 118-43-49 \r\nИЛИ ПО SKYPE: VOIIMOND \r\n \r\nСПАСИБО ЗА ПРОЧТЕНИЕ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
