(1215, 243, 1, 5, 5, '', NULL, '', NULL, 'Приглашаем Вас 14 декабря на Зимний форум маркетинга 2018 \r\n \r\nСпикеры, которые будут вас вдохновлять: \r\n- ДМИТРИЙ КРУТОВ \r\n- ЮЛИЯ РАКОВА \r\n- АНДРЕЙ ГАВРИКОВ \r\n- РОМАН КУМАР ВИАС \r\n- ДМИТРИЙ КОТ \r\n- ВЕРОНИКА КИРИЛЛОВА \r\n- МАРИЯ ЕКИМОВА \r\n \r\nНа форуме разберем: \r\n- Как получилось вырасти у других компаний? Что можем использовать мы? Каждый спикер раскроет секретные техники, которые применил у себя или у своих клиентов. \r\n- Как разработать маркетинговую стратегию за 7 дней. Пошаговая инструкция. \r\n- Как перестать сливать бюджет и снизить стоимость клиента в 3.5 раза? \r\n- Как прокачать свой личный бренд и увеличить свой средний чек в несколько раз? \r\n- Как разработать продуктовую матрицу так, чтобы продукты продавали сами себя? \r\n- Топ-10 технологий в маркетинге, которые будут работать в 2019 г. \r\n- Как писать огненные тексты и попадать в душу клиентам \r\n \r\nДрузья, все билеты уже проданы. Осталось онлайн участие! Спешите, билеты ограничены! \r\nСледующее повышение цены – 6 декабря!', 'ПРИГЛАШАЕМ ВАС 14 ДЕКАБРЯ НА ЗИМНИЙ ФОРУМ МАРКЕТИНГА 2018 \r\n \r\nСПИКЕРЫ, КОТОРЫЕ БУДУТ ВАС ВДОХНОВЛЯТЬ: \r\n- ДМИТРИЙ КРУТОВ \r\n- ЮЛИЯ РАКОВА \r\n- АНДРЕЙ ГАВРИКОВ \r\n- РОМАН КУМАР ВИАС \r\n- ДМИТРИЙ КОТ \r\n- ВЕРОНИКА КИРИЛЛОВА \r\n- МАРИЯ ЕКИМОВА \r\n \r\nНА ФОРУМЕ РАЗБЕРЕМ: \r\n- КАК ПОЛУЧИЛОСЬ ВЫРАСТИ У ДРУГИХ КОМПАНИЙ? ЧТО МОЖЕМ ИСПОЛЬЗОВАТЬ МЫ? КАЖДЫЙ СПИКЕР РАСКРОЕТ СЕКРЕТНЫЕ ТЕХНИКИ, КОТОРЫЕ ПРИМЕНИЛ У СЕБЯ ИЛИ У СВОИХ КЛИЕНТОВ. \r\n- КАК РАЗРАБОТАТЬ МАРКЕТИНГОВУЮ СТРАТЕГИЮ ЗА 7 ДНЕЙ. ПОШАГОВАЯ ИНСТРУКЦИЯ. \r\n- КАК ПЕРЕСТАТЬ СЛИВАТЬ БЮДЖЕТ И СНИЗИТЬ СТОИМОСТЬ КЛИЕНТА В 3.5 РАЗА? \r\n- КАК ПРОКАЧАТЬ СВОЙ ЛИЧНЫЙ БРЕНД И УВЕЛИЧИТЬ СВОЙ СРЕДНИЙ ЧЕК В НЕСКОЛЬКО РАЗ? \r\n- КАК РАЗРАБОТАТЬ ПРОДУКТОВУЮ МАТРИЦУ ТАК, ЧТОБЫ ПРОДУКТЫ ПРОДАВАЛИ САМИ СЕБЯ? \r\n- ТОП-10 ТЕХНОЛОГИЙ В МАРКЕТИНГЕ, КОТОРЫЕ БУДУТ РАБОТАТЬ В 2019 Г. \r\n- КАК ПИСАТЬ ОГНЕННЫЕ ТЕКСТЫ И ПОПАДАТЬ В ДУШУ КЛИЕНТАМ \r\n \r\nДРУЗЬЯ, ВСЕ БИ