(1325, 265, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте! \r\n \r\nСделаем на физических лиц и сотрудников фирм карточки metro в сеть супермаркетов МETRO CASH & CARRY.  \r\n \r\nhttp://купить-карту-метро.рф \r\n \r\nЗаконно по договору оформим на частных лиц и сотрудников организаций карты метро в сеть гипермаркетов \"Метро\": пропуск в метrо с вашей фотографией (делается в самом магазине в вашем присутствии), с личным номером, штрих - кодом, со специальной магнитной полосой, названием фирмы, от которой вы будете нами оформлены. \r\n \r\nВы можете проводить с собой двух человек. \r\n \r\nКарты клиента metro оформляются: на граждан Российской Федерации и иностранцев. \r\n \r\nОформление производится без предоплаты, то есть вначале мы регистрируем и оформляем вас, вы получаете карточки metro, потом оплачиваете. \r\n \r\nОплата производится в течение 1-го рабочего дня после оформления, торговые центры \"Метро Кэш энд Керри\" работают 24 часа в сутки. \r\n \r\nДля оказания этой услуги мы находим организации, у которых есть свободные места в этих гипермаркетах, и заключаем с ними соответствующие договора, по которым организации обязуются предоставить вам право пользоваться их местами в этих гипермаркетах. \r\n \r\nОформление и регистрация производятся во всех немецких торговых центрах МETRO CASH AND CARRY. \r\n \r\nПолучив карты метро в одном из немецких магазинов  МETRO CASH&CARRY вы можете ею пользоваться в любых других магазинах этой сети немецких торговых центров «МЕТРО» в Российской Федерации и за рубежом. \r\n \r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ контакт-форму с сайта купить-карту-метро.рф \r\n \r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. \r\n \r\nИСПОЛНЕНИЕ ЗАКАЗА 2-3 РАБОЧИХ ДНЯ. \r\n \r\nПОЛУЧЕНИЕ В 50 ГОРОДАХ И РЕГИОНАХ РОССИИ: \r\nAdygea, Архангельск, Astraxan, Barnaul, Брянск, Белгород, Владимир, Волгоград, Voljskii, Vologda, Воронеж, Voronejskaja oblast, Ekaterinbyrg, Иваново, Ижевск, Irkytsk, Kazan, Калининград, Kaluga, Kemerovo, Kirov, Kopeysk, Krasnodar, Krasnoyarsk, Kursk, Lipetsk, Magnitogorsk, Moscow, In city the Moscow region, Набережные Челны, Nizhny Novgorod, Nizhny Tagil, Novokyzneck, Novorossiisk, Novosibirsk, Омск, Orenburg, Орел, Пенза, Perm, Pyatigorsk, Ростов-на-Дону, Рязань, Самара, Sankt-Peterbyrg, Saratov, Serpyxov, Smolensk, Ставрополь, Sterlitamak, Сургут, Tver, Тольятти, Tomsk, Тула, Tjumen, Ульяновск, Ufa, Cheboksary, Челябинск, Jaroslavl, Sevastopol, Симферополь.', 'ЗДРАВСТВУЙТЕ! \r\n \r\nСДЕЛАЕМ НА ФИЗИЧЕСКИХ ЛИЦ И СОТРУДНИКОВ ФИРМ КАРТОЧКИ METRO В СЕТЬ СУПЕРМАРКЕТОВ МETRO CASH & CARRY.  \r\n \r\nHTTP://КУПИТЬ-КАРТУ-МЕТРО.РФ \r\n \r\nЗАКОННО ПО ДОГОВОРУ ОФОРМИМ НА ЧАСТНЫХ ЛИЦ И СОТРУДНИКОВ ОРГАНИЗАЦИЙ КАРТЫ МЕТРО В СЕТЬ ГИПЕРМАРКЕТОВ \"МЕТРО\": ПРОПУСК В МЕТRО С ВАШЕЙ ФОТОГРАФИЕЙ (ДЕЛАЕТСЯ В САМОМ МАГАЗИНЕ В ВАШЕМ ПРИСУТСТВИИ), С ЛИЧНЫМ НОМЕРОМ, ШТРИХ - КОДОМ, СО СПЕЦИАЛЬНОЙ МАГНИТНОЙ ПОЛОСОЙ, НАЗВАНИЕМ ФИРМЫ, ОТ КОТОРОЙ ВЫ БУДЕТЕ НАМИ ОФОРМЛЕНЫ. \r\n \r\nВЫ МОЖЕТЕ ПРОВОДИТЬ С СОБОЙ ДВУХ ЧЕЛОВЕК. \r\n \r\nКАРТЫ КЛИЕНТА METRO ОФОРМЛЯЮТСЯ: НА ГРАЖДАН РОССИЙСКОЙ ФЕДЕРАЦИИ И ИНОСТРАНЦЕВ. \r\n \r\nОФОРМЛЕНИЕ ПРОИЗВОДИТСЯ БЕЗ ПРЕДОПЛАТЫ, ТО ЕСТЬ ВНАЧАЛЕ МЫ РЕГИСТРИРУЕМ И ОФОРМЛЯЕМ ВАС, ВЫ ПОЛУЧАЕТЕ КАРТОЧКИ METRO, ПОТОМ ОПЛАЧИВАЕТЕ. \r\n \r\nОПЛАТА ПРОИЗВОДИТСЯ В ТЕЧЕНИЕ 1-ГО РАБОЧЕГО ДНЯ ПОСЛЕ ОФОРМЛЕНИЯ, ТОРГОВЫЕ ЦЕНТРЫ \"МЕТРО КЭШ ЭНД КЕРРИ\" РАБОТАЮТ 24 ЧАСА В СУТКИ. \r\n \r\nДЛЯ ОКАЗАНИЯ ЭТОЙ УСЛУГИ МЫ НАХОДИМ ОРГАНИЗАЦИИ, У КОТОРЫХ ЕСТЬ СВОБОДНЫЕ МЕСТА В ЭТИХ ГИПЕРМАРКЕТАХ, И ЗАКЛЮЧАЕМ С НИМИ СООТВЕТСТВУЮЩИЕ ДОГОВОРА, ПО КОТОРЫМ ОРГАНИЗАЦИИ ОБЯЗУЮТСЯ ПРЕДОСТАВИТЬ ВАМ ПРАВО ПОЛЬЗОВАТЬСЯ ИХ МЕСТАМИ В ЭТИХ ГИПЕРМАРКЕТАХ. \r\n \r\nОФОРМЛЕНИЕ И РЕГИСТРАЦИЯ ПРОИЗВОДЯТСЯ ВО ВСЕХ НЕМЕЦКИХ ТОРГОВЫХ ЦЕНТРАХ МETRO CASH AND CARRY. \r\n \r\nПОЛУЧИВ КАРТЫ МЕТРО В ОДНОМ ИЗ НЕМЕЦКИХ МАГАЗИНОВ  МETRO CASH&CARRY ВЫ МОЖЕТЕ ЕЮ ПОЛЬЗОВАТЬСЯ В ЛЮБЫХ ДРУГИХ МАГАЗИНАХ ЭТОЙ СЕТИ НЕМЕЦКИХ ТОРГОВЫХ ЦЕНТРОВ «МЕТРО» В РОССИЙСКОЙ ФЕДЕРАЦИИ И ЗА РУБЕЖОМ. \r\n \r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ КОНТАКТ-ФОРМУ С САЙТА КУПИТЬ-КАРТУ-МЕТРО.РФ \r\n \r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. \r\n \r\nИСПОЛНЕНИЕ ЗАКАЗА 2-3 РАБОЧИХ ДНЯ. \r\n \r\nПОЛУЧЕНИЕ В 50 ГОРОДАХ И РЕГИОНАХ РОССИИ: \r\nADYGEA, АРХАНГЕЛЬСК, ASTRAXAN, BARNAUL, БРЯНСК, БЕЛГОРОД, ВЛАДИМИР, ВОЛГОГРАД, VOLJSKII, VOLOGDA, ВОРОНЕЖ, VORONEJSKAJA OBLAST, EKATERINBYRG, ИВАНОВО, ИЖЕВСК, IRKYTSK, KAZAN, КАЛИНИНГРАД, KALUGA, KEMEROVO, KIROV, KOPEYSK, KRASNODAR, KRASNOYARSK, KURSK, LIPETSK, MAGNITOGORSK, MOSCOW, IN CITY THE MOSCOW REGION, НАБЕРЕЖНЫЕ ЧЕЛНЫ, NIZHNY NOVGOROD, NIZHNY TAGIL, NOVOKYZNECK, NOVOROSSIISK, NOVOSIBIRSK, ОМСК, ORENBURG, ОРЕЛ, ПЕНЗА, PERM, PYATIGORSK, РОСТОВ-НА-ДОНУ, РЯЗАНЬ, САМАРА, SANKT-PETERBYRG, SARATOV, SERPYXOV, SMOLENSK, СТАВРОПОЛЬ, STERLITAMAK, СУРГУТ, TVER, ТОЛЬЯТТИ, TOMSK, ТУЛА, TJUMEN, УЛЬЯНОВСК, UFA, CHEBOKSARY, ЧЕЛЯБИНСК, JAROSLAVL, SEVASTOPOL, СИМФЕРОПОЛЬ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
