(1405, 281, 1, 5, 5, '', NULL, '', NULL, 'Бетонная лестница облицованная деревом и <a href=http://marshag.ru/ograzhdeniya-i-perila>стеклянные ограждения</a>, производят по индивидуальному проекту, соответствуют установленным нормативам и требованиям. Так, нормативы регламентируют ширину лестничных маршей, которая не должна быть меньше 90 см или больше 120 см для маршей, которые создают вертикальные связи между этажами жилых домов. Такой размер учитывает не только проход жильцов на верхние этажи, но и пронос мебели', 'БЕТОННАЯ ЛЕСТНИЦА ОБЛИЦОВАННАЯ ДЕРЕВОМ И <A HREF=HTTP://MARSHAG.RU/OGRAZHDENIYA-I-PERILA>СТЕКЛЯННЫЕ ОГРАЖДЕНИЯ</A>, ПРОИЗВОДЯТ ПО ИНДИВИДУАЛЬНОМУ ПРОЕКТУ, СООТВЕТСТВУЮТ УСТАНОВЛЕННЫМ НОРМАТИВАМ И ТРЕБОВАНИЯМ. ТАК, НОРМАТИВЫ РЕГЛАМЕНТИРУЮТ ШИРИНУ ЛЕСТНИЧНЫХ МАРШЕЙ, КОТОРАЯ НЕ ДОЛЖНА БЫТЬ МЕНЬШЕ 90 СМ ИЛИ БОЛЬШЕ 120 СМ ДЛЯ МАРШЕЙ, КОТОРЫЕ СОЗДАЮТ ВЕРТИКАЛЬНЫЕ СВЯЗИ МЕЖДУ ЭТАЖАМИ ЖИЛЫХ ДОМОВ. ТАКОЙ РАЗМЕР УЧИТЫВАЕТ НЕ ТОЛЬКО ПРОХОД ЖИЛЬЦОВ НА ВЕРХНИЕ ЭТАЖИ, НО И ПРОНОС МЕБЕЛИ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
