(1410, 282, 1, 5, 5, '', NULL, '', NULL, 'Приветствую Вас, меня зовут Андрей и я являюсь сертифицированным - Золотым партнером по CMS Bitrix и CRM Bitrix24. Так же есть друг и партнер по работе с CMS WordPress. \r\n \r\nЕсли у вас имеются вопросы, смело пишите на почту: andrey.1cbitrix@gmail.com \r\nили звоните по номеру: +7 (925) 599-75-65 \r\n \r\nЯ и моя небольшая команда поможем выполнить любые работы по сайтам. \r\n \r\nОсуществить техническую поддержку, модернизацию и обслуживание сайтов на Битриксе и WordPress. \r\n \r\nВАЖНО! На все, что мы делаем распространяется гарантия 12 месяцев. \r\n \r\nПравда о нашей небольшой но эффективной команде : \r\nПо итогам 2018 года мы повысили эффективность нашей работы и расширили спектр оказываемых услуг: \r\nРейтинг разработчиков интернет-магазинов на WordPress - 4 место \r\nРейтинг digital-агентств, работающих с крупнейшими компаниями (Телекоммуникации) - 7 место \r\nРейтинг разработчиков интернет-магазинов в Москве - 22 место \r\nРейтинг разработчиков интернет-магазинов на 1С-Битрикс - 35 место \r\nРейтинг разработчиков интернет-магазинов в России - 47 место \r\nРейтинг веб-студий в Москве - 141 место \r\nСсылки предоставлю по запросу. \r\n \r\nЯ знаю, что битрикс дорогая система для обслуживания. \r\nНо у нас не Московские цены - гораздо ниже. \r\n \r\nКратко что мы можем: \r\n \r\nМАКСИМАЛЬНАЯ ИНТЕГРАЦИЯ \r\nНастроим обмен сайта с 1С даже если нет официального модуля. Разработаем механизмы интеграции с CRM системами, товарными агрегаторами, службами доставки и службами оплаты \r\n \r\nРАБОТА С КОНТЕНТОМ \r\nОбновление и размещение на сайте нового контента больше не будет проблемой. Такие операции как: публикация новостей, размещение статей, обновление каталога товаров и прайс-листов, размещение акций и спецпредложений мы берем на себя. \r\n \r\nПРОГРАММИРОВАНИЕ И ДОРАБОТКА САЙТА \r\nПоможем с доработкой текущего кода и написанием нового. Установим и внедрим модули с Marketplace или напишем собственные под ваши задачи. Проведем аудит кода и устраним все уязвимости, а также проведем автоматизацию ваших бизнес процессов \r\n \r\nЕсли у вас имеются вопросы, смело пишите на почту: andrey.1cbitrix@gmail.com \r\nили звоните по номеру: +7 (925) 599-75-65 \r\n \r\nСпасибо за прочтение. Жду вашего обращения.', 'ПРИВЕТСТВУЮ ВАС, МЕНЯ ЗОВУТ АНДРЕЙ И Я ЯВЛЯЮСЬ СЕРТИФИЦИРОВАННЫМ - ЗОЛОТЫМ ПАРТНЕРОМ ПО CMS BITRIX И CRM BITRIX24. ТАК ЖЕ ЕСТЬ ДРУГ И ПАРТНЕР ПО РАБОТЕ С CMS WORDPRESS. \r\n \r\nЕСЛИ У ВАС ИМЕЮТСЯ ВОПРОСЫ, СМЕЛО ПИШИТЕ НА ПОЧТУ: ANDREY.1CBITRIX@GMAIL.COM \r\nИЛИ ЗВОНИТЕ ПО НОМЕРУ: +7 (925) 599-75-65 \r\n \r\nЯ И МОЯ НЕБОЛЬШАЯ КОМАНДА ПОМОЖЕМ ВЫПОЛНИТЬ ЛЮБЫЕ РАБОТЫ ПО САЙТАМ. \r\n \r\nОСУЩЕСТВИТЬ ТЕХНИЧЕСКУЮ ПОДДЕРЖКУ, МОДЕРНИЗАЦИЮ И ОБСЛУЖИВАНИЕ САЙТОВ НА БИТРИКСЕ И WORDPRESS. \r\n \r\nВАЖНО! НА ВСЕ, ЧТО МЫ ДЕЛАЕМ РАСПРОСТРАНЯЕТСЯ ГАРАНТИЯ 12 МЕСЯЦЕВ. \r\n \r\nПРАВДА О НАШЕЙ НЕБОЛЬШОЙ НО ЭФФЕКТИВНОЙ КОМАНДЕ : \r\nПО ИТОГАМ 2018 ГОДА МЫ ПОВЫСИЛИ ЭФФЕКТИВНОСТЬ НАШЕЙ РАБОТЫ И РАСШИРИЛИ СПЕКТР ОКАЗЫВАЕМЫХ УСЛУГ: \r\nРЕЙТИНГ РАЗРАБОТЧИКОВ ИНТЕРНЕТ-МАГАЗИНОВ НА WORDPRESS - 4 МЕСТО \r\nРЕЙТИНГ DIGITAL-АГЕНТСТВ, РАБОТАЮЩИХ С КРУПНЕЙШИМИ КОМПАНИЯМИ (ТЕЛЕКОММУНИКАЦИИ) - 7 МЕСТО \r\nРЕЙТИНГ РАЗРАБОТЧИКОВ ИНТЕРНЕТ-МАГАЗИНОВ В МОСКВЕ - 22 МЕСТО \r\nРЕЙТИНГ РАЗРАБОТЧИКОВ ИНТЕРНЕТ-МАГАЗИНОВ НА 1С-БИТРИКС - 35 МЕСТО \r\nРЕЙТИНГ РАЗРАБОТЧИКОВ ИНТЕРНЕТ-МАГАЗИНОВ В РОССИИ - 47 МЕСТО \r\nРЕЙТИНГ ВЕБ-СТУДИЙ В МОСКВЕ - 141 МЕСТО \r\nССЫЛКИ ПРЕДОСТАВЛЮ ПО ЗАПРОСУ. \r\n \r\nЯ ЗНАЮ, ЧТО БИТРИКС ДОРОГАЯ СИСТЕМА ДЛЯ ОБСЛУЖИВАНИЯ. \r\nНО У НАС НЕ МОСКОВСКИЕ ЦЕНЫ - ГОРАЗДО НИЖЕ. \r\n \r\nКРАТКО ЧТО МЫ МОЖЕМ: \r\n \r\nМАКСИМАЛЬНАЯ ИНТЕГРАЦИЯ \r\nНАСТРОИМ ОБМЕН САЙТА С 1С ДАЖЕ ЕСЛИ НЕТ ОФИЦИАЛЬНОГО МОДУЛЯ. РАЗРАБОТАЕМ МЕХАНИЗМЫ ИНТЕГРАЦИИ С CRM СИСТЕМАМИ, ТОВАРНЫМИ АГРЕГАТОРАМИ, СЛУЖБАМИ ДОСТАВКИ И СЛУЖБАМИ ОПЛАТЫ \r\n \r\nРАБОТА С КОНТЕНТОМ \r\nОБНОВЛЕНИЕ И РАЗМЕЩЕНИЕ НА САЙТЕ НОВОГО КОНТЕНТА БОЛЬШЕ НЕ БУДЕТ ПРОБЛЕМОЙ. ТАКИЕ ОПЕРАЦИИ КАК: ПУБЛИКАЦИЯ НОВОСТЕЙ, РАЗМЕЩЕНИЕ СТАТЕЙ, ОБНОВЛЕНИЕ КАТАЛОГА ТОВАРОВ И ПРАЙС-ЛИСТОВ, РАЗМЕЩЕНИЕ АКЦИЙ И СПЕЦПРЕДЛОЖЕНИЙ МЫ БЕРЕМ НА СЕБЯ. \r\n \r\nПРОГРАММИРОВАНИЕ И ДОРАБОТКА САЙТА \r\nПОМОЖЕМ С ДОРАБОТКОЙ ТЕКУЩЕГО КОДА И НАПИСАНИЕМ НОВОГО. УСТАНОВИМ И ВНЕДРИМ МОДУЛИ С MARKETPLACE ИЛИ НАПИШЕМ СОБСТВЕННЫЕ ПОД ВАШИ ЗАДАЧИ. ПРОВЕДЕМ АУДИТ КОДА И УСТРАНИМ ВСЕ УЯЗВИМОСТИ, А ТАКЖЕ ПРОВЕДЕМ АВТОМАТИЗАЦИЮ ВАШИХ БИЗНЕС ПРОЦЕССОВ \r\n \r\nЕСЛИ У ВАС ИМЕЮТСЯ ВОПРОСЫ, СМЕЛО ПИШИТЕ НА ПОЧТУ: ANDREY.1CBITRIX@GMAIL.COM \r\nИЛИ ЗВОНИТЕ ПО НОМЕРУ: +7 (925) 599-75-65 \r\n \r\nСПАСИБО ЗА ПРОЧТЕНИЕ. ЖДУ ВАШЕГО ОБРАЩЕНИЯ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
