(1420, 284, 1, 5, 5, '', NULL, '', NULL, '— Приветствую Вас, мы занимаемся пиаром журнала KRASOTA.RU \r\n \r\n— Хотим разместим статью на вашем сайте, с двумя ссылками на наш сайт. \r\n— Если у Вас не один сайт, выбирайте несколько наших статей куда будете ссылаться. \r\n— Один сайт - одна статья - 2 ссылки. \r\n— Статьи готовим мы, выбирайте аналогичную тематику для вашей аудитории, под наш контент. \r\n— Выбираете статью на нашем сайте, на которую будете ссылаться. \r\n— Пролистайте пагинатор дальше 5-7 страницы, на начальные статьи уже хватит. \r\n— Присылаете нам ссылку на выбранную вами статью и ссылку на ваш сайт, согласовываем. \r\n— Готовим статью размещаем. \r\n \r\nПишите на почту: antongold2010@gmail.com', '— ПРИВЕТСТВУЮ ВАС, МЫ ЗАНИМАЕМСЯ ПИАРОМ ЖУРНАЛА KRASOTA.RU \r\n \r\n— ХОТИМ РАЗМЕСТИМ СТАТЬЮ НА ВАШЕМ САЙТЕ, С ДВУМЯ ССЫЛКАМИ НА НАШ САЙТ. \r\n— ЕСЛИ У ВАС НЕ ОДИН САЙТ, ВЫБИРАЙТЕ НЕСКОЛЬКО НАШИХ СТАТЕЙ КУДА БУДЕТЕ ССЫЛАТЬСЯ. \r\n— ОДИН САЙТ - ОДНА СТАТЬЯ - 2 ССЫЛКИ. \r\n— СТАТЬИ ГОТОВИМ МЫ, ВЫБИРАЙТЕ АНАЛОГИЧНУЮ ТЕМАТИКУ ДЛЯ ВАШЕЙ АУДИТОРИИ, ПОД НАШ КОНТЕНТ. \r\n— ВЫБИРАЕТЕ СТАТЬЮ НА НАШЕМ САЙТЕ, НА КОТОРУЮ БУДЕТЕ ССЫЛАТЬСЯ. \r\n— ПРОЛИСТАЙТЕ ПАГИНАТОР ДАЛЬШЕ 5-7 СТРАНИЦЫ, НА НАЧАЛЬНЫЕ СТАТЬИ УЖЕ ХВАТИТ. \r\n— ПРИСЫЛАЕТЕ НАМ ССЫЛКУ НА ВЫБРАННУЮ ВАМИ СТАТЬЮ И ССЫЛКУ НА ВАШ САЙТ, СОГЛАСОВЫВАЕМ. \r\n— ГОТОВИМ СТАТЬЮ РАЗМЕЩАЕМ. \r\n \r\nПИШИТЕ НА ПОЧТУ: ANTONGOLD2010@GMAIL.COM', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
