(1425, 285, 1, 5, 5, '', NULL, '', NULL, 'Никогда не думал, что со мной это произойдёт – меня обманули, \r\nкак лоха, развели как мальчика. Я вроде считал, что разбираюсь в людях. \r\nОбратился в компанию Сервис капитал 3 месяца назад, даже не предполагая, что это мошенники чистой воды и развод 100%. \r\nСервис капитал обещал много чего интересного и вкусного, а вместо этого я потерял все свои сбережения, пропали мои деньги, \r\nа компания не отвечает даже на мои звонки, письма и претензии. \r\nВы-мошенники, вы не компания, которая занимается ценными бумагами, \r\nвы занимаетесь ценными разводами и обманом честных граждан. \r\nhttps://www.сервискапитал.рф/ и https://сервискапитал.рф \r\nПочта: info@s-cap.ru, admin@s-cap.ru', 'НИКОГДА НЕ ДУМАЛ, ЧТО СО МНОЙ ЭТО ПРОИЗОЙДЁТ – МЕНЯ ОБМАНУЛИ, \r\nКАК ЛОХА, РАЗВЕЛИ КАК МАЛЬЧИКА. Я ВРОДЕ СЧИТАЛ, ЧТО РАЗБИРАЮСЬ В ЛЮДЯХ. \r\nОБРАТИЛСЯ В КОМПАНИЮ СЕРВИС КАПИТАЛ 3 МЕСЯЦА НАЗАД, ДАЖЕ НЕ ПРЕДПОЛАГАЯ, ЧТО ЭТО МОШЕННИКИ ЧИСТОЙ ВОДЫ И РАЗВОД 100%. \r\nСЕРВИС КАПИТАЛ ОБЕЩАЛ МНОГО ЧЕГО ИНТЕРЕСНОГО И ВКУСНОГО, А ВМЕСТО ЭТОГО Я ПОТЕРЯЛ ВСЕ СВОИ СБЕРЕЖЕНИЯ, ПРОПАЛИ МОИ ДЕНЬГИ, \r\nА КОМПАНИЯ НЕ ОТВЕЧАЕТ ДАЖЕ НА МОИ ЗВОНКИ, ПИСЬМА И ПРЕТЕНЗИИ. \r\nВЫ-МОШЕННИКИ, ВЫ НЕ КОМПАНИЯ, КОТОРАЯ ЗАНИМАЕТСЯ ЦЕННЫМИ БУМАГАМИ, \r\nВЫ ЗАНИМАЕТЕСЬ ЦЕННЫМИ РАЗВОДАМИ И ОБМАНОМ ЧЕСТНЫХ ГРАЖДАН. \r\nHTTPS://WWW.СЕРВИСКАПИТАЛ.РФ/ И HTTPS://СЕРВИСКАПИТАЛ.РФ \r\nПОЧТА: INFO@S-CAP.RU, ADMIN@S-CAP.RU', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
