(1475, 295, 1, 5, 5, '', NULL, '', NULL, 'Настоятельно рекомендуем отказаться от покупки шин на сельхозтехнику пока не получите наше предложение! \r\n \r\nЕсли Вы хороший инженер и Вам не нужны проблемы с шинами в ближайшие несколько лет, звоните +7 495 603 72 57 мы подберем идеальный вариант для вашей техники со склада. \r\n \r\nНет денег? Поможем! \r\nВзнос для нового клиента всего 10% и рассрочка от 30 дней. \r\n \r\nНашей компанией успешно реализуются поставки в такие агрохолдинги как: \r\n \r\nГруппа компаний Черкизово \r\nАгрохолдинг Продимекс \r\nАгрохолдинг Агроинвест \r\nАгрохолдинг Белая птица \r\nАгрохолдинг Даматэ \r\nАгрохолдинг Агробелогория \r\nАгрохолдинг Агро-Альянс \r\nАгрохолдинг А7 Агро \r\nАгрохолдинг РЗ Агро (Русская земля) \r\nСовхоз Им. Ленина \r\n \r\nПокупайте у официального представителя! \r\n \r\nПодробно о нас на сайте: \r\nhttps://www.crops.ru/about/ \r\n \r\nНаши контакты: \r\nhttps://www.crops.ru/about/contacts/ \r\n \r\nНаша почта для заявок: \r\nsale@crops.ru', 'НАСТОЯТЕЛЬНО РЕКОМЕНДУЕМ ОТКАЗАТЬСЯ ОТ ПОКУПКИ ШИН НА СЕЛЬХОЗТЕХНИКУ ПОКА НЕ ПОЛУЧИТЕ НАШЕ ПРЕДЛОЖЕНИЕ! \r\n \r\nЕСЛИ ВЫ ХОРОШИЙ ИНЖЕНЕР И ВАМ НЕ НУЖНЫ ПРОБЛЕМЫ С ШИНАМИ В БЛИЖАЙШИЕ НЕСКОЛЬКО ЛЕТ, ЗВОНИТЕ +7 495 603 72 57 МЫ ПОДБЕРЕМ ИДЕАЛЬНЫЙ ВАРИАНТ ДЛЯ ВАШЕЙ ТЕХНИКИ СО СКЛАДА. \r\n \r\nНЕТ ДЕНЕГ? ПОМОЖЕМ! \r\nВЗНОС ДЛЯ НОВОГО КЛИЕНТА ВСЕГО 10% И РАССРОЧКА ОТ 30 ДНЕЙ. \r\n \r\nНАШЕЙ КОМПАНИЕЙ УСПЕШНО РЕАЛИЗУЮТСЯ ПОСТАВКИ В ТАКИЕ АГРОХОЛДИНГИ КАК: \r\n \r\nГРУППА КОМПАНИЙ ЧЕРКИЗОВО \r\nАГРОХОЛДИНГ ПРОДИМЕКС \r\nАГРОХОЛДИНГ АГРОИНВЕСТ \r\nАГРОХОЛДИНГ БЕЛАЯ ПТИЦА \r\nАГРОХОЛДИНГ ДАМАТЭ \r\nАГРОХОЛДИНГ АГРОБЕЛОГОРИЯ \r\nАГРОХОЛДИНГ АГРО-АЛЬЯНС \r\nАГРОХОЛДИНГ А7 АГРО \r\nАГРОХОЛДИНГ РЗ АГРО (РУССКАЯ ЗЕМЛЯ) \r\nСОВХОЗ ИМ. ЛЕНИНА \r\n \r\nПОКУПАЙТЕ У ОФИЦИАЛЬНОГО ПРЕДСТАВИТЕЛЯ! \r\n \r\nПОДРОБНО О НАС НА САЙТЕ: \r\nHTTPS://WWW.CROPS.RU/ABOUT/ \r\n \r\nНАШИ КОНТАКТЫ: \r\nHTTPS://WWW.CROPS.RU/ABOUT/CONTACTS/ \r\n \r\nНАША ПОЧТА ДЛЯ ЗАЯВОК: \r\nSALE@CROPS.RU', NULL, NULL, NULL, NUL