INSERT INTO `b_iblock_element` VALUES
(1, '2014-07-02 20:58:44', 2, '2014-06-08 20:31:09', 1, 1, NULL, 'Y', '2014-04-02 00:00:00', NULL, 500, 'Коллекция \"Школьная пора\" становится историей нашей компании', 60, 'Коллекция “Школьная пора”, выполненная в уникальном сочетании однотонных тканей и тканей в клетку, яркая, броская и запоминающаяся, пришлась по вкусу родителям многих школьников нашего города.<br>Но время идет, меняются тенденции и требования. Поэтому данная коллекция школьной формы становится историей нашей компании.\r\nА ей на замену мы выпускаем сразу три новые стильные коллекции сезона 2014-2015, которые отличаются практичностью и безукоризненным исполнением.', 'html', 61, '', 'html', 'КОЛЛЕКЦИЯ \"ШКОЛЬНАЯ ПОРА\" СТАНОВИТСЯ ИСТОРИЕЙ НАШЕЙ КОМПАНИИ\r\nКОЛЛЕКЦИЯ “ШКОЛЬНАЯ ПОРА”, ВЫПОЛНЕННАЯ В УНИКАЛЬНОМ СОЧЕТАНИИ ОДНОТОННЫХ \r\nТКАНЕЙ И ТКАНЕЙ В КЛЕТКУ, ЯРКАЯ, БРОСКАЯ И ЗАПОМИНАЮЩАЯСЯ, ПРИШЛАСЬ ПО ВКУСУ \r\nРОДИТЕЛЯМ МНОГИХ ШКОЛЬНИКОВ НАШЕГО ГОРОДА.\r\nНО ВРЕМЯ ИДЕТ, МЕНЯЮТСЯ ТЕНДЕНЦИИ И ТРЕБОВАНИЯ. ПОЭТОМУ ДАННАЯ КОЛЛЕКЦИЯ \r\nШКОЛЬНОЙ ФОРМЫ СТАНОВИТСЯ ИСТОРИЕЙ НАШЕЙ КОМПАНИИ. А ЕЙ НА ЗАМЕНУ МЫ ВЫПУСКАЕМ \r\nСРАЗУ ТРИ НОВЫЕ СТИЛЬНЫЕ КОЛЛЕКЦИИ СЕЗОНА 2014-2015, КОТОРЫЕ ОТЛИЧАЮТСЯ \r\nПРАКТИЧНОСТЬЮ И БЕЗУКОРИЗНЕННЫМ ИСПОЛНЕНИЕМ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '1', '', '', '0', NULL, 869, '2014-06-09 00:04:59'),
(2, '2014-07-02 20:53:14', 2, '2014-06-08 20:34:58', 1, 1, NULL, 'Y', '2014-01-22 00:00:00', NULL, 500, 'Добро пожаловать на наш новый web-сайт: каталог школьной формы и возможность сделать заказ не выходя из дома', 3, 'Компания «Всегда в форме» не стоит на месте. Мы работаем над созданием новых уникальных коллекций школьной формы, но и не забываем о Вашем удобстве сотрудничества с нами.<br>Мы создали интернет-магазин. Он не только упрощает процесс приобретения школьной формы, но и является наглядным каталогом с моделями нашего школьного направления с удобной навигацией и простой и понятной презентацией продукции.<p></p>', 'html', 4, 'Компания «Всегда в форме» не стоит на месте. Мы работаем над созданием новых уникальных коллекций школьной формы, но и не забываем о Вашем удобстве сотрудничества с нами.<br>Мы создали интернет-магазин. Он не только упрощает процесс приобретения школьной формы, но и является наглядным каталогом с моделями нашего школьного направления с удобной навигацией и простой и понятной презентацией продукции.<p></p>', 'html', 'ДОБРО ПОЖАЛОВАТЬ НА НАШ НОВЫЙ WEB-САЙТ: КАТАЛОГ ШКОЛЬНОЙ ФОРМЫ И ВОЗМОЖНОСТЬ СДЕЛАТЬ ЗАКАЗ НЕ ВЫХОДЯ ИЗ ДОМА\r\nКОМПАНИЯ «ВСЕГДА В ФОРМЕ» НЕ СТОИТ НА МЕСТЕ. МЫ РАБОТАЕМ НАД СОЗДАНИЕМ \r\nНОВЫХ УНИКАЛЬНЫХ КОЛЛЕКЦИЙ ШКОЛЬНОЙ ФОРМЫ, НО И НЕ ЗАБЫВАЕМ О ВАШЕМ УДОБСТВЕ \r\nСОТРУДНИЧЕСТВА С НАМИ.\r\nМЫ СОЗДАЛИ ИНТЕРНЕТ-МАГАЗИН. ОН НЕ ТОЛЬКО УПРОЩАЕТ ПРОЦЕСС ПРИОБРЕТЕНИЯ \r\nШКОЛЬНОЙ ФОРМЫ, НО И ЯВЛЯЕТСЯ НАГЛЯДНЫМ КАТАЛОГОМ С МОДЕЛЯМИ НАШЕГО ШКОЛЬНОГО \r\nНАПРАВЛЕНИЯ С УДОБНОЙ НАВИГАЦИЕЙ И ПРОСТОЙ И ПОНЯТНОЙ ПРЕЗЕНТАЦИЕЙ ПРОДУКЦИИ.\r\nКОМПАНИЯ «ВСЕГДА В ФОРМЕ» НЕ СТОИТ НА МЕСТЕ. МЫ РАБОТАЕМ НАД СОЗДАНИЕМ \r\nНОВЫХ УНИКАЛЬНЫХ КОЛЛЕКЦИЙ ШКОЛЬНОЙ ФОРМЫ, НО И НЕ ЗАБЫВАЕМ О ВАШЕМ УДОБСТВЕ \r\nСОТРУДНИЧЕСТВА С НАМИ.\r\nМЫ СОЗДАЛИ ИНТЕРНЕТ-МАГАЗИН. ОН НЕ ТОЛЬКО УПРОЩАЕТ ПРОЦЕСС ПРИОБРЕТЕНИЯ \r\nШКОЛЬНОЙ ФОРМЫ, НО И ЯВЛЯЕТСЯ НАГЛЯДНЫМ КАТАЛОГОМ С МОДЕЛЯМИ НАШЕГО ШКОЛЬНОГО \r\nНАПРАВЛЕНИЯ С УДОБНОЙ НАВИГАЦИЕЙ И ПРОСТОЙ И ПОНЯТНОЙ ПРЕЗЕНТАЦИЕЙ ПРОДУКЦИИ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2', '', '', '0', NULL, 743, '2014-06-09 18:03:15'),
(3, '2018-07-15 19:21:53', 2, '2014-06-12 22:08:31', 1, 3, NULL, 'Y', NULL, NULL, 500, 'ШКОЛЬНАЯ ФОРМА В КРАСНОЯРСКЕ. В розницу и для школ', NULL, '<h3>Добро пожаловать в салон \"Всегда в форме\" и наше школьное направление \"Школьно.ру\"</h3>\r\nШкольная форма для мальчиков и девочек: комплекты, жилеты, брюки, юбки, сарафаны, водолазки... Все это доступно для заказа и приобретения в нашем <a href=\"http://shkolno.ru/contacts/\">салоне “Всегда в форме”</a>. К каждому новому учебному году мы обновляем коллекции. Все модели выполнены только из качественных материалов, а отменное качество изготовления порадуют Вас и Вашего ребенка. Да! - красивой и удобной школьной одежде! <b>Стильно! Удобно! Школьно!</b>', 'html', NULL, '', 'text', 'ШКОЛЬНАЯ ФОРМА В КРАСНОЯРСКЕ. В РОЗНИЦУ И ДЛЯ ШКОЛ\r\nДОБРО ПОЖАЛОВАТЬ В САЛОН \"ВСЕГДА В ФОРМЕ\" И НАШЕ ШКОЛЬНОЕ НАПРАВЛЕНИЕ \"ШКОЛЬНО.РУ\" \r\nШКОЛЬНАЯ ФОРМА ДЛЯ МАЛЬЧИКОВ И ДЕВОЧЕК: КОМПЛЕКТЫ, ЖИЛЕТЫ, БРЮКИ, ЮБКИ, \r\nСАРАФАНЫ, ВОДОЛАЗКИ... ВСЕ ЭТО ДОСТУПНО ДЛЯ ЗАКАЗА И ПРИОБРЕТЕНИЯ В НАШЕМ \r\nСАЛОНЕ “ВСЕГДА В ФОРМЕ” [ HTTP://SHKOLNO.RU/CONTACTS/ ] . К КАЖДОМУ НОВОМУ \r\nУЧЕБНОМУ ГОДУ МЫ ОБНОВЛЯЕМ КОЛЛЕКЦИИ. ВСЕ МОДЕЛИ ВЫПОЛНЕНЫ ТОЛЬКО ИЗ КАЧЕСТВЕННЫХ \r\nМАТЕРИАЛОВ, А ОТМЕННОЕ КАЧЕСТВО ИЗГОТОВЛЕНИЯ ПОРАДУЮТ ВАС И ВАШЕГО РЕБЕНКА. \r\nДА! - КРАСИВОЙ И УДОБНОЙ ШКОЛЬНОЙ ОДЕЖДЕ! СТИЛЬНО! УДОБНО! ШКОЛЬНО!\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '3', '', '', '0', NULL, NULL, NULL),
