(36, '2014-07-02 21:10:29', 2, '2014-07-02 21:09:43', 2, 1, NULL, 'Y', '2013-12-19 01:10:00', NULL, 500, 'Ребрендинг компании', 62, 'Компания «Всегда в форме» является результатом ребрендинга ООО «Спорт» - предприятия с 20-тилетней историей, специализирующейся на производстве спортивной формы, школьной формы и корпоративной униформы.<br>Теперь каждый вид деятельности вынесен в отдельное направление.<br>Наша компания идет&nbsp;в ногу со временем и&nbsp;постоянно развивается,&nbsp;сохраняя при этом то&nbsp;ценное, что накоплено&nbsp;за долгие годы.<br>Мы стремимся сделать все, чтобы сотрудничество с нами приносило радость нашим клиентам!<br>', 'html', NULL, '', 'text', 'РЕБРЕНДИНГ КОМПАНИИ\r\nКОМПАНИЯ «ВСЕГДА В ФОРМЕ» ЯВЛЯЕТСЯ РЕЗУЛЬТАТОМ РЕБРЕНДИНГА ООО «СПОРТ» \r\n- ПРЕДПРИЯТИЯ С 20-ТИЛЕТНЕЙ ИСТОРИЕЙ, СПЕЦИАЛИЗИРУЮЩЕЙСЯ НА ПРОИЗВОДСТВЕ \r\nСПОРТИВНОЙ ФОРМЫ, ШКОЛЬНОЙ ФОРМЫ И КОРПОРАТИВНОЙ УНИФОРМЫ.\r\nТЕПЕРЬ КАЖДЫЙ ВИД ДЕЯТЕЛЬНОСТИ ВЫНЕСЕН В ОТДЕЛЬНОЕ НАПРАВЛЕНИЕ.\r\nНАША КОМПАНИЯ ИДЕТ&NBSP;В НОГУ СО ВРЕМЕНЕМ И&NBSP;ПОСТОЯННО РАЗВИВАЕТСЯ,&NBSP;СОХРАНЯЯ \r\nПРИ ЭТОМ ТО&NBSP;ЦЕННОЕ, ЧТО НАКОПЛЕНО&NBSP;ЗА ДОЛГИЕ ГОДЫ.\r\nМЫ СТРЕМИМСЯ СДЕЛАТЬ ВСЕ, ЧТОБЫ СОТРУДНИЧЕСТВО С НАМИ ПРИНОСИЛО РАДОСТЬ \r\nНАШИМ КЛИЕНТАМ!\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '36', '', '', '0', NULL, 588, '2014-07-02 21:09:57'),
(37, '2018-07-15 17:16:19', 2, '2014-07-02 21:32:20', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы А01-МН, начальная школа', 382, '', 'text', 383, '<b>Жилет<br>\r\n </b>Жилет однобортный с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Материал: костюмное полотно.<br>\r\n Состав: полиэстер.<br>\r\n <b>Брюки<br>\r\n </b>Силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно.&nbsp;Состав: вискоза с добавлением нити «спандекс». <br>\r\nДля этого комплекта рекомендуется рубашка в белом, светло-сером и темно-сером цветах. Дополнительно можно использовать галстук.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А01-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ОДНОБОРТНЫЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА И СПИНКА \r\nПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. \r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ПОЛИЭСТЕР.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ \r\nЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ВИСКОЗА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС». \r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА В БЕЛОМ, СВЕТЛО-СЕРОМ И ТЕМНО-СЕРОМ \r\nЦВЕТАХ. ДОПОЛНИТЕЛЬНО МОЖНО ИСПОЛЬЗОВАТЬ ГАЛСТУК.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '37', 'komplekt-А01mn', '', '0', NULL, NULL, NULL),
