(41, '2018-07-15 17:18:18', 2, '2014-07-03 19:40:03', 2, 2, 15, 'Y', NULL, NULL, 500, 'Брюки для мальчика А01-МНН, начальная школа', 356, '', 'html', 357, 'Брюки серые, силуэт «школьник».<br>\r\n Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки.<br>\r\n Передняя часть брюк выполнена на подкладке.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\n Состав: вискоза с добавлением нити «спандекс».<br>', 'html', 'БРЮКИ ДЛЯ МАЛЬЧИКА А01-МНН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nБРЮКИ СЕРЫЕ, СИЛУЭТ «ШКОЛЬНИК».\r\nСПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ \r\nПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '41', 'bryuki-a01mnn', '', '0', NULL, NULL, NULL),
