(43, '2018-07-15 17:20:34', 2, '2014-07-03 19:49:52', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы А01-МС, средняя школа', 384, '', 'text', 385, '<b>Жилет</b><br>\r\n Жилет однобортный с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Брюки</b><br>\r\n Силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки.<br>\r\n Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно.&nbsp;Состав: вискоза с добавлением нити «спандекс».<br>\r\n Для этого комплекта рекомендуется рубашка в белом, светло-сером и темно-сером цветах.<br>\r\n Дополнительно можно использовать галстук.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А01-МС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ОДНОБОРТНЫЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА И СПИНКА \r\nПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ВИСКОЗА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА В БЕЛОМ, СВЕТЛО-СЕРОМ И ТЕМНО-СЕРОМ \r\nЦВЕТАХ.\r\nДОПОЛНИТЕЛЬНО МОЖНО ИСПОЛЬЗОВАТЬ ГАЛСТУК.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '43', 'komplekt-a01ms', '', '0', NULL, NULL, NULL),
