(49, '2018-07-16 17:34:13', 2, '2014-07-03 20:17:43', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А02-ДН, начальная школа', 386, '', 'text', 387, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно.&nbsp;Состав: вискоза с добавлением нити «спандекс».<br>\r\n Для этого комплекта рекомендуется блузка или водолазка в белом, светло-сером и темно-сером цветах.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А02-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. \r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ВИСКОЗА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ БЛУЗКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nИ ТЕМНО-СЕРОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '49', 'komplekt-a02dn', '', '0', NULL, NULL, NULL),
