(65, '2018-07-15 17:18:08', 2, '2014-07-03 23:08:48', 2, 2, 15, 'Y', NULL, NULL, 500, 'Брюки для мальчика А04-МНН, начальная школа', 360, '', 'text', 361, 'Брюки синие, силуэт «школьник». Спереди расположены карманы. Застежка на молнию.<br>\r\n Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\nСостав: вискоза.', 'html', 'БРЮКИ ДЛЯ МАЛЬЧИКА А04-МНН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nБРЮКИ СИНИЕ, СИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА \r\nМОЛНИЮ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. \r\nПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '65', 'bryuki-a04mnn', '', '0', NULL, NULL, NULL),
