&NBSP;80 %.\r\nЦЕНА НА ИЗДЕЛИЯ ИЗ ЭТОГО МАТЕРИАЛА 1550 РУБ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '67', 'komplekt-a05mn', '', '0', NULL, NULL, NULL),
