(81, '2018-07-16 17:29:27', 2, '2014-07-04 12:14:55', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А08-ДН, начальная школа', 406, '', 'text', 407, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом.<br>\r\n Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: бежевый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке.<br>\r\n Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: коричневый.<br>\r\n Материал: эластичное костюмное полотно.&nbsp;Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А08-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ.\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. ОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, \r\nВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: БЕЖЕВЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.\r\nЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД ФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: КОРИЧНЕВЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '81', 'komplekt-a08dn', '', '0', NULL, NULL, NULL),
(82, '2018-07-16 17:14:24', 2, '2014-07-04 12:16:49', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А08-ДС, средняя школа', 408, '', 'text', 409, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом.<br>\r\n Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: бежевый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке.<br>\r\n Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: коричневый.<br>\r\nМатериал: эластичное костюмное полотно.&nbsp;Состав: вискоза.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А08-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ.\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. ОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, \r\nВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: БЕЖЕВЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.\r\nЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД ФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: КОРИЧНЕВЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '82', 'komplekt-a08ds', '', '0', NULL, NULL, NULL),
(83, '2018-07-15 16:49:37', 2, '2014-07-04 12:25:38', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А09-Н, начальная школа', 334, '', 'text', 335, 'Коричневый сарафан полуприлегающего силуэта.<br>\r\nГорловина круглая, оригинально отделана вставкой из атласной ткани. Объем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>\r\nКоричневый цвет&nbsp;удивительным образом ассоциируется с формой, которую носили девочки во времена Советского Союза.<br>\r\nМатериал: костюмное эластичное полотно.<br>\r\nСостав: вискоза.<br>', 'html', 'САРАФАН А09-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nКОРИЧНЕВЫЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА.\r\nГОРЛОВИНА КРУГЛАЯ, ОРИГИНАЛЬНО ОТДЕЛАНА ВСТАВКОЙ ИЗ АТЛАСНОЙ ТКАНИ. ОБЪЕМ \r\nСАРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nКОРИЧНЕВЫЙ ЦВЕТ&NBSP;УДИВИТЕЛЬНЫМ ОБРАЗОМ АССОЦИИРУЕТСЯ С ФОРМОЙ, КОТОРУЮ \r\nНОСИЛИ ДЕВОЧКИ ВО ВРЕМЕНА СОВЕТСКОГО СОЮЗА.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '83', 'sarafan-a09n', '', '0', NULL, NULL, NULL),
(84, '2018-07-15 16:49:28', 2, '2014-07-04 12:51:39', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А10-Н, начальная школа', 336, '', 'text', 337, 'Серый сарафан полуприлегающего силуэта. Горловина круглая, оригинально отделана вставкой из кружевного полотна.<br>\r\nОбъем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>\r\nМатериал: костюмное эластичное полотно.<br>\r\nСостав: вискоза.<br>', 'html', 'САРАФАН А10-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСЕРЫЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ГОРЛОВИНА КРУГЛАЯ, ОРИГИНАЛЬНО \r\nОТДЕЛАНА ВСТАВКОЙ ИЗ КРУЖЕВНОГО ПОЛОТНА.\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '84', 'sarafan-a10n', '', '0', NULL, NULL, NULL),
(85, '2018-07-15 16:49:20', 2, '2014-07-04 12:53:16', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А11-Н, начальная школа', 338, '', 'text', 339, 'Синий сарафан полуприлегающего силуэта. Горловина круглая, оригинально отделана вставкой из кружевного полотна.<br>\r\nОбъем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>\r\nМатериал: костюмное эластичное полотно.<br>\r\nСостав: вискоза.<br>', 'html', 'САРАФАН А11-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСИНИЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ГОРЛОВИНА КРУГЛАЯ, ОРИГИНАЛЬНО \r\nОТДЕЛАНА ВСТАВКОЙ ИЗ КРУЖЕВНОГО ПОЛОТНА.\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '85', 'sarafan-a11', '', '0', NULL, NULL, NULL),
(86, '2018-07-15 16:49:11', 2, '2014-07-04 12:54:53', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А12-Н, начальная школа', 340, '', 'text', 341, 'Серый сарафан полуприлегающего силуэта. Горловина круглая.<br>\r\nОбъем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>\r\nМатериал: костюмное эластичное полотно.<br>\r\nСостав: полиэстер с добавлением «спандекса».<br>', 'html', 'САРАФАН А12-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСЕРЫЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ГОРЛОВИНА КРУГЛАЯ.\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ПОЛИЭСТЕР С ДОБАВЛЕНИЕМ «СПАНДЕКСА».', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '86', 'sarafan-a12', '', '0', NULL, NULL, NULL),
(87, '2018-07-15 16:49:02', 2, '2014-07-04 13:08:14', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан В01-Н, начальная школа', 342, '', 'text', 343, 'Сарафан полуприлегающего силуэта. Вырез горловины овальный.<br>\r\nСарафан отрезной по линии бедер.<br>\r\nЮбка имеет четыре бантовых складки и выполнена из ткани «шотландка», которая является компаньоном к темно-синей ткани.<br>\r\nЗастежка на молнию сзади. Объем регулируется при помощи хлястиков, вшитых в боковые швы.<br>\r\nМатериал разработан специально для школьной формы.<br>\r\nСостав: шерсть 15 % и вискоза 85 %.<br>', 'html', 'САРАФАН В01-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ВЫРЕЗ ГОРЛОВИНЫ ОВАЛЬНЫЙ.\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ БЕДЕР.\r\nЮБКА ИМЕЕТ ЧЕТЫРЕ БАНТОВЫХ СКЛАДКИ И ВЫПОЛНЕНА ИЗ ТКАНИ «ШОТЛАНДКА», КОТОРАЯ \r\nЯВЛЯЕТСЯ КОМПАНЬОНОМ К ТЕМНО-СИНЕЙ ТКАНИ.\r\nЗАСТЕЖКА НА МОЛНИЮ СЗАДИ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ \r\nВ БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ РАЗРАБОТАН СПЕЦИАЛЬНО ДЛЯ ШКОЛЬНОЙ ФОРМЫ.\r\nСОСТАВ: ШЕРСТЬ 15 % И ВИСКОЗА 85 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '87', 'sarafan-v01', '', '0', NULL, NULL, NULL),
(88, '2018-07-15 16:52:53', 2, '2014-07-04 13:10:40', 2, 2, 7, 'Y', NULL, NULL, 12, 'Юбка с клиньями В04-НН, начальная школа', 330, '', 'text', 331, 'Юбка в клетку с клиньями на кокетке.<br>\r\n Объем пояса регулируется специальной резинкой.<br>\r\n Материал: «шотландка».<br>\r\n Состав: шерсть и вискоза.<br>', 'html', 'ЮБКА С КЛИНЬЯМИ В04-НН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ С КЛИНЬЯМИ НА КОКЕТКЕ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nСОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '88', 'yubka-v04nn', '', '0', NULL, NULL, NULL),
(89, '2018-07-16 17:13:34', 2, '2014-07-04 13:14:23', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В02-ДН, начальная школа', 410, '', 'text', 411, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке.<br>\r\n Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с клиньями на кокетке. Объем пояса регулируется специальной резинкой.<br>\r\n Материал: «шотландка».<br>\r\n Цвет: сине-серый с бордовыми полосами.&nbsp;Состав: шерсть и вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В02-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ.\r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nЦВЕТ: СИНЕ-СЕРЫЙ С БОРДОВЫМИ ПОЛОСАМИ.&NBSP;СОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '89', 'komplekt-v02dn', '', '0', NULL, NULL, NULL),
(90, '2018-07-15 16:53:00', 2, '2014-07-04 13:19:58', 2, 2, 7, 'Y', NULL, NULL, 15, 'Юбка в складку В05-НН, начальная школа', 332, '', 'text', 333, 'Юбка в клетку в складку, по передней части, на кокетке, пояс на регулируемой резинке.<br>\r\n Материал: «шотландка».<br>\r\n Состав: вискоза и полиэстер.<br>', 'html', 'ЮБКА В СКЛАДКУ В05-НН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ В СКЛАДКУ, ПО ПЕРЕДНЕЙ ЧАСТИ, НА КОКЕТКЕ, ПОЯС НА РЕГУЛИРУЕМОЙ \r\nРЕЗИНКЕ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '90', 'yubka-v05nn', '', '0', NULL, NULL, NULL),
(91, '2018-06-29 20:32:35', 2, '2014-07-04 13:22:50', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы В03-ДН, начальная школа', 412, '', 'text', 413, '<b>Жилет</b><br>Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>Цвет: светло-серый.<br>Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br><b>Юбка</b><br>Юбка в складку по передней части, на кокетке, пояс на регулируемой резинке.<br>Цвет: в бордовых оттенках.<br>Материал: «шотландка». Состав: вискоза и полиэстер.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В03-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ, НА КОКЕТКЕ, ПОЯС НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.\r\nЦВЕТ: В БОРДОВЫХ ОТТЕНКАХ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА». СОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '91', 'komplekt-v03dn', '', '0', NULL, NULL, NULL),
(92, '2018-07-15 17:17:06', 2, '2014-07-04 13:37:32', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Штиль\", начальная школа', 380, '', 'text', 381, 'Жилет голубой трикотажный с V-образной горловиной, полотно комбинированного переплетения.<br>\r\nПолотно гладкое, без рисунка.<br>\r\nВорот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"ШТИЛЬ\", НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ ГОЛУБОЙ ТРИКОТАЖНЫЙ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ.\r\nПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА.\r\nВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА \r\nС ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '92', 'zhilet-c01mv', '', '0', NULL, NULL, NULL),
(93, '2018-07-15 17:15:57', 2, '2014-07-04 13:41:55', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы С01-МН, начальная школа', 414, '', 'text', 415, '<b>Жилет</b><br>\r\n Жилет трикотажный с V-образной горловиной, полотно комбинированного переплетения. Полотно гладкое, без рисунка. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: стальной.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки</b><br>\r\n Брюки – силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\n Состав: вискоза.<br>\r\n Рекомендуемые цвета: черный, темно-синий.<br>\r\n <br>\r\n Для этого комплекта рекомендуется рубашка или водолазка в белом, светло-сером цветах.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С01-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО \r\nНИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СТАЛЬНОЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ\r\nБРЮКИ – СИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. \r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. \r\nПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.\r\nРЕКОМЕНДУЕМЫЕ ЦВЕТА: ЧЕРНЫЙ, ТЕМНО-СИНИЙ.\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nЦВЕТАХ.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '93', 'komplekt-s01mn', '', '0', NULL, NULL, NULL),
(94, '2018-07-15 17:20:08', 2, '2014-07-04 13:47:51', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы С01-МС, средняя школа', 416, '', 'text', 417, '<b>Жилет</b><br>\r\n Жилет трикотажный с V-образной горловиной, полотно комбинированного переплетения. Полотно гладкое, без рисунка. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: стальной.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки</b><br>\r\n Силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\n Состав: вискоза.<br>\r\n <br>\r\n Для этого комплекта рекомендуется рубашка или водолазка в белом, светло-сером цветах.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С01-МС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО \r\nНИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СТАЛЬНОЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ \r\nЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nЦВЕТАХ.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '94', 'komplekt-s01ms', '', '0', NULL, NULL, NULL),
