(98, '2018-06-29 20:32:17', 2, '2014-07-04 16:03:38', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С02-ДСТ, старшая школа', 201, '', 'text', 202, '<b>Жилет</b><br>Жилет трикотажный с V-образной горловиной, полотно комбинированного переплетения. Полотно гладкое, без рисунка. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: стальной.<br>Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке.<br>Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>Цвет: темно-серый.<br>Материал: эластичное костюмное полотно.<br>Состав: вискоза.\r\n<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С02-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО \r\nНИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СТАЛЬНОЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.\r\nЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД ФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА. \r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '98', 'komplekt-s02dst', '', '0', NULL, NULL, NULL),
(99, '2018-07-15 17:16:59', 2, '2014-07-04 16:18:00', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Колосок\", начальная школа', 203, '', 'text', 204, 'Жилет серый трикотажный с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<span style=\"color: #ff0000;\"><b>На данный момент на складе имеются данные жилеты для начальной школы&nbsp;размеров 32-1 и 34-2 и продаются в розницу.</b></span><br>\r\n<span style=\"color: #ff0000;\"><b>Остальные размеры доступны только при заказе от 20 шт.</b></span><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"КОЛОСОК\", НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ СЕРЫЙ ТРИКОТАЖНЫЙ С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ НА СКЛАДЕ ИМЕЮТСЯ ДАННЫЕ ЖИЛЕТЫ ДЛЯ НАЧАЛЬНОЙ ШКОЛЫ&NBSP;РАЗМЕРОВ \r\n32-1 И 34-2 И ПРОДАЮТСЯ В РОЗНИЦУ.\r\nОСТАЛЬНЫЕ РАЗМЕРЫ ДОСТУПНЫ ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '99', 'zhilet-c02mv', '', '0', NULL, NULL, NULL),
(100, '2018-07-15 17:15:49', 2, '2014-07-04 16:23:11', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы С03-МН, начальная школа', 205, '', 'text', 206, '<b>Жилет</b><br>\r\n Жилет трикотажный с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: серый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки</b><br>\r\n Силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\n Состав: вискоза.<br>\r\n Цвет: темно-серый<br>\r\n <br>\r\n Для этого комплекта рекомендуется рубашка или водолазка в белом, светло-сером цветах.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С03-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СЕРЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ \r\nЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '100', 'komplekt-s03mn', '', '0', NULL, NULL, NULL),
