(111, '2018-07-15 16:44:50', 2, '2014-07-04 17:11:24', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С06-ДН, начальная школа', 228, '', 'text', 229, '<b>Жилет</b><br>\r\n Жилет трикотажный с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: серый. Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С06-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СЕРЫЙ. СОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '111', 'komplekt-s06dn', '', '0', NULL, NULL, NULL),
