(114, '2018-07-15 16:55:08', 2, '2014-07-04 17:54:49', 2, 2, 10, 'Y', NULL, NULL, 500, 'Брюки для девочки \"Школьница\", начальная школа', 236, '', 'text', 237, 'Черные брюки. Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\n Состав: вискоза.<br>', 'html', 'БРЮКИ ДЛЯ ДЕВОЧКИ \"ШКОЛЬНИЦА\", НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЧЕРНЫЕ БРЮКИ. СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ ПОЯСА \r\nРЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ ЧАСТЬ \r\nБРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '114', 'bryuki-shkolnitsa', '', '0', NULL, NULL, NULL),
