(116, '2018-07-15 16:50:58', 2, '2014-07-04 18:20:39', 2, 2, 12, 'Y', NULL, NULL, 500, 'Жилет трикотажный для девочки \"Меридиан\", начальная школа', 240, '', 'text', 241, 'Синий трикотажный жилет с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<span style=\"color: #ff0000;\"><b>На данный момент на складе имеются данные жилеты для начальной школы&nbsp;размеров 32-1, 34-1 и 36-2&nbsp;и продаются в розницу.</b></span><br>\r\n<span style=\"color: #ff0000;\"><b>Остальные размеры доступны только при заказе от 20 шт.</b></span><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ ДЕВОЧКИ \"МЕРИДИАН\", НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСИНИЙ ТРИКОТАЖНЫЙ ЖИЛЕТ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ НА СКЛАДЕ ИМЕЮТСЯ ДАННЫЕ ЖИЛЕТЫ ДЛЯ НАЧАЛЬНОЙ ШКОЛЫ&NBSP;РАЗМЕРОВ \r\n32-1, 34-1 И 36-2&NBSP;И ПРОДАЮТСЯ В РОЗНИЦУ.\r\nОСТАЛЬНЫЕ РАЗМЕРЫ ДОСТУПНЫ ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '116', 'zhilet-c03dvn', '', '0', NULL, NULL, NULL),
(117, '2018-07-15 16:44:33', 2, '2014-07-04 18:24:26', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С08-ДН, начальная школа', 242, '', 'text', 243, '<b>Жилет</b><br>\r\n Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: темно-синий.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-синий.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С08-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '117', 'komplekt-s08dn', '', '0', NULL, NULL, NULL),
(118, '2018-07-15 17:00:55', 2, '2014-07-04 18:26:07', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С08-ДС, средняя школа', 244, '', 'text', 245, '<b>Жилет</b><br>\r\n Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: темно-синий.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-синий.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С08-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '118', 'komplekt-s08ds', '', '0', NULL, NULL, NULL),
(119, '2018-06-29 20:31:28', 2, '2014-07-04 18:27:44', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С08-ДСТ, старшая школа', 246, '', 'text', 247, '<b>Жилет</b><br>Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: темно-синий.<br>Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>Цвет: темно-синий.<br>Материал: эластичное костюмное полотно. Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С08-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '119', 'komplekt-s08dst', '', '0', NULL, NULL, NULL),
(120, '2018-07-15 16:53:08', 2, '2014-07-04 18:38:18', 2, 2, 7, 'Y', NULL, NULL, 18, 'Юбка в складку В06-НН, начальная школа', 248, '', 'text', 249, 'Юбка в клетку, в складку по передней части из «шотландки».<br>\r\n Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>\r\n Материал: костюмное полотно – «шотландка».<br>\r\n Состав: шерсть и вискоза.<br>', 'html', 'ЮБКА В СКЛАДКУ В06-НН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ, В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ».\r\nПРЕДУСМОТРЕНА КОКЕТКА ДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА \r\nРЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».\r\nСОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '120', 'yubka-v06nn', '', '0', NULL, NULL, NULL),
(121, '2018-07-15 16:44:23', 2, '2014-07-04 18:41:55', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С09-ДН, начальная школа', 250, '', 'text', 251, '<b>Жилет</b><br>\r\nЖилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nЦвет: темно-синий.<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<b>Юбка</b><br>\r\nЮбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>\r\nМатериал: костюмное полотно – «шотландка».&nbsp;Состав: шерсть и вискоза.<br>\r\n<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С09-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».&NBSP;СОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '121', 'komplekt-s09dn', '', '0', NULL, NULL, NULL),
(122, '2018-07-15 17:16:52', 2, '2014-07-04 18:50:02', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Меридиан\", начальная школа', 252, '', 'text', 253, 'Жилет синий трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<span style=\"color: #ff0000;\"><b>На данный момент на складе имеются данные жилеты для начальной школы&nbsp;размеров 28, 32-1,&nbsp;34-2 и 36-2&nbsp;и продаются в розницу.</b></span><br>\r\n<span style=\"color: #ff0000;\"><b>Остальные размеры доступны только при заказе от 20 шт.</b></span><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"МЕРИДИАН\", НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ СИНИЙ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ НА СКЛАДЕ ИМЕЮТСЯ ДАННЫЕ ЖИЛЕТЫ ДЛЯ НАЧАЛЬНОЙ ШКОЛЫ&NBSP;РАЗМЕРОВ \r\n28, 32-1,&NBSP;34-2 И 36-2&NBSP;И ПРОДАЮТСЯ В РОЗНИЦУ.\r\nОСТАЛЬНЫЕ РАЗМЕРЫ ДОСТУПНЫ ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '122', 'zhilet-c03mv', '', '0', NULL, NULL, NULL),
(123, '2018-07-15 17:15:40', 2, '2014-07-04 18:53:21', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы С10-МН, начальная школа', 254, '', 'text', 255, '<b>Жилет</b><br>\r\n Жилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: темно-синий.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки</b><br>\r\n Силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: темно-синий.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С10-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ \r\nЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '123', 'komplekt-s10mn', '', '0', NULL, NULL, NULL),
