(131, '2018-07-15 17:19:26', 2, '2014-07-04 19:30:13', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы С12-МС, средняя школа', 270, '', 'text', 271, '<b>Жилет</b><br>\r\n Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордовый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки</b><br>\r\n Брюки – силуэт «школьник». Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: коричневый.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С12-МС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ\r\nБРЮКИ – СИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. \r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. \r\nПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nЦВЕТ: КОРИЧНЕВЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '131', 'komplekt-s12ms', '', '0', NULL, NULL, NULL),
