(135, '2018-07-15 17:00:46', 2, '2014-07-04 20:43:27', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С14-ДС, средняя школа', 278, '', 'text', 279, '<b>Жилет</b><br>\r\n Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордовый. Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>\r\n Цвет: в бордовых оттенках. Материал: костюмное полотно – «шотландка».<br>\r\n Состав: вискоза 20 % и полиэстер 80 %.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С14-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ. СОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nЦВЕТ: В БОРДОВЫХ ОТТЕНКАХ. МАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».\r\nСОСТАВ: ВИСКОЗА 20 % И ПОЛИЭСТЕР 80 %.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '135', 'komplekt-s14ds', '', '0', NULL, NULL, NULL),
