(140, '2018-07-15 16:43:38', 2, '2014-07-04 21:33:17', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С16-ДН, начальная школа', 288, '', 'text', 289, '<b>Жилет</b><br>\r\n Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордовый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка с клиньями на кокетке. Клинья выполнены из ткани-компаньона, которая хорошо гармонирует с цветом жилета. Объем пояса регулируется специальной резинкой.<br>\r\n Цвет: в бордовых тонах.<br>\r\n Материал: «шотландка». Состав: вискоза и полиэстер.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С16-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. КЛИНЬЯ ВЫПОЛНЕНЫ ИЗ ТКАНИ-КОМПАНЬОНА, КОТОРАЯ \r\nХОРОШО ГАРМОНИРУЕТ С ЦВЕТОМ ЖИЛЕТА. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ \r\nРЕЗИНКОЙ.\r\nЦВЕТ: В БОРДОВЫХ ТОНАХ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА». СОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '140', 'komplekt-s16dn', '', '0', NULL, NULL, NULL),
