(142, '2018-07-15 16:43:28', 2, '2014-07-04 21:41:06', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С17-ДН, начальная школа', 292, '', 'text', 293, '<b>Жилет</b><br>\r\n Жилет с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордовый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки \"Школьница\"</b><br>\r\n Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: черный.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С17-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ \"ШКОЛЬНИЦА\"\r\nСПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ \r\nПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА \r\nНА ПОДКЛАДКЕ.\r\nЦВЕТ: ЧЕРНЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '142', 'komplekt-s17dn', '', '0', NULL, NULL, NULL),
(143, '2018-07-16 17:12:53', 2, '2014-07-04 22:48:53', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В02-ДС, средняя школа', 294, '', 'text', 295, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке.<br>\r\n Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с клиньями на кокетке. Объем пояса регулируется специальной резинкой.<br>\r\n Материал: «шотландка».<br>\r\nЦвет: сине-серый с бордовыми полосами.&nbsp;Состав: шерсть и вискоза.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В02-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ.\r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nЦВЕТ: СИНЕ-СЕРЫЙ С БОРДОВЫМИ ПОЛОСАМИ.&NBSP;СОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '143', 'komplekt-v02dc', '', '0', NULL, NULL, NULL),
(144, '2018-07-16 17:12:16', 2, '2014-07-04 22:51:47', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В03-ДС, средняя школа', 296, '', 'text', 297, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка в складку по передней части, на кокетке, пояс на регулируемой резинке.<br>\r\n Цвет: в бордовых оттенках.<br>\r\nМатериал: «шотландка». Состав: вискоза и полиэстер.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В03-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ, НА КОКЕТКЕ, ПОЯС НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.\r\nЦВЕТ: В БОРДОВЫХ ОТТЕНКАХ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА». СОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '144', 'komplekt-v03ds', '', '0', NULL, NULL, NULL),
(145, '2018-07-15 17:08:48', 2, '2014-07-04 22:55:33', 2, 2, 7, 'Y', NULL, NULL, 19, 'Юбка в складку В06-НС, средняя школа', 298, '', 'text', 299, 'Юбка в клетку в складку по передней части из «шотландки».<br>\r\n Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>\r\n Материал: костюмное полотно – «шотландка».<br>\r\nСостав: шерсть и вискоза.', 'html', 'ЮБКА В СКЛАДКУ В06-НС, СРЕДНЯЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ».\r\nПРЕДУСМОТРЕНА КОКЕТКА ДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА \r\nРЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».\r\nСОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '145', 'yubka-v06ns', '', '0', NULL, NULL, NULL),
(146, '2018-07-15 17:00:11', 2, '2014-07-04 22:58:09', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С09-ДС, средняя школа', 300, '', 'text', 301, '<b>Жилет</b><br>\r\n Жилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: темно-синий.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>\r\n Материал: костюмное полотно – «шотландка».&nbsp;Состав: шерсть и вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С09-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».&NBSP;СОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '146', 'komplekt-s09ds', '', '0', NULL, NULL, NULL),
(147, '2018-07-15 17:00:02', 2, '2014-07-04 23:07:08', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С13-ДС, средняя школа', 302, '', 'text', 303, '<b>Жилет</b><br>\r\n Жилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордовый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>\r\n Материал: костюмное полотно – «шотландка». Состав: шерсть и вискоза.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С13-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА». СОСТАВ: ШЕРСТЬ И ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '147', 'komplekt-s13ds', '', '0', NULL, NULL, NULL),
(148, '2018-07-16 17:11:30', 2, '2014-07-04 23:19:12', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А06-ДН, начальная школа', 304, '', 'text', 305, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно. Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-синий.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>\r\n <br>\r\n Для этого комплекта рекомендуется блузка или водолазка в белом, светло-сером и темно-сером цветах.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А06-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ БЛУЗКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nИ ТЕМНО-СЕРОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '148', 'komplekt-a06dn', '', '0', NULL, NULL, NULL),
(149, '2018-07-16 17:10:54', 2, '2014-07-04 23:25:49', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А06-ДС, средняя школа', 306, '', 'text', 307, '<b>Жилет</b><br>\r\n Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Цвет: светло-серый.<br>\r\n Материал: костюмное полотно. Состав: полиэстер.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-синий.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>\r\n <br>\r\nДля этого комплекта рекомендуется блузка или водолазка в белом, светло-сером и темно-сером цветах.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А06-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ БЛУЗКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nИ ТЕМНО-СЕРОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '149', 'komplekt-a06ds', '', '0', NULL, NULL, NULL),
(150, '2018-07-15 16:43:03', 2, '2014-07-05 00:19:40', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С19-ДН, начальная школа', 418, '', 'text', 419, '<b>Жилет</b><br>\r\n Жилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордо.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Юбка</b><br>\r\n Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>\r\n Цвет: темно-серый.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С19-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДО.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '150', 'komplekt-s19dn', '', '0', NULL, NULL, NULL),
