(154, '2018-06-29 20:41:49', 2, '2014-07-27 19:48:13', 2, 2, 16, 'N', NULL, NULL, 500, 'Жилет для мальчика А01-МВСТ, старшая школа', 603, '', 'text', 604, 'Жилет серый однобортный с застежкой на 4 пуговицы, с карманами, на подкладке.<br>Полочка и спинка продублированы клеевым прокладочным материалом.<br>Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>Материал: костюмное полотно.<br>Состав: полиэстер.', 'html', 'ЖИЛЕТ ДЛЯ МАЛЬЧИКА А01-МВСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ СЕРЫЙ ОДНОБОРТНЫЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, С КАРМАНАМИ, НА ПОДКЛАДКЕ.\r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ.\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. ОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, \r\nВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '154', 'zhilet-a01mvst', '', '0', NULL, NULL, NULL),
(155, '2018-06-29 20:35:53', 2, '2014-07-27 19:59:00', 2, 2, 12, 'N', NULL, NULL, 500, 'Жилет для девочки А02-ДВСТ, старшая школа', 605, '', 'text', 606, 'Серый жилет с овальной горловиной с застежкой на 4 пуговицы, с карманами, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом.<br>Силуэт полуприлегающий.<br>Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>Материал: костюмное полотно.<br>Состав: полиэстер.', 'html', 'ЖИЛЕТ ДЛЯ ДЕВОЧКИ А02-ДВСТ, СТАРШАЯ ШКОЛА\r\n\r\nСЕРЫЙ ЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, С КАРМАНАМИ, \r\nНА ПОДКЛАДКЕ. ПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ.\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '155', 'zhilet-a02dvst', '', '0', NULL, NULL, NULL),
(156, '2018-06-29 20:37:10', 2, '2014-07-27 20:44:10', 2, 2, 7, 'N', NULL, NULL, 11, 'Юбка с клиньями В07-НСТ, старшая школа', 609, '', 'text', 610, 'Юбка в клетку с клиньями на кокетке. Клинья выполнены из ткани-компаньона, которая хорошо гармонирует с цветом жилета.<br>Объем пояса регулируется специальной резинкой.<br>Материал: «шотландка».<br>Состав: вискоза и полиэстер.', 'html', 'ЮБКА С КЛИНЬЯМИ В07-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ С КЛИНЬЯМИ НА КОКЕТКЕ. КЛИНЬЯ ВЫПОЛНЕНЫ ИЗ ТКАНИ-КОМПАНЬОНА, \r\nКОТОРАЯ ХОРОШО ГАРМОНИРУЕТ С ЦВЕТОМ ЖИЛЕТА.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '156', 'yubka-v07nst', '', '0', NULL, NULL, NULL),
(157, '2018-06-29 20:37:22', 2, '2014-07-27 20:49:18', 2, 2, 7, 'N', NULL, NULL, 14, 'Юбка с клиньями В04-НСТ, старшая школа', 612, '', 'text', 613, 'Юбка в клетку с клиньями на кокетке.<br>Объем пояса регулируется специальной резинкой.<br>Материал: «шотландка».<br>Состав: шерсть и вискоза.', 'html', 'ЮБКА С КЛИНЬЯМИ В04-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ С КЛИНЬЯМИ НА КОКЕТКЕ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nСОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '157', 'yubka-v04nst', '', '0', NULL, NULL, NULL),
(158, '2018-06-29 20:37:33', 2, '2014-07-27 20:53:06', 2, 2, 7, 'N', NULL, NULL, 17, 'Юбка в складку В05-НСТ, старшая школа', 616, '', 'text', 617, 'Юбка в клетку в складку, по передней части, на кокетке, пояс на регулируемой резинке.<br>Материал: «шотландка».<br>Состав: вискоза и полиэстер.', 'html', 'ЮБКА В СКЛАДКУ В05-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ В СКЛАДКУ, ПО ПЕРЕДНЕЙ ЧАСТИ, НА КОКЕТКЕ, ПОЯС НА РЕГУЛИРУЕМОЙ \r\nРЕЗИНКЕ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '158', 'yubka-v05nst', '', '0', NULL, NULL, NULL),
(159, '2018-06-29 20:37:44', 2, '2014-07-27 20:56:18', 2, 2, 7, 'N', NULL, NULL, 20, 'Юбка в складку В06-НСТ, старшая школа', 619, '', 'text', 620, 'Юбка в клетку в складку по передней части из «шотландки».<br>Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>Материал: костюмное полотно – «шотландка».<br>Состав: шерсть и вискоза.', 'html', 'ЮБКА В СКЛАДКУ В06-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА В КЛЕТКУ В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ».\r\nПРЕДУСМОТРЕНА КОКЕТКА ДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА \r\nРЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».\r\nСОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '159', 'yubka-v06nst', '', '0', NULL, NULL, NULL),
(160, '2018-07-15 17:05:07', 2, '2014-07-27 21:06:52', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А12-С, средняя школа', 623, '', 'text', 624, 'Серый сарафан полуприлегающего силуэта. Горловина круглая.<br>\r\nОбъем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>\r\nМатериал: костюмное эластичное полотно.<br>\r\nСостав: полиэстер с добавлением «спандекса».<br>', 'html', 'САРАФАН А12-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСЕРЫЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ГОРЛОВИНА КРУГЛАЯ.\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ПОЛИЭСТЕР С ДОБАВЛЕНИЕМ «СПАНДЕКСА».', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '160', 'sarafan-a12s', '', '0', NULL, NULL, NULL),
(161, '2018-07-15 17:04:57', 2, '2014-07-27 21:08:55', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А11-С, средняя школа', 626, '', 'text', 627, 'Синий сарафан полуприлегающего силуэта. Горловина круглая, оригинально отделана вставкой из кружевного полотна.<br>\r\nОбъем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>\r\nМатериал: костюмное эластичное полотно.<br>\r\nСостав: вискоза.<br>', 'html', 'САРАФАН А11-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСИНИЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ГОРЛОВИНА КРУГЛАЯ, ОРИГИНАЛЬНО \r\nОТДЕЛАНА ВСТАВКОЙ ИЗ КРУЖЕВНОГО ПОЛОТНА.\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '161', 'sarafan-a11s', '', '0', NULL, NULL, NULL),
(162, '2018-06-29 20:34:22', 2, '2014-07-27 21:11:46', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан А10-С, средняя школа', 628, '', 'text', 629, 'Серый сарафан полуприлегающего силуэта. Горловина круглая, оригинально отделана вставкой из кружевного полотна.<br>Объем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>Материал: костюмное эластичное полотно.<br>Состав: вискоза.<br>', 'html', 'САРАФАН А10-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСЕРЫЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ГОРЛОВИНА КРУГЛАЯ, ОРИГИНАЛЬНО \r\nОТДЕЛАНА ВСТАВКОЙ ИЗ КРУЖЕВНОГО ПОЛОТНА.\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '162', 'sarafan-a10s', '', '0', NULL, NULL, NULL),
(163, '2018-06-29 20:34:07', 2, '2014-07-27 21:14:42', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан А09-С, средняя школа', 631, '', 'text', 632, 'Коричневый сарафан полуприлегающего силуэта.<br>Горловина круглая, оригинально отделана вставкой из атласной ткани. Объем сарафана регулируется хлястиками, вшитыми в боковые швы.<br>Коричневый цвет&nbsp;удивительным образом ассоциируется с формой, которую носили девочки во времена Советского Союза.<br>Материал: костюмное эластичное полотно.<br>Состав: вискоза.<br>', 'html', 'САРАФАН А09-С, СРЕДНЯЯ ШКОЛА\r\n\r\nКОРИЧНЕВЫЙ САРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА.\r\nГОРЛОВИНА КРУГЛАЯ, ОРИГИНАЛЬНО ОТДЕЛАНА ВСТАВКОЙ ИЗ АТЛАСНОЙ ТКАНИ. ОБЪЕМ \r\nСАРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В БОКОВЫЕ ШВЫ.\r\nКОРИЧНЕВЫЙ ЦВЕТ&NBSP;УДИВИТЕЛЬНЫМ ОБРАЗОМ АССОЦИИРУЕТСЯ С ФОРМОЙ, КОТОРУЮ \r\nНОСИЛИ ДЕВОЧКИ ВО ВРЕМЕНА СОВЕТСКОГО СОЮЗА.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ЭЛАСТИЧНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '163', 'sarafan-a09s', '', '0', NULL, NULL, NULL),
(164, '2018-07-15 17:04:49', 2, '2014-07-27 21:18:03', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан В01-С, средняя школа', 636, '', 'text', 637, 'Сарафан полуприлегающего силуэта. Вырез горловины овальный.<br>\r\nСарафан отрезной по линии бедер.<br>\r\nЮбка имеет четыре бантовых складки и выполнена из ткани «шотландка», которая является компаньоном к темно-синей ткани.<br>\r\nЗастежка на молнию сзади. Объем регулируется при помощи хлястиков, вшитых в боковые швы.<br>\r\nМатериал разработан специально для школьной формы.<br>\r\nСостав: шерсть 15 % и вискоза 85 %.<br>', 'html', 'САРАФАН В01-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА. ВЫРЕЗ ГОРЛОВИНЫ ОВАЛЬНЫЙ.\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ БЕДЕР.\r\nЮБКА ИМЕЕТ ЧЕТЫРЕ БАНТОВЫХ СКЛАДКИ И ВЫПОЛНЕНА ИЗ ТКАНИ «ШОТЛАНДКА», КОТОРАЯ \r\nЯВЛЯЕТСЯ КОМПАНЬОНОМ К ТЕМНО-СИНЕЙ ТКАНИ.\r\nЗАСТЕЖКА НА МОЛНИЮ СЗАДИ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ \r\nВ БОКОВЫЕ ШВЫ.\r\nМАТЕРИАЛ РАЗРАБОТАН СПЕЦИАЛЬНО ДЛЯ ШКОЛЬНОЙ ФОРМЫ.\r\nСОСТАВ: ШЕРСТЬ 15 % И ВИСКОЗА 85 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '164', 'sarafan-v01s', '', '0', NULL, NULL, NULL),
(165, '2018-07-15 17:10:55', 2, '2014-07-29 16:31:44', 2, 2, 10, 'Y', NULL, NULL, 500, 'Брюки для девочки \"Школьница\", средняя школа', 641, '', 'text', 642, 'Черные брюки. Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\n Состав: вискоза.<br>', 'html', 'БРЮКИ ДЛЯ ДЕВОЧКИ \"ШКОЛЬНИЦА\", СРЕДНЯЯ ШКОЛА\r\n\r\nЧЕРНЫЕ БРЮКИ. СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ ПОЯСА \r\nРЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ ЧАСТЬ \r\nБРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '165', 'bryuki-a14dns', '', '0', NULL, NULL, NULL),
(166, '2018-07-15 17:06:50', 2, '2014-07-29 16:49:46', 2, 2, 12, 'Y', NULL, NULL, 500, 'Жилет трикотажный для девочки \"Штиль\", средняя школа', 643, '', 'text', 644, 'Голубой трикотажный жилет с V-образной горловиной, полотно комбинированного переплетения. Полотно гладкое, без рисунка. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ ДЕВОЧКИ \"ШТИЛЬ\", СРЕДНЯЯ ШКОЛА\r\n\r\nГОЛУБОЙ ТРИКОТАЖНЫЙ ЖИЛЕТ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '166', 'zhilet-s01dvs', '', '0', NULL, NULL, NULL),
(167, '2018-07-15 17:13:31', 2, '2014-07-29 16:51:52', 2, 2, 12, 'Y', NULL, NULL, 500, 'Жилет трикотажный для девочки \"Штиль\", старшая школа', 645, '', 'text', 646, 'Голубой трикотажный жилет с V-образной горловиной, полотно комбинированного переплетения. Полотно гладкое, без рисунка. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ ДЕВОЧКИ \"ШТИЛЬ\", СТАРШАЯ ШКОЛА\r\n\r\nГОЛУБОЙ ТРИКОТАЖНЫЙ ЖИЛЕТ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '167', 'zhilet-s01dvst', '', '0', NULL, NULL, NULL),
(168, '2018-07-15 17:06:41', 2, '2014-07-29 16:55:13', 2, 2, 12, 'Y', NULL, NULL, 500, 'Жилет трикотажный для девочки \"Колосок\", средняя школа', 647, '', 'text', 648, 'Серый трикотажный жилет с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ ДЕВОЧКИ \"КОЛОСОК\", СРЕДНЯЯ ШКОЛА\r\n\r\nСЕРЫЙ ТРИКОТАЖНЫЙ ЖИЛЕТ С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '168', 'zhilet-s02dvs', '', '0', NULL, NULL, NULL),
