(173, '2018-07-15 17:13:07', 2, '2014-07-29 17:12:42', 2, 2, 12, 'Y', NULL, NULL, 500, 'Жилет трикотажный для девочки \"Ромео\", старшая школа', 667, '', 'text', 668, 'Бордовый трикотажный жилет с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\nСостав: 30 % шерсть, 70 % нитрон.<br>\r\n<b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ ДЕВОЧКИ \"РОМЕО\", СТАРШАЯ ШКОЛА\r\n\r\nБОРДОВЫЙ ТРИКОТАЖНЫЙ ЖИЛЕТ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '173', 'zhilet-s04dvst', '', '0', NULL, NULL, NULL),
(174, '2018-06-29 20:23:51', 2, '2014-08-03 15:21:41', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А02-ДСТ, старшая школа', 671, '', 'text', 672, '<b>Жилет</b><br>Жилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>Цвет: светло-серый.<br>Материал: костюмное полотно.&nbsp;Состав: полиэстер.<br><b>Юбка</b><br>Юбка с запахом,&nbsp;застегивается на 5 пуговиц. В боковом шве расположен карман. Пояс выполнен на регулируемой резинке. Юбка легко подгоняется под фигуру девочки и не сковывает движения.<br>Цвет: темно-серый.<br>Материал: эластичное костюмное полотно.&nbsp;Состав: вискоза с добавлением нити «спандекс».<br>Для этого комплекта рекомендуется блузка или водолазка в белом, светло-сером и темно-сером цветах.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А02-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. ПОЛОЧКА \r\nИ СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. \r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С ЗАПАХОМ,&NBSP;ЗАСТЕГИВАЕТСЯ НА 5 ПУГОВИЦ. В БОКОВОМ ШВЕ РАСПОЛОЖЕН \r\nКАРМАН. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ. ЮБКА ЛЕГКО ПОДГОНЯЕТСЯ ПОД \r\nФИГУРУ ДЕВОЧКИ И НЕ СКОВЫВАЕТ ДВИЖЕНИЯ.\r\nЦВЕТ: ТЕМНО-СЕРЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ВИСКОЗА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ БЛУЗКА ИЛИ ВОДОЛАЗКА В БЕЛОМ, СВЕТЛО-СЕРОМ \r\nИ ТЕМНО-СЕРОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '174', 'komplekt-a02dst', '', '0', NULL, NULL, NULL),
(175, '2018-06-29 20:41:38', 2, '2014-08-03 15:42:17', 2, 2, 16, 'N', NULL, NULL, 500, 'Жилет для мальчика А04-МВСТ, старшая школа', 675, '', 'text', 676, 'Жилет синий с овальной горловиной с застежкой на 4 пуговицы, на подкладке Полочка и спинка продублированы клеевым прокладочным материалом.<br>Силуэт полуприлегающий. Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>Материал: костюмное полотно.<br>Состав: вискоза.<br>', 'html', 'ЖИЛЕТ ДЛЯ МАЛЬЧИКА А04-МВСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ СИНИЙ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ \r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ.\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. ОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, \r\nВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '175', 'zhilet-a04mvst', '', '0', NULL, NULL, NULL),
