(182, '2018-06-30 15:31:28', 2, '2014-08-03 16:20:59', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы В02-ДCТ, старшая школа', 700, '', 'text', 701, '<b>Жилет</b><br>\r\nЖилет с овальной горловиной с застежкой на 4 пуговицы, на подкладке.<br>\r\nПолочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\nОбъем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\nЦвет: светло-серый.<br>\r\nМатериал: костюмное полотно.&nbsp;Состав: полиэстер.<br>\r\n<b>Юбка</b><br>\r\nЮбка с клиньями на кокетке. Объем пояса регулируется специальной резинкой.<br>\r\nМатериал: «шотландка».<br>\r\nЦвет: сине-серый с бордовыми полосами.&nbsp;Состав: шерсть и вискоза.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В02-ДCТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С ОВАЛЬНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ.\r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ: СВЕТЛО-СЕРЫЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.&NBSP;СОСТАВ: ПОЛИЭСТЕР.\r\nЮБКА\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nЦВЕТ: СИНЕ-СЕРЫЙ С БОРДОВЫМИ ПОЛОСАМИ.&NBSP;СОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '182', 'komplekt-v02dct', '', '0', NULL, NULL, NULL),
