(184, '2018-07-15 17:21:23', 2, '2014-08-03 16:32:22', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Штиль\", средняя школа', 706, '', 'text', 707, 'Жилет голубой трикотажный с V-образной горловиной, полотно комбинированного переплетения.<br>\r\n Полотно гладкое, без рисунка.<br>\r\n Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"ШТИЛЬ\", СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ ГОЛУБОЙ ТРИКОТАЖНЫЙ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ.\r\nПОЛОТНО ГЛАДКОЕ, БЕЗ РИСУНКА.\r\nВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА \r\nС ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '184', 'zhilet-s01mvs', '', '0', NULL, NULL, NULL),
