(187, '2017-06-01 22:47:15', 2, '2014-08-03 16:56:58', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Колосок\", старшая школа', 719, '', 'text', 720, 'Жилет серый трикотажный с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Состав: 30 % шерсть, 70 % нитрон.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"КОЛОСОК\", СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ СЕРЫЙ ТРИКОТАЖНЫЙ С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '187', 'zhilet-s02mvst', '', '0', NULL, NULL, NULL),
(188, '2018-06-29 20:28:44', 2, '2014-08-03 17:07:13', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С05-ДСТ, старшая школа', 724, '', 'text', 725, '<b>Жилет</b><br>Жилет трикотажный&nbsp;с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: серый. Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка с клиньями</b><br>Юбка с клиньями на кокетке. Объем пояса регулируется специальной резинкой.<br>Материал: «шотландка».<br>Цвет: сине-серый с бордовыми полосами. Состав: шерсть и вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С05-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СЕРЫЙ. СОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА С КЛИНЬЯМИ\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nЦВЕТ: СИНЕ-СЕРЫЙ С БОРДОВЫМИ ПОЛОСАМИ. СОСТАВ: ШЕРСТЬ И ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '188', 'komplekt-s05dst', '', '0', NULL, NULL, NULL),
(189, '2018-07-15 16:59:35', 2, '2014-08-03 17:13:36', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С07-ДС, средняя школа', 727, '', 'text', 728, '<b>Жилет</b><br>\r\n Жилет&nbsp;трикотажный с круглой горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия&nbsp;расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: серый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки</b><br>\r\n Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: черный.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С07-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ&NBSP;ТРИКОТАЖНЫЙ С КРУГЛОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ&NBSP;РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: СЕРЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ\r\nСПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ \r\nПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА \r\nНА ПОДКЛАДКЕ.\r\nЦВЕТ: ЧЕРНЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '189', 'komplekt-s07ds', '', '0', NULL, NULL, NULL),
(190, '2018-07-15 17:21:08', 2, '2014-08-03 17:16:52', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Меридиан\", средняя школа', 730, '', 'text', 731, 'Жилет синий трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <span style=\"color: #ff0000;\"><b>На данный момент на складе имеются данные жилеты для средней школы&nbsp;размеров 38-2&nbsp;и 40-2&nbsp;и продаются в розницу.</b></span><br>\r\n <span style=\"color: #ff0000;\"><b>Остальные размеры доступны только при заказе от 20 шт.</b></span><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"МЕРИДИАН\", СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ СИНИЙ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ НА СКЛАДЕ ИМЕЮТСЯ ДАННЫЕ ЖИЛЕТЫ ДЛЯ СРЕДНЕЙ ШКОЛЫ&NBSP;РАЗМЕРОВ \r\n38-2&NBSP;И 40-2&NBSP;И ПРОДАЮТСЯ В РОЗНИЦУ.\r\nОСТАЛЬНЫЕ РАЗМЕРЫ ДОСТУПНЫ ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '190', 'zhilet-s03mvs', '', '0', NULL, NULL, NULL),
(191, '2017-06-01 22:47:15', 2, '2014-08-03 21:24:51', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Меридиан\", старшая школа', 734, '', 'text', 735, 'Жилет синий трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Состав: 30 % шерсть, 70 % нитрон.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"МЕРИДИАН\", СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ СИНИЙ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '191', 'zhilet-s03mvst', '', '0', NULL, NULL, NULL),
(192, '2018-06-29 20:28:30', 2, '2014-08-03 21:36:57', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С09-ДСТ, старшая школа', 738, '', 'text', 739, '<b>Жилет</b><br>Жилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: темно-синий.<br>Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>Материал: костюмное полотно – «шотландка».&nbsp;Состав: шерсть и вискоза.<br><b><span style=\"color: #ee1d24;\">К сожалению, на данный момент заказ комплектов с использованием&nbsp;трикотажных жилетов не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С09-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: ТЕМНО-СИНИЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».&NBSP;СОСТАВ: ШЕРСТЬ И ВИСКОЗА.\r\nК СОЖАЛЕНИЮ, НА ДАННЫЙ МОМЕНТ ЗАКАЗ КОМПЛЕКТОВ С ИСПОЛЬЗОВАНИЕМ&NBSP;ТРИКОТАЖНЫХ \r\nЖИЛЕТОВ НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '192', 'komplekt-s09dst', '', '0', NULL, NULL, NULL),
(193, '2018-07-15 17:21:01', 2, '2014-08-03 21:43:16', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Ромео\", средняя школа', 741, '', 'text', 742, 'Жилет бордовый трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"РОМЕО\", СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ БОРДОВЫЙ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '193', 'zhilet-s04mvs', '', '0', NULL, NULL, NULL),
(194, '2017-06-01 22:47:15', 2, '2014-08-03 21:44:55', 2, 2, 16, 'Y', NULL, NULL, 500, 'Жилет трикотажный для мальчика \"Ромео\", старшая школа', 745, '', 'text', 746, 'Жилет бордовый трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Состав: 30 % шерсть, 70 % нитрон.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЖИЛЕТ ТРИКОТАЖНЫЙ ДЛЯ МАЛЬЧИКА \"РОМЕО\", СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ БОРДОВЫЙ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '194', 'zhilet-s04mvst', '', '0', NULL, NULL, NULL),
(195, '2018-06-29 20:28:13', 2, '2014-08-03 21:58:43', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С13-ДСТ, старшая школа', 749, '', 'text', 750, '<b>Жилет</b><br>Жилет трикотажный с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: бордовый.<br>Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>Материал: костюмное полотно – «шотландка». Состав: шерсть и вискоза.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С13-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА». СОСТАВ: ШЕРСТЬ И ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '195', 'komplekt-s13dst', '', '0', NULL, NULL, NULL),
(196, '2018-06-29 20:27:51', 2, '2014-08-03 22:03:05', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С14-ДСТ, старшая школа', 752, '', 'text', 753, '<b>Жилет</b><br>Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: бордовый. Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка в складку по передней части из «шотландки». Предусмотрена кокетка для хорошего облегания фигуры девочки. Объем пояса регулируется при помощи перфорированной резинки.<br>Цвет: в бордовых оттенках. Материал: костюмное полотно – «шотландка».<br>Состав: вискоза 20 % и полиэстер 80 %.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С14-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ. СОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА В СКЛАДКУ ПО ПЕРЕДНЕЙ ЧАСТИ ИЗ «ШОТЛАНДКИ». ПРЕДУСМОТРЕНА КОКЕТКА \r\nДЛЯ ХОРОШЕГО ОБЛЕГАНИЯ ФИГУРЫ ДЕВОЧКИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ \r\nПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nЦВЕТ: В БОРДОВЫХ ОТТЕНКАХ. МАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО – «ШОТЛАНДКА».\r\nСОСТАВ: ВИСКОЗА 20 % И ПОЛИЭСТЕР 80 %.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '196', 'komplekt-s14dst', '', '0', NULL, NULL, NULL),
(197, '2018-06-29 20:27:37', 2, '2014-08-03 22:07:20', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С15-ДСТ, старшая школа', 756, '', 'text', 757, '<b>Жилет</b><br>Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: бордовый.<br>Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка с клиньями на кокетке. Объем пояса регулируется специальной резинкой.<br>Материал: «шотландка».<br>Цвет: сине-серый с бордовыми полосами.<br>Состав: шерсть и вискоза.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С15-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА».\r\nЦВЕТ: СИНЕ-СЕРЫЙ С БОРДОВЫМИ ПОЛОСАМИ.\r\nСОСТАВ: ШЕРСТЬ И ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '197', 'komplekt-s15dst', '', '0', NULL, NULL, NULL),
(198, '2018-07-15 16:09:54', 2, '2014-08-04 00:00:49', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С16-ДСТ, старшая школа', 759, '', 'text', 760, '<b>Жилет</b><br>Жилет трикотажный&nbsp;с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>Цвет: бордовый.<br>Состав: 30 % шерсть, 70 % нитрон.<br><b>Юбка</b><br>Юбка с клиньями на кокетке. Клинья выполнены из ткани-компаньона, которая хорошо гармонирует с цветом жилета. Объем пояса регулируется специальной резинкой.<br>Цвет: в бордовых тонах.<br>Материал: «шотландка». Состав: вискоза и полиэстер.<br><b><span style=\"color: #ee1d24;\">На данный момент заказ данного&nbsp;комплекта&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С16-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ ТРИКОТАЖНЫЙ&NBSP;С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО \r\nПЕРЕПЛЕТЕНИЯ. ПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН \r\nПРИКЕТЛЕВАННОЙ БЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ \r\nНИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nЮБКА\r\nЮБКА С КЛИНЬЯМИ НА КОКЕТКЕ. КЛИНЬЯ ВЫПОЛНЕНЫ ИЗ ТКАНИ-КОМПАНЬОНА, КОТОРАЯ \r\nХОРОШО ГАРМОНИРУЕТ С ЦВЕТОМ ЖИЛЕТА. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ \r\nРЕЗИНКОЙ.\r\nЦВЕТ: В БОРДОВЫХ ТОНАХ.\r\nМАТЕРИАЛ: «ШОТЛАНДКА». СОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО&NBSP;КОМПЛЕКТА&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ \r\nПОКУПАТЕЛЕЙ. ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '198', 'komplekt-s16dst', '', '0', NULL, NULL, NULL),
(199, '2018-07-15 16:59:25', 2, '2014-08-04 00:08:05', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы С17-ДНС, средняя школа', 762, '', 'text', 763, '<b>Жилет</b><br>\r\n Жилет с V – образной горловиной, полотно комбинированного переплетения. По центральной части полочки вывязан рисунок. Ворот обработан прикетлеванной бейкой. По низу изделия расположена резинка с добавлением нити «спандекс».<br>\r\n Цвет: бордовый.<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n <b>Брюки \"Школьница\"</b><br>\r\n Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>\r\n Цвет: черный.<br>\r\n Материал: эластичное костюмное полотно. Состав: вискоза.<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного&nbsp;комплекта&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С17-ДНС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С V – ОБРАЗНОЙ ГОРЛОВИНОЙ, ПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ. \r\nПО ЦЕНТРАЛЬНОЙ ЧАСТИ ПОЛОЧКИ ВЫВЯЗАН РИСУНОК. ВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ \r\nБЕЙКОЙ. ПО НИЗУ ИЗДЕЛИЯ РАСПОЛОЖЕНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nЦВЕТ: БОРДОВЫЙ.\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nБРЮКИ \"ШКОЛЬНИЦА\"\r\nСПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ \r\nПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. ПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА \r\nНА ПОДКЛАДКЕ.\r\nЦВЕТ: ЧЕРНЫЙ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО&NBSP;КОМПЛЕКТА&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ \r\nПОКУПАТЕЛЕЙ. ТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '199', 'komplekt-s17dns', '', '0', NULL, NULL, NULL),
