(203, '2014-09-08 06:28:18', 2, '2014-08-13 07:34:43', 2, 6, NULL, 'Y', NULL, NULL, 500, 'Order 20.08.2014 12:19:25', NULL, 'Сарафан А11-Н, начальная школа(Размеры: 30) 1x1200 Р\nЖилет для девочки А03-ДВН, начальная школа(Размеры: 30) 1x800 Р\nЮбка на запахе А03-НН, начальная школа(Размеры: 30) 1x600 Р\n\nСпособ доставки: \nСамовывоз - бесплатно\n\nИтого, 1800 Р', 'text', NULL, NULL, 'text', 'ORDER 20.08.2014 12:19:25\r\nСАРАФАН А11-Н, НАЧАЛЬНАЯ ШКОЛА(РАЗМЕРЫ: 30) 1X1200 Р\nЖИЛЕТ ДЛЯ ДЕВОЧКИ А03-ДВН, НАЧАЛЬНАЯ ШКОЛА(РАЗМЕРЫ: 30) 1X800 Р\nЮБКА НА ЗАПАХЕ А03-НН, НАЧАЛЬНАЯ ШКОЛА(РАЗМЕРЫ: 30) 1X600 Р\n\nСПОСОБ ДОСТАВКИ: \nСАМОВЫВОЗ - БЕСПЛАТНО\n\nИТОГО, 1800 Р\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '203', NULL, NULL, NULL, NULL, NULL, NULL),
(204, '2014-09-17 00:40:29', 2, '2014-08-31 22:20:32', 2, 1, NULL, 'Y', '2014-08-31 02:32:00', NULL, 500, 'Поздравляем школьников и их родителей с Днем Знаний и началом нового учебного года!', 770, 'Наступила осень, а вместе с ним и день знаний. Школы открывают свои двери, чтобы принять ребят после летних каникул.<br>Наш коллектив салона \"Всегда в форме\" от всей души поздравляет школьников и их родителей с началом нового учебного года. Желаем побольше пятерок, всегда отличного настроения и надеемся, что в нашей форме образовательный процесс будет комфортным и радостным.<br>На сегодняшний день мы рады предложить...<br>', 'html', 771, 'Наступила осень, а вместе с ним и день знаний. Школы открывают свои двери, чтобы принять ребят после летних каникул.<br><br>Наш коллектив <a href=\"http://shkolno.ru/contacts/\">салона \"Всегда в форме\"</a> от всей души поздравляет школьников и их родителей с началом нового учебного года. Желаем побольше пятерок, всегда отличного настроения и надеемся, что в нашей форме образовательный процесс будет комфортным и радостным.<br>На сегодняшний день мы рады предложить <a href=\"http://shkolno.ru/catalog/pazly/\">синие и серые&nbsp;трикотажные&nbsp;жилеты</a> со склада в Красноярске по очень выгодным ценам. Кроме того, возможен заказ бордовых и голубых жилетов для школ в количестве от 20 шт.<br>Модели&nbsp;любых размеров (включая изготовление по индивидуальным меркам)&nbsp;из коллекций <a href=\"http://shkolno.ru/catalog/element/\">\"Элемент\"</a> и <a href=\"http://shkolno.ru/catalog/kletki/\">\"Клетки\"</a> доступны под заказ в розницу и для классов и школ.<br>В дополнение&nbsp;к школьным комплектам&nbsp;мы рады предложить водолазки, блузки и галстуки.<br><br>Надеемся, что наша школьная форма пришлась Вам по вкусу. Мы всегда рады видеть Вас снова!', 'html', 'ПОЗДРАВЛЯЕМ ШКОЛЬНИКОВ И ИХ РОДИТЕЛЕЙ С ДНЕМ ЗНАНИЙ И НАЧАЛОМ НОВОГО УЧЕБНОГО ГОДА!\r\nНАСТУПИЛА ОСЕНЬ, А ВМЕСТЕ С НИМ И ДЕНЬ ЗНАНИЙ. ШКОЛЫ ОТКРЫВАЮТ СВОИ ДВЕРИ, \r\nЧТОБЫ ПРИНЯТЬ РЕБЯТ ПОСЛЕ ЛЕТНИХ КАНИКУЛ.\r\nНАШ КОЛЛЕКТИВ САЛОНА \"ВСЕГДА В ФОРМЕ\" ОТ ВСЕЙ ДУШИ ПОЗДРАВЛЯЕТ ШКОЛЬНИКОВ \r\nИ ИХ РОДИТЕЛЕЙ С НАЧАЛОМ НОВОГО УЧЕБНОГО ГОДА. ЖЕЛАЕМ ПОБОЛЬШЕ ПЯТЕРОК, \r\nВСЕГДА ОТЛИЧНОГО НАСТРОЕНИЯ И НАДЕЕМСЯ, ЧТО В НАШЕЙ ФОРМЕ ОБРАЗОВАТЕЛЬНЫЙ \r\nПРОЦЕСС БУДЕТ КОМФОРТНЫМ И РАДОСТНЫМ.\r\nНА СЕГОДНЯШНИЙ ДЕНЬ МЫ РАДЫ ПРЕДЛОЖИТЬ...\r\nНАСТУПИЛА ОСЕНЬ, А ВМЕСТЕ С НИМ И ДЕНЬ ЗНАНИЙ. ШКОЛЫ ОТКРЫВАЮТ СВОИ ДВЕРИ, \r\nЧТОБЫ ПРИНЯТЬ РЕБЯТ ПОСЛЕ ЛЕТНИХ КАНИКУЛ.\r\n\r\nНАШ КОЛЛЕКТИВ САЛОНА \"ВСЕГДА В ФОРМЕ\" [ HTTP://SHKOLNO.RU/CONTACTS/ ] ОТ \r\nВСЕЙ ДУШИ ПОЗДРАВЛЯЕТ ШКОЛЬНИКОВ И ИХ РОДИТЕЛЕЙ С НАЧАЛОМ НОВОГО УЧЕБНОГО \r\nГОДА. ЖЕЛАЕМ ПОБОЛЬШЕ ПЯТЕРОК, ВСЕГДА ОТЛИЧНОГО НАСТРОЕНИЯ И НАДЕЕМСЯ, ЧТО \r\nВ НАШЕЙ ФОРМЕ ОБРАЗОВАТЕЛЬНЫЙ ПРОЦЕСС БУДЕТ КОМФОРТНЫМ И РАДОСТНЫМ.\r\nНА СЕГОДНЯШНИЙ ДЕНЬ МЫ РАДЫ ПРЕДЛОЖИТЬ СИНИЕ И СЕРЫЕ&NBSP;ТРИКОТАЖНЫЕ&NBSP;ЖИЛЕТЫ \r\n[ HTTP://SHKOLNO.RU/CATALOG/PAZLY/ ] СО СКЛАДА В КРАСНОЯРСКЕ ПО ОЧЕНЬ ВЫГОДНЫМ \r\nЦЕНАМ. КРОМЕ ТОГО, ВОЗМОЖЕН ЗАКАЗ БОРДОВЫХ И ГОЛУБЫХ ЖИЛЕТОВ ДЛЯ ШКОЛ В \r\nКОЛИЧЕСТВЕ ОТ 20 ШТ.\r\nМОДЕЛИ&NBSP;ЛЮБЫХ РАЗМЕРОВ (ВКЛЮЧАЯ ИЗГОТОВЛЕНИЕ ПО ИНДИВИДУАЛЬНЫМ МЕРКАМ)&NBSP;ИЗ \r\nКОЛЛЕКЦИЙ \"ЭЛЕМЕНТ\" [ HTTP://SHKOLNO.RU/CATALOG/ELEMENT/ ] И \"КЛЕТКИ\" [ HTTP://SHKOLNO.RU/CATALOG/KLETKI/ ] \r\nДОСТУПНЫ ПОД ЗАКАЗ В РОЗНИЦУ И ДЛЯ КЛАССОВ И ШКОЛ.\r\nВ ДОПОЛНЕНИЕ&NBSP;К ШКОЛЬНЫМ КОМПЛЕКТАМ&NBSP;МЫ РАДЫ ПРЕДЛОЖИТЬ ВОДОЛАЗКИ, \r\nБЛУЗКИ И ГАЛСТУКИ.\r\n\r\nНАДЕЕМСЯ, ЧТО НАША ШКОЛЬНАЯ ФОРМА ПРИШЛАСЬ ВАМ ПО ВКУСУ. МЫ ВСЕГДА РАДЫ \r\nВИДЕТЬ ВАС СНОВА!', 1, NULL, NULL, NULL, NULL, NULL, 'N', '204', '', '', '0', NULL, 692, '2014-08-31 22:25:02'),
