(218, '2015-01-10 20:35:38', 2, '2015-01-10 20:27:17', 2, 1, NULL, 'Y', '2014-12-31 00:27:00', NULL, 500, 'С Новым Годом и Рождеством!', 820, 'Наш коллектив поздравляет школьников и их родителей с новогодними праздниками! Пусть новый год принесет радость познания, побольше ярких моментов и свершения всего задуманного!<br/>\r\n-<br/>\r\nДля нас 2014 год оказался более чем продуктивным.<br/>\r\nВ декабре Администрация города Красноярска отметила наши старания и устремления в новых, социально-значимых направлениях деятельности, как изготовление школьной формы и униформы в рамках конкурса «Предприниматель года 2014».<br/>', 'html', 821, 'Наш коллектив поздравляет школьников и их родителей с новогодними праздниками! Пусть новый год принесет радость познания, побольше ярких моментов и свершения всего задуманного!<br>\r\n -----------------------------------------------------------------------------------------------------------<br>\r\n Для нас 2014 год оказался более чем продуктивным.<br>\r\n В декабре Администрация города Красноярска отметила наши старания и устремления в новых, социально-значимых направлениях деятельности, как изготовление школьной формы и униформы в рамках конкурса «Предприниматель года 2014».<br>\r\n Но мы не останавливаемся и продолжаем работу над созданием новых моделей. К новому учебному году мы пополним наши коллекции красивой школьной формой для сезона 2015-2016 из новых практичных тканей.<br>\r\n Также мы ведем работу по разработке моделей школьной формы для Последнего Звонка. Будет возможен заказ как типовых моделей, так и изготовление платьев и фартуков индивидуально по эскизам заказчиков.\r\n<p style=\"text-align: center;\">\r\n	<img src=\"/ferm/Благодарственное письмо 550 -2.jpg\" class=\"\">\r\n</p>', 'html', 'С НОВЫМ ГОДОМ И РОЖДЕСТВОМ!\r\nНАШ КОЛЛЕКТИВ ПОЗДРАВЛЯЕТ ШКОЛЬНИКОВ И ИХ РОДИТЕЛЕЙ С НОВОГОДНИМИ ПРАЗДНИКАМИ! \r\nПУСТЬ НОВЫЙ ГОД ПРИНЕСЕТ РАДОСТЬ ПОЗНАНИЯ, ПОБОЛЬШЕ ЯРКИХ МОМЕНТОВ И СВЕРШЕНИЯ \r\nВСЕГО ЗАДУМАННОГО!\r\n-\r\nДЛЯ НАС 2014 ГОД ОКАЗАЛСЯ БОЛЕЕ ЧЕМ ПРОДУКТИВНЫМ.\r\nВ ДЕКАБРЕ АДМИНИСТРАЦИЯ ГОРОДА КРАСНОЯРСКА ОТМЕТИЛА НАШИ СТАРАНИЯ И УСТРЕМЛЕНИЯ \r\nВ НОВЫХ, СОЦИАЛЬНО-ЗНАЧИМЫХ НАПРАВЛЕНИЯХ ДЕЯТЕЛЬНОСТИ, КАК ИЗГОТОВЛЕНИЕ \r\nШКОЛЬНОЙ ФОРМЫ И УНИФОРМЫ В РАМКАХ КОНКУРСА «ПРЕДПРИНИМАТЕЛЬ ГОДА 2014».\r\nНАШ КОЛЛЕКТИВ ПОЗДРАВЛЯЕТ ШКОЛЬНИКОВ И ИХ РОДИТЕЛЕЙ С НОВОГОДНИМИ ПРАЗДНИКАМИ! \r\nПУСТЬ НОВЫЙ ГОД ПРИНЕСЕТ РАДОСТЬ ПОЗНАНИЯ, ПОБОЛЬШЕ ЯРКИХ МОМЕНТОВ И СВЕРШЕНИЯ \r\nВСЕГО ЗАДУМАННОГО!\r\n-----------------------------------------------------------------------------------------------------------\r\nДЛЯ НАС 2014 ГОД ОКАЗАЛСЯ БОЛЕЕ ЧЕМ ПРОДУКТИВНЫМ.\r\nВ ДЕКАБРЕ АДМИНИСТРАЦИЯ ГОРОДА КРАСНОЯРСКА ОТМЕТИЛА НАШИ СТАРАНИЯ И УСТРЕМЛЕНИЯ \r\nВ НОВЫХ, СОЦИАЛЬНО-ЗНАЧИМЫХ НАПРАВЛЕНИЯХ ДЕЯТЕЛЬНОСТИ, КАК ИЗГОТОВЛЕНИЕ \r\nШКОЛЬНОЙ ФОРМЫ И УНИФОРМЫ В РАМКАХ КОНКУРСА «ПРЕДПРИНИМАТЕЛЬ ГОДА 2014».\r\nНО МЫ НЕ ОСТАНАВЛИВАЕМСЯ И ПРОДОЛЖАЕМ РАБОТУ НАД СОЗДАНИЕМ НОВЫХ МОДЕЛЕЙ. \r\nК НОВОМУ УЧЕБНОМУ ГОДУ МЫ ПОПОЛНИМ НАШИ КОЛЛЕКЦИИ КРАСИВОЙ ШКОЛЬНОЙ ФОРМОЙ \r\nДЛЯ СЕЗОНА 2015-2016 ИЗ НОВЫХ ПРАКТИЧНЫХ ТКАНЕЙ.\r\nТАКЖЕ МЫ ВЕДЕМ РАБОТУ ПО РАЗРАБОТКЕ МОДЕЛЕЙ ШКОЛЬНОЙ ФОРМЫ ДЛЯ ПОСЛЕДНЕГО \r\nЗВОНКА. БУДЕТ ВОЗМОЖЕН ЗАКАЗ КАК ТИПОВЫХ МОДЕЛЕЙ, ТАК И ИЗГОТОВЛЕНИЕ ПЛАТЬЕВ \r\nИ ФАРТУКОВ ИНДИВИДУАЛЬНО ПО ЭСКИЗАМ ЗАКАЗЧИКОВ. \r\n\r\n[ /FERM/БЛАГОДАРСТВЕННОЕ ПИСЬМО 550 -2.JPG ]', 1, NULL, NULL, NULL, NULL, NULL, 'N', '218', '', '', '0', NULL, 867, '2015-01-10 20:28:57'),
(219, '2017-06-01 23:19:13', 2, '2015-03-30 14:52:58', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан А14-СТ, старшая школа', 822, '', 'text', 823, 'Данный сарафан может быть выполнен в различных цветах: коричневый, темно-синий, серый, черный, бордовый.<br/>\r\nСарафан отрезной по линии талии. Горловина овальная. На юбке заложены складки. Верхняя часть сарафана шьется на подкладе  ( хлопок 100 %).<br/>\r\nДанное изделие рекомендуется носить с водолазкой, любой рубашкой или нарядной блузкой.<br/>\r\nМатериал: вискоза, полиэстер, эластан или хлопок на выбор.\r\n', 'html', 'САРАФАН А14-СТ, СТАРШАЯ ШКОЛА\r\n\r\nДАННЫЙ САРАФАН МОЖЕТ БЫТЬ ВЫПОЛНЕН В РАЗЛИЧНЫХ ЦВЕТАХ: КОРИЧНЕВЫЙ, ТЕМНО-СИНИЙ, \r\nСЕРЫЙ, ЧЕРНЫЙ, БОРДОВЫЙ.\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ ТАЛИИ. ГОРЛОВИНА ОВАЛЬНАЯ. НА ЮБКЕ ЗАЛОЖЕНЫ СКЛАДКИ. \r\nВЕРХНЯЯ ЧАСТЬ САРАФАНА ШЬЕТСЯ НА ПОДКЛАДЕ ( ХЛОПОК 100 %).\r\nДАННОЕ ИЗДЕЛИЕ РЕКОМЕНДУЕТСЯ НОСИТЬ С ВОДОЛАЗКОЙ, ЛЮБОЙ РУБАШКОЙ ИЛИ НАРЯДНОЙ \r\nБЛУЗКОЙ.\r\nМАТЕРИАЛ: ВИСКОЗА, ПОЛИЭСТЕР, ЭЛАСТАН ИЛИ ХЛОПОК НА ВЫБОР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '219', 'sarafan-a14st', '', '0', NULL, NULL, NULL),
(220, '2018-07-15 16:11:17', 2, '2015-03-30 14:55:27', 2, 2, 8, 'N', NULL, NULL, 500, 'Платье А15-СТ, старшая школа', 825, '', 'text', 826, 'Платье отрезное по линии талии с воротником.<br/>\r\nНа юбке заложены складки. Воротник и манжеты выполнены из клетчатой ткани.<br/>\r\nВерхняя часть изделия шьется на подкладе  (хлопок 100%).<br/>\r\nДанную модель возможно заказать в коричневом, темно-синем и сером цветах.', 'html', 'ПЛАТЬЕ А15-СТ, СТАРШАЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОТРЕЗНОЕ ПО ЛИНИИ ТАЛИИ С ВОРОТНИКОМ.\r\nНА ЮБКЕ ЗАЛОЖЕНЫ СКЛАДКИ. ВОРОТНИК И МАНЖЕТЫ ВЫПОЛНЕНЫ ИЗ КЛЕТЧАТОЙ ТКАНИ.\r\nВЕРХНЯЯ ЧАСТЬ ИЗДЕЛИЯ ШЬЕТСЯ НА ПОДКЛАДЕ (ХЛОПОК 100%).\r\nДАННУЮ МОДЕЛЬ ВОЗМОЖНО ЗАКАЗАТЬ В КОРИЧНЕВОМ, ТЕМНО-СИНЕМ И СЕРОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '220', 'plate-a15st', '', '0', NULL, NULL, NULL),
(221, '2017-06-01 23:19:13', 2, '2015-03-30 14:59:59', 2, 2, 8, 'N', NULL, NULL, 500, 'Платье А16-СТ, старшая школа', 827, '', 'text', 828, 'Платье отрезное по линии бедер.<br/>\r\nСилуэт прямой, приталивается при помощи декоративного пояса.<br/>\r\nЮбка выкроена по косой.<br/>\r\nМолния расположена на полочке.<br/>\r\nПлатье украшено кружевными воротником и манжетами.<br/>\r\nДанную модель можно заказать в темно-синем, коричневом, сером, бордовом цветах.\r\n', 'html', 'ПЛАТЬЕ А16-СТ, СТАРШАЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОТРЕЗНОЕ ПО ЛИНИИ БЕДЕР.\r\nСИЛУЭТ ПРЯМОЙ, ПРИТАЛИВАЕТСЯ ПРИ ПОМОЩИ ДЕКОРАТИВНОГО ПОЯСА.\r\nЮБКА ВЫКРОЕНА ПО КОСОЙ.\r\nМОЛНИЯ РАСПОЛОЖЕНА НА ПОЛОЧКЕ.\r\nПЛАТЬЕ УКРАШЕНО КРУЖЕВНЫМИ ВОРОТНИКОМ И МАНЖЕТАМИ.\r\nДАННУЮ МОДЕЛЬ МОЖНО ЗАКАЗАТЬ В ТЕМНО-СИНЕМ, КОРИЧНЕВОМ, СЕРОМ, БОРДОВОМ \r\nЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '221', 'plate-a16st', '', '0', NULL, NULL, NULL),
(222, '2018-07-15 17:12:19', 2, '2015-03-30 15:01:24', 2, 2, 8, 'Y', NULL, NULL, 500, 'Платье А17-СТ, старшая школа', 829, '', 'text', 830, 'Платье облегающего силуэта. Особую прелесть ему придают пышные рукава, присборенные по окату, заканчивающиеся манжетами.<br>\r\n Используется съемный воротник. Платье можно преобразить, надев модный праздничный фартук.<br>\r\n Материал: трикотаж<br>\r\n Состав: хлопок 95 %, эластан 5 %<br>\r\nДанную модель возможно заказать в темно-синем, черном, коричневом и сером цветах.', 'html', 'ПЛАТЬЕ А17-СТ, СТАРШАЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОБЛЕГАЮЩЕГО СИЛУЭТА. ОСОБУЮ ПРЕЛЕСТЬ ЕМУ ПРИДАЮТ ПЫШНЫЕ РУКАВА, \r\nПРИСБОРЕННЫЕ ПО ОКАТУ, ЗАКАНЧИВАЮЩИЕСЯ МАНЖЕТАМИ.\r\nИСПОЛЬЗУЕТСЯ СЪЕМНЫЙ ВОРОТНИК. ПЛАТЬЕ МОЖНО ПРЕОБРАЗИТЬ, НАДЕВ МОДНЫЙ ПРАЗДНИЧНЫЙ \r\nФАРТУК.\r\nМАТЕРИАЛ: ТРИКОТАЖ\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %\r\nДАННУЮ МОДЕЛЬ ВОЗМОЖНО ЗАКАЗАТЬ В ТЕМНО-СИНЕМ, ЧЕРНОМ, КОРИЧНЕВОМ И СЕРОМ \r\nЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '222', 'plate-a17st', '', '0', NULL, NULL, NULL),
(223, '2018-06-29 20:33:53', 2, '2015-03-30 15:08:22', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан А14-С, средняя школа', 831, '', 'text', 832, 'Данный сарафан может быть выполнен в различных цветах: коричневый, темно-синий, серый, черный, бордовый.<br/>\r\nСарафан отрезной по линии талии. Горловина овальная. На юбке заложены складки. Верхняя часть сарафана шьется на подкладе  ( хлопок 100 %).<br/>\r\nДанное изделие рекомендуется носить с водолазкой, любой рубашкой или нарядной блузкой.<br/>\r\nМатериал: вискоза, полиэстер, эластан или хлопок на выбор.', 'html', 'САРАФАН А14-С, СРЕДНЯЯ ШКОЛА\r\n\r\nДАННЫЙ САРАФАН МОЖЕТ БЫТЬ ВЫПОЛНЕН В РАЗЛИЧНЫХ ЦВЕТАХ: КОРИЧНЕВЫЙ, ТЕМНО-СИНИЙ, \r\nСЕРЫЙ, ЧЕРНЫЙ, БОРДОВЫЙ.\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ ТАЛИИ. ГОРЛОВИНА ОВАЛЬНАЯ. НА ЮБКЕ ЗАЛОЖЕНЫ СКЛАДКИ. \r\nВЕРХНЯЯ ЧАСТЬ САРАФАНА ШЬЕТСЯ НА ПОДКЛАДЕ ( ХЛОПОК 100 %).\r\nДАННОЕ ИЗДЕЛИЕ РЕКОМЕНДУЕТСЯ НОСИТЬ С ВОДОЛАЗКОЙ, ЛЮБОЙ РУБАШКОЙ ИЛИ НАРЯДНОЙ \r\nБЛУЗКОЙ.\r\nМАТЕРИАЛ: ВИСКОЗА, ПОЛИЭСТЕР, ЭЛАСТАН ИЛИ ХЛОПОК НА ВЫБОР.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '223', 'sarafan-a14s', '', '0', NULL, NULL, NULL),
(224, '2018-07-15 16:48:53', 2, '2015-03-30 15:12:56', 2, 2, 8, 'Y', NULL, NULL, 500, 'Платье А18-Н, начальная школа', 1557, '', 'text', 1558, 'Платье для учениц начальной школы.<br>\r\n Силуэт трапеция. Воротник и манжеты съемные.<br>\r\n Материал: трикотаж.<br>\r\nСостав: хлопок 95 %, эластан 5 %', 'html', 'ПЛАТЬЕ А18-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nПЛАТЬЕ ДЛЯ УЧЕНИЦ НАЧАЛЬНОЙ ШКОЛЫ.\r\nСИЛУЭТ ТРАПЕЦИЯ. ВОРОТНИК И МАНЖЕТЫ СЪЕМНЫЕ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '224', 'plate-a18n', '', '0', NULL, NULL, NULL),
(225, '2017-06-01 23:08:44', 2, '2015-03-30 15:18:11', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А19-ДС, средняя школа', 838, '', 'text', 839, 'Комплект состоит из жакета и юбки-восьмиклинки.<br>\r\n Жакет полуприлегающего силуэта, без подклада , застегивается на три пуговицы.<br>\r\n Юбка состоит из клиньев, придающих изделию современный вид.<br>\r\n Материал: трикотаж.<br>\r\nСостав: хлопок 95 %, эластан 5 %.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А19-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ЖАКЕТА И ЮБКИ-ВОСЬМИКЛИНКИ.\r\nЖАКЕТ ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, БЕЗ ПОДКЛАДА , ЗАСТЕГИВАЕТСЯ НА ТРИ ПУГОВИЦЫ.\r\nЮБКА СОСТОИТ ИЗ КЛИНЬЕВ, ПРИДАЮЩИХ ИЗДЕЛИЮ СОВРЕМЕННЫЙ ВИД.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '225', 'komplekt-shkolnoy-formy-a19ds', '', '0', NULL, NULL, NULL),
(226, '2018-06-29 20:33:42', 2, '2015-03-30 15:20:06', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан В20-Н, начальная школа', 840, '', 'text', 841, 'Сарафан отрезной по линии бедер, сшит из двух видов тканей: трикотаж и костюмная ткань.<br/>\r\nОбъем может регулироваться при помощи хлястика или пояса.<br/>\r\nМатериал: трикотаж (хлопок 95 %, эластан 5 %), костюмная ткань шотландка (вискоза 30 %, полиэстер 70 %).<br/>\r\n', 'html', 'САРАФАН В20-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ БЕДЕР, СШИТ ИЗ ДВУХ ВИДОВ ТКАНЕЙ: ТРИКОТАЖ И \r\nКОСТЮМНАЯ ТКАНЬ.\r\nОБЪЕМ МОЖЕТ РЕГУЛИРОВАТЬСЯ ПРИ ПОМОЩИ ХЛЯСТИКА ИЛИ ПОЯСА.\r\nМАТЕРИАЛ: ТРИКОТАЖ (ХЛОПОК 95 %, ЭЛАСТАН 5 %), КОСТЮМНАЯ ТКАНЬ ШОТЛАНДКА \r\n(ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %).', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '226', 'komplekt-shkolnoy-formy-b20n', '', '0', NULL, NULL, NULL),
(227, '2018-06-29 20:31:12', 2, '2015-03-30 15:26:52', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А21-ДСТ, старшая школа', 845, '', 'text', 846, 'Данный комплект состоит из жилета и юбки.<br/>\r\n\r\nИзделия сшиты из тканей российского производства – известной фабрики «Победа труда».<br/>\r\n\r\nПереплетение: «рогожка».<br/>\r\n\r\nСостав: шерсть 50 % и полиэстер 50 %.<br/>\r\n\r\nЮбка серого цвета, состоит из восьми клиньев, хорошо держит форму и очень понравилась нашим моделям.<br/>\r\n\r\nЖилет прилегающего силуэта с застежкой на три пуговицы.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А21-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nДАННЫЙ КОМПЛЕКТ СОСТОИТ ИЗ ЖИЛЕТА И ЮБКИ.\r\nИЗДЕЛИЯ СШИТЫ ИЗ ТКАНЕЙ РОССИЙСКОГО ПРОИЗВОДСТВА – ИЗВЕСТНОЙ ФАБРИКИ «ПОБЕДА \r\nТРУДА».\r\nПЕРЕПЛЕТЕНИЕ: «РОГОЖКА».\r\nСОСТАВ: ШЕРСТЬ 50 % И ПОЛИЭСТЕР 50 %.\r\nЮБКА СЕРОГО ЦВЕТА, СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ, ХОРОШО ДЕРЖИТ ФОРМУ И ОЧЕНЬ \r\nПОНРАВИЛАСЬ НАШИМ МОДЕЛЯМ.\r\nЖИЛЕТ ПРИЛЕГАЮЩЕГО СИЛУЭТА С ЗАСТЕЖКОЙ НА ТРИ ПУГОВИЦЫ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '227', 'komplekt-shkolnoy-formy-a21dst', '', '0', NULL, NULL, NULL),
(228, '2018-07-16 17:10:19', 2, '2015-03-30 15:28:43', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А21-ДС, средняя школа', 847, '', 'text', 848, 'Данный комплект состоит из жилета и юбки.<br>\r\n Изделия сшиты из тканей российского производства – известной фабрики «Победа труда».<br>\r\n Переплетение: «рогожка».<br>\r\n Состав: шерсть 50 % и полиэстер 50 %.<br>\r\n Юбка серого цвета, состоит из восьми клиньев, хорошо держит форму и очень понравилась нашим моделям.<br>\r\nЖилет прилегающего силуэта с застежкой на три пуговицы.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А21-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nДАННЫЙ КОМПЛЕКТ СОСТОИТ ИЗ ЖИЛЕТА И ЮБКИ.\r\nИЗДЕЛИЯ СШИТЫ ИЗ ТКАНЕЙ РОССИЙСКОГО ПРОИЗВОДСТВА – ИЗВЕСТНОЙ ФАБРИКИ «ПОБЕДА \r\nТРУДА».\r\nПЕРЕПЛЕТЕНИЕ: «РОГОЖКА».\r\nСОСТАВ: ШЕРСТЬ 50 % И ПОЛИЭСТЕР 50 %.\r\nЮБКА СЕРОГО ЦВЕТА, СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ, ХОРОШО ДЕРЖИТ ФОРМУ И ОЧЕНЬ \r\nПОНРАВИЛАСЬ НАШИМ МОДЕЛЯМ.\r\nЖИЛЕТ ПРИЛЕГАЮЩЕГО СИЛУЭТА С ЗАСТЕЖКОЙ НА ТРИ ПУГОВИЦЫ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '228', 'komplekt-shkolnoy-formy-a21ds', '', '0', NULL, NULL, NULL),
(229, '2018-06-29 20:30:58', 2, '2015-03-30 15:30:37', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А22-ДСТ, старшая школа', 993, '', 'text', 994, 'Данный комплект состоит из юбки черного цвета и жакета – серый меланж.<br>\r\n <b>Жакет</b><br>\r\n Жакет черного цвета из ткани «омекс». Застегивается на одну пуговицу.<br>\r\n Воротник стойка. Силуэт приталенный с интересными рельефами. Без подклада.<br>\r\n Материал: Смессовая ткань «омекс».<br>\r\n Состав: вискоза 30 %, полиэстер 70 %<br>\r\n <b>Юбка</b><br>\r\n Современная юбка состоит из восьми клиньев. Никаких молний.<br>\r\n Прекрасным образом хорошо подходит для любой фигуры.<br>\r\n Материал: трикотаж.<br>\r\n Состав: полиэстер 100 %<br>\r\n<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А22-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nДАННЫЙ КОМПЛЕКТ СОСТОИТ ИЗ ЮБКИ ЧЕРНОГО ЦВЕТА И ЖАКЕТА – СЕРЫЙ МЕЛАНЖ.\r\nЖАКЕТ\r\nЖАКЕТ ЧЕРНОГО ЦВЕТА ИЗ ТКАНИ «ОМЕКС». ЗАСТЕГИВАЕТСЯ НА ОДНУ ПУГОВИЦУ.\r\nВОРОТНИК СТОЙКА. СИЛУЭТ ПРИТАЛЕННЫЙ С ИНТЕРЕСНЫМИ РЕЛЬЕФАМИ. БЕЗ ПОДКЛАДА.\r\nМАТЕРИАЛ: СМЕССОВАЯ ТКАНЬ «ОМЕКС».\r\nСОСТАВ: ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %\r\nЮБКА\r\nСОВРЕМЕННАЯ ЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ. НИКАКИХ МОЛНИЙ.\r\nПРЕКРАСНЫМ ОБРАЗОМ ХОРОШО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %\r\n\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '229', 'komplekt-shkolnoy-formy-a22dst', '', '0', NULL, NULL, NULL),
