(231, '2017-06-01 23:08:44', 2, '2015-03-30 15:33:35', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А23-ДСТ, старшая школа', 853, '', 'text', 854, 'Данный комплект состоит из юбки черного цвета и жакета – серый меланж.<br>\r\n <b>Жакет</b><br>\r\n Жакет полуприлегающего силуэта, классический, без подклада. Прекрасно смотрится с водолазкой и нарядной блузкой.<br>\r\n Материал: трикотаж. Состав: хлопок 95 %, эластан 5 %.<br>\r\n <b>Юбка</b><br>\r\n Современная юбка состоит из восьми клиньев. Никаких молний.<br>\r\n Прекрасным образом хорошо подходит для любой фигуры.<br>\r\n Материал: трикотаж.<br>\r\n Состав: полиэстер 100 %<br>\r\n<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А23-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nДАННЫЙ КОМПЛЕКТ СОСТОИТ ИЗ ЮБКИ ЧЕРНОГО ЦВЕТА И ЖАКЕТА – СЕРЫЙ МЕЛАНЖ.\r\nЖАКЕТ\r\nЖАКЕТ ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, КЛАССИЧЕСКИЙ, БЕЗ ПОДКЛАДА. ПРЕКРАСНО СМОТРИТСЯ \r\nС ВОДОЛАЗКОЙ И НАРЯДНОЙ БЛУЗКОЙ.\r\nМАТЕРИАЛ: ТРИКОТАЖ. СОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.\r\nЮБКА\r\nСОВРЕМЕННАЯ ЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ. НИКАКИХ МОЛНИЙ.\r\nПРЕКРАСНЫМ ОБРАЗОМ ХОРОШО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %\r\n\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '231', 'komplekt-shkolnoy-formy-a23dst', '', '0', NULL, NULL, NULL),
(232, '2017-06-01 23:08:44', 2, '2015-03-30 15:34:47', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А23-ДС, средняя школа', 855, '', 'text', 856, 'Данный комплект состоит из юбки черного цвета и жакета – серый меланж.<br>\r\n <b>Жакет</b><br>\r\n Жакет полуприлегающего силуэта, классический, без подклада. Прекрасно смотрится с водолазкой и нарядной блузкой.<br>\r\n Материал: трикотаж. Состав: хлопок 95 %, эластан 5 %.<br>\r\n <b>Юбка</b><br>\r\n Современная юбка состоит из восьми клиньев. Никаких молний.<br>\r\n Прекрасным образом хорошо подходит для любой фигуры.<br>\r\n Материал: трикотаж.<br>\r\n Состав: полиэстер 100 %<br>\r\n<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А23-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nДАННЫЙ КОМПЛЕКТ СОСТОИТ ИЗ ЮБКИ ЧЕРНОГО ЦВЕТА И ЖАКЕТА – СЕРЫЙ МЕЛАНЖ.\r\nЖАКЕТ\r\nЖАКЕТ ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, КЛАССИЧЕСКИЙ, БЕЗ ПОДКЛАДА. ПРЕКРАСНО СМОТРИТСЯ \r\nС ВОДОЛАЗКОЙ И НАРЯДНОЙ БЛУЗКОЙ.\r\nМАТЕРИАЛ: ТРИКОТАЖ. СОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.\r\nЮБКА\r\nСОВРЕМЕННАЯ ЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ. НИКАКИХ МОЛНИЙ.\r\nПРЕКРАСНЫМ ОБРАЗОМ ХОРОШО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %\r\n\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '232', 'komplekt-shkolnoy-formy-a23ds', '', '0', NULL, NULL, NULL),
(233, '2018-06-29 20:30:40', 2, '2015-03-30 15:38:58', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С20-ДСТ, старшая школа', 857, '', 'text', 858, 'В комплект входит кардиган и юбка.<br>\r\n <b>Кардиган</b><br>\r\n Кардиган трикотажный с застежкой на пуговицы.<br>\r\n Полотно комбинированного переплетения.<br>\r\n Ворот обработан прикетлеванной бейкой, переходящей в планку.<br>\r\n По низу изделия вывязана резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n Данную модель можно заказать в бордовом, черном, темно-синем и сером цветах.<br>\r\n <b>Юбка</b><br>\r\n Юбка на кокетке, в складку.<br>\r\n Доступные цвета: черный, темно-синий.<br>\r\n<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С20-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nВ КОМПЛЕКТ ВХОДИТ КАРДИГАН И ЮБКА.\r\nКАРДИГАН\r\nКАРДИГАН ТРИКОТАЖНЫЙ С ЗАСТЕЖКОЙ НА ПУГОВИЦЫ.\r\nПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ.\r\nВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ, ПЕРЕХОДЯЩЕЙ В ПЛАНКУ.\r\nПО НИЗУ ИЗДЕЛИЯ ВЫВЯЗАНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nДАННУЮ МОДЕЛЬ МОЖНО ЗАКАЗАТЬ В БОРДОВОМ, ЧЕРНОМ, ТЕМНО-СИНЕМ И СЕРОМ ЦВЕТАХ.\r\nЮБКА\r\nЮБКА НА КОКЕТКЕ, В СКЛАДКУ.\r\nДОСТУПНЫЕ ЦВЕТА: ЧЕРНЫЙ, ТЕМНО-СИНИЙ.\r\n\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '233', 'komplekt-shkolnoy-formy-s20dst', '', '0', NULL, NULL, NULL),
(234, '2017-06-01 23:08:44', 2, '2015-03-30 15:41:06', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы С20-ДС, средняя школа', 859, '', 'text', 860, '', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ С20-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '234', 'komplekt-shkolnoy-formy-s20ds', '', '0', NULL, NULL, NULL),
(235, '2018-06-29 20:33:31', 2, '2015-03-30 18:25:52', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан А24-Н, начальная школа', 863, '', 'text', 864, 'Сарафан отрезной по линии бедер.<br/>\r\nЮбка двухслойная, украшена декоративной тесьмой и кружевами.<br/>\r\nСарафан на подкладе (хлопок 100 %).<br/>\r\nОбъем изделия регулируется.<br/>\r\nМатериал: костюмный, состав: полиэстер 100 %.<br/>\r\nПодклад – хлопок 100 %.\r\n', 'html', 'САРАФАН А24-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ БЕДЕР.\r\nЮБКА ДВУХСЛОЙНАЯ, УКРАШЕНА ДЕКОРАТИВНОЙ ТЕСЬМОЙ И КРУЖЕВАМИ.\r\nСАРАФАН НА ПОДКЛАДЕ (ХЛОПОК 100 %).\r\nОБЪЕМ ИЗДЕЛИЯ РЕГУЛИРУЕТСЯ.\r\nМАТЕРИАЛ: КОСТЮМНЫЙ, СОСТАВ: ПОЛИЭСТЕР 100 %.\r\nПОДКЛАД – ХЛОПОК 100 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '235', 'sarafan-a24n', '', '0', NULL, NULL, NULL),
(236, '2017-06-01 23:08:44', 2, '2015-03-30 18:29:38', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А25-ДН, начальная школа', 865, '', 'text', 866, 'Комплект состоит из жакета и юбки.<br>\r\n <b>Жакет</b><br>\r\n Жакет полуприлегающего силуэта, классический, без подклада.<br>\r\n Материал: трикотаж.<br>\r\n Состав: хлопок 95 %, эластан 5 %.<br>\r\n <b>Юбка</b><br>\r\n Юбка на запахе, застегивается на пуговицы. Подходит для девочки любого возраста.<br>\r\n Материал: трикотаж.<br>\r\n Состав: хлопок 95 %, эластан 5 %.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А25-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ЖАКЕТА И ЮБКИ.\r\nЖАКЕТ\r\nЖАКЕТ ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, КЛАССИЧЕСКИЙ, БЕЗ ПОДКЛАДА.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.\r\nЮБКА\r\nЮБКА НА ЗАПАХЕ, ЗАСТЕГИВАЕТСЯ НА ПУГОВИЦЫ. ПОДХОДИТ ДЛЯ ДЕВОЧКИ ЛЮБОГО \r\nВОЗРАСТА.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '236', 'komplekt-shkolnoy-formy-a25dn', '', '0', NULL, NULL, NULL),
(237, '2017-06-01 23:08:44', 2, '2015-03-30 18:30:41', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А25-ДС, средняя школа', 867, '', 'text', 868, 'Комплект состоит из жакета и юбки.<br>\r\n <b>Жакет</b><br>\r\n Жакет полуприлегающего силуэта, классический, без подклада.<br>\r\n Материал: трикотаж.<br>\r\n Состав: хлопок 95 %, эластан 5 %.<br>\r\n <b>Юбка</b><br>\r\n Юбка на запахе, застегивается на пуговицы. Подходит для девочки любого возраста.<br>\r\n Материал: трикотаж.<br>\r\n Состав: хлопок 95 %, эластан 5 %.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А25-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ЖАКЕТА И ЮБКИ.\r\nЖАКЕТ\r\nЖАКЕТ ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, КЛАССИЧЕСКИЙ, БЕЗ ПОДКЛАДА.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.\r\nЮБКА\r\nЮБКА НА ЗАПАХЕ, ЗАСТЕГИВАЕТСЯ НА ПУГОВИЦЫ. ПОДХОДИТ ДЛЯ ДЕВОЧКИ ЛЮБОГО \r\nВОЗРАСТА.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '237', 'komplekt-shkolnoy-formy-a25ds', '', '0', NULL, NULL, NULL),
(238, '2017-06-01 23:08:44', 2, '2015-03-30 18:33:50', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы А26-ДС, средняя школа', 869, '', 'text', 870, '', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А26-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '238', 'komplekt-shkolnoy-formy-a26ds', '', '0', NULL, NULL, NULL),
(239, '2018-06-29 20:33:19', 2, '2015-03-30 18:35:56', 2, 2, 8, 'N', NULL, NULL, 500, 'Сарафан В29-С, средняя школа', 1029, '', 'text', 1030, 'Сарафан отрезной по линии бедер.<br/>\r\nСшит из двух видов ткани: верх трикотаж, юбка- шотландка.<br/>\r\nОбъем регулируется при помощи хлястика.<br/>\r\nМатериал:<br/>\r\n-трикотаж. Состав: хлопок 95 %, эластан 5 %.<br/>\r\n-костюмная шотландка. Состав: вискоза 30 %, полиэстер 70 %.<br/>\r\n', 'html', 'САРАФАН В29-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН ОТРЕЗНОЙ ПО ЛИНИИ БЕДЕР.\r\nСШИТ ИЗ ДВУХ ВИДОВ ТКАНИ: ВЕРХ ТРИКОТАЖ, ЮБКА- ШОТЛАНДКА.\r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКА.\r\nМАТЕРИАЛ:\r\n-ТРИКОТАЖ. СОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %.\r\n-КОСТЮМНАЯ ШОТЛАНДКА. СОСТАВ: ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '239', 'sarafan-b29s', '', '0', NULL, NULL, NULL),
(240, '2018-07-15 16:11:17', 2, '2015-03-30 18:45:37', 2, 2, 8, 'N', NULL, NULL, 500, 'Платье А15-С, средняя школа', 873, '', 'text', 874, 'Платье отрезное по линии талии с воротником.<br/>\r\nНа юбке заложены складки. Воротник и манжеты выполнены из клетчатой ткани.<br/>\r\nВерхняя часть изделия шьется на подкладе  (хлопок 100%).<br/>\r\nДанную модель возможно заказать в коричневом, темно-синем и сером цветах.\r\n', 'html', 'ПЛАТЬЕ А15-С, СРЕДНЯЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОТРЕЗНОЕ ПО ЛИНИИ ТАЛИИ С ВОРОТНИКОМ.\r\nНА ЮБКЕ ЗАЛОЖЕНЫ СКЛАДКИ. ВОРОТНИК И МАНЖЕТЫ ВЫПОЛНЕНЫ ИЗ КЛЕТЧАТОЙ ТКАНИ.\r\nВЕРХНЯЯ ЧАСТЬ ИЗДЕЛИЯ ШЬЕТСЯ НА ПОДКЛАДЕ (ХЛОПОК 100%).\r\nДАННУЮ МОДЕЛЬ ВОЗМОЖНО ЗАКАЗАТЬ В КОРИЧНЕВОМ, ТЕМНО-СИНЕМ И СЕРОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '240', 'plate-a15s', '', '0', NULL, NULL, NULL),
(241, '2017-06-01 23:27:33', 2, '2015-03-30 18:57:40', 2, 2, 8, 'N', NULL, NULL, 500, 'Платье А17-С, средняя школа', 875, '', 'text', 876, 'Платье облегающего силуэта. Особую прелесть ему придают пышные рукава, присборенные по окату, заканчивающиеся манжетами.<br>\r\n Используется съемный воротник. Платье можно преобразить, надев модный праздничный фартук.<br>\r\n Материал: трикотаж<br>\r\n Состав: хлопок 95 %, эластан 5 %<br>\r\nДанную модель возможно заказать в темно-синем, черном, коричневом и сером цветах.', 'html', 'ПЛАТЬЕ А17-С, СРЕДНЯЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОБЛЕГАЮЩЕГО СИЛУЭТА. ОСОБУЮ ПРЕЛЕСТЬ ЕМУ ПРИДАЮТ ПЫШНЫЕ РУКАВА, \r\nПРИСБОРЕННЫЕ ПО ОКАТУ, ЗАКАНЧИВАЮЩИЕСЯ МАНЖЕТАМИ.\r\nИСПОЛЬЗУЕТСЯ СЪЕМНЫЙ ВОРОТНИК. ПЛАТЬЕ МОЖНО ПРЕОБРАЗИТЬ, НАДЕВ МОДНЫЙ ПРАЗДНИЧНЫЙ \r\nФАРТУК.\r\nМАТЕРИАЛ: ТРИКОТАЖ\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %\r\nДАННУЮ МОДЕЛЬ ВОЗМОЖНО ЗАКАЗАТЬ В ТЕМНО-СИНЕМ, ЧЕРНОМ, КОРИЧНЕВОМ И СЕРОМ \r\nЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '241', 'plate-a17s', '', '0', NULL, NULL, NULL),
(242, '2017-06-01 23:19:13', 2, '2015-03-30 19:03:00', 2, 2, 8, 'N', NULL, NULL, 500, 'Платье А16-С, средняя школа', 877, '', 'text', 878, 'Платье отрезное по линии бедер.<br/>\r\nСилуэт прямой, приталивается при помощи декоративного пояса.<br/>\r\nЮбка выкроена по косой.<br/>\r\nМолния расположена на полочке.<br/>\r\nПлатье украшено кружевными воротником и манжетами.<br/>\r\nДанную модель можно заказать в темно-синем, коричневом, сером, бордовом цветах.', 'html', 'ПЛАТЬЕ А16-С, СРЕДНЯЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОТРЕЗНОЕ ПО ЛИНИИ БЕДЕР.\r\nСИЛУЭТ ПРЯМОЙ, ПРИТАЛИВАЕТСЯ ПРИ ПОМОЩИ ДЕКОРАТИВНОГО ПОЯСА.\r\nЮБКА ВЫКРОЕНА ПО КОСОЙ.\r\nМОЛНИЯ РАСПОЛОЖЕНА НА ПОЛОЧКЕ.\r\nПЛАТЬЕ УКРАШЕНО КРУЖЕВНЫМИ ВОРОТНИКОМ И МАНЖЕТАМИ.\r\nДАННУЮ МОДЕЛЬ МОЖНО ЗАКАЗАТЬ В ТЕМНО-СИНЕМ, КОРИЧНЕВОМ, СЕРОМ, БОРДОВОМ \r\nЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '242', 'plate-a16s', '', '0', NULL, NULL, NULL),
(243, '2018-07-15 16:54:43', 2, '2015-03-31 18:57:29', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка А14-НН, начальная школа', 879, '', 'text', 880, 'Юбка состоит из восьми клиньев, без молний.<br>\r\n Отлично подходит для любой фигуры.<br>\r\n Материал: трикотаж.<br>\r\nСостав: полиэстер 100 %', 'html', 'ЮБКА А14-НН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ, БЕЗ МОЛНИЙ.\r\nОТЛИЧНО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '243', 'yubka-a14nn', '', '0', NULL, NULL, NULL),
(244, '2018-07-15 17:10:30', 2, '2015-03-31 18:58:48', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка А14-НС, средняя школа', 882, '', 'text', 883, 'Юбка состоит из восьми клиньев, без молний.<br>\r\n Отлично подходит для любой фигуры.<br>\r\n Материал: трикотаж.<br>\r\nСостав: полиэстер 100 %', 'html', 'ЮБКА А14-НС, СРЕДНЯЯ ШКОЛА\r\n\r\nЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ, БЕЗ МОЛНИЙ.\r\nОТЛИЧНО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '244', 'yubka-a14ns', '', '0', NULL, NULL, NULL),
(245, '2018-07-15 16:12:08', 2, '2015-03-31 19:01:13', 2, 2, 7, 'N', NULL, NULL, 500, 'Юбка А15-НСТ, старшая школа', 885, '', 'text', 886, 'Юбка серого цвета, выполнена из ткани российского производителя, состоит из восьми клиньев.<br/>\r\nМатериал: костюмный-«рогожка».<br/>\r\nСостав: шерсть 50 %, полиэстер 50 %.', 'html', 'ЮБКА А15-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА СЕРОГО ЦВЕТА, ВЫПОЛНЕНА ИЗ ТКАНИ РОССИЙСКОГО ПРОИЗВОДИТЕЛЯ, СОСТОИТ \r\nИЗ ВОСЬМИ КЛИНЬЕВ.\r\nМАТЕРИАЛ: КОСТЮМНЫЙ-«РОГОЖКА».\r\nСОСТАВ: ШЕРСТЬ 50 %, ПОЛИЭСТЕР 50 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '245', 'yubka-a15nst', '', '0', NULL, NULL, NULL),
(246, '2018-07-15 17:10:22', 2, '2015-03-31 19:02:40', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка А15-НС, средняя школа', 887, '', 'text', 888, 'Юбка серого цвета, выполнена из ткани российского производителя, состоит из восьми клиньев.<br>\r\n Материал: костюмный-«рогожка».<br>\r\nСостав: шерсть 50 %, полиэстер 50 %.', 'html', 'ЮБКА А15-НС, СРЕДНЯЯ ШКОЛА\r\n\r\nЮБКА СЕРОГО ЦВЕТА, ВЫПОЛНЕНА ИЗ ТКАНИ РОССИЙСКОГО ПРОИЗВОДИТЕЛЯ, СОСТОИТ \r\nИЗ ВОСЬМИ КЛИНЬЕВ.\r\nМАТЕРИАЛ: КОСТЮМНЫЙ-«РОГОЖКА».\r\nСОСТАВ: ШЕРСТЬ 50 %, ПОЛИЭСТЕР 50 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '246', 'yubka-a15ns', '', '0', NULL, NULL, NULL),
(247, '2017-06-01 23:08:44', 2, '2015-03-31 19:11:20', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы В27-ДС, средняя школа', 1031, '', 'text', 1032, 'Комплект состоит из юбки и жилета.<br>\r\n <b>Юбка</b><br>\r\n Юбка состоит из восьми клиньев.<br>\r\n Материал: трикотаж.<br>\r\n Состав полиэстер 100 %.<br>\r\n <b>Жилет</b><br>\r\n Жилет на подкладе, полуприлегающего силуэта, застегивается на три пуговицы, объем регулируется при помощи хлястиков.<br>\r\n Материал: костюмная шотландка.<br>\r\n Состав: вискоза 30 %, полиэстер 70 %.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В27-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ЮБКИ И ЖИЛЕТА.\r\nЮБКА\r\nЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ ПОЛИЭСТЕР 100 %.\r\nЖИЛЕТ\r\nЖИЛЕТ НА ПОДКЛАДЕ, ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, ЗАСТЕГИВАЕТСЯ НА ТРИ ПУГОВИЦЫ, \r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ.\r\nМАТЕРИАЛ: КОСТЮМНАЯ ШОТЛАНДКА.\r\nСОСТАВ: ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '247', 'komplekt-shkolnoy-formy-b27ds', '', '0', NULL, NULL, NULL),
(248, '2017-06-01 23:08:44', 2, '2015-03-31 19:12:44', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы В27-ДН, начальная школа', 1033, '', 'text', 1034, 'Комплект состоит из юбки и жилета.<br>\r\n <b>Юбка</b><br>\r\n Юбка состоит из восьми клиньев.<br>\r\n Материал: трикотаж.<br>\r\n Состав полиэстер 100 %.<br>\r\n <b>Жилет</b><br>\r\n Жилет на подкладе, полуприлегающего силуэта, застегивается на три пуговицы, объем регулируется при помощи хлястиков.<br>\r\n Материал: костюмная шотландка.<br>\r\n Состав: вискоза 30 %, полиэстер 70 %.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В27-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ЮБКИ И ЖИЛЕТА.\r\nЮБКА\r\nЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ ПОЛИЭСТЕР 100 %.\r\nЖИЛЕТ\r\nЖИЛЕТ НА ПОДКЛАДЕ, ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, ЗАСТЕГИВАЕТСЯ НА ТРИ ПУГОВИЦЫ, \r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ.\r\nМАТЕРИАЛ: КОСТЮМНАЯ ШОТЛАНДКА.\r\nСОСТАВ: ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '248', 'komplekt-shkolnoy-formy-b27dn', '', '0', NULL, NULL, NULL),
(249, '2018-06-29 20:30:23', 2, '2015-03-31 19:14:58', 2, 2, 11, 'N', NULL, NULL, 500, 'Школьная форма на последний звонок А28-ДСТ', 893, '', 'text', 894, 'Комплект состоит из платья и нарядного фартука.<br>\r\n <b>Платье</b><br>\r\n Платье отрезное по линии талии, юбка в складку, воротник и манжеты выполнены из отделочной ткани.<br>\r\n Материал: костюмный.<br>\r\n Состав: вискоза 30 %, полиэстер 70 %.<br>\r\n Цена: 1750 р.<br>\r\n <b>Фартук</b><br>\r\n Отшит из двух видов тканей: трикотаж и кружевное полотно.<br>\r\n Цена: 600 р.<br>\r\n Есть возможность заказать изделия по отдельности.<br>\r\nТакже салон \"Всегда в форме\" принимает заказы на индивидуальное изготовление платьев и фартуков к последнему звонку. Любые фасоны! Любые модели!', 'html', 'ШКОЛЬНАЯ ФОРМА НА ПОСЛЕДНИЙ ЗВОНОК А28-ДСТ\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ПЛАТЬЯ И НАРЯДНОГО ФАРТУКА.\r\nПЛАТЬЕ\r\nПЛАТЬЕ ОТРЕЗНОЕ ПО ЛИНИИ ТАЛИИ, ЮБКА В СКЛАДКУ, ВОРОТНИК И МАНЖЕТЫ ВЫПОЛНЕНЫ \r\nИЗ ОТДЕЛОЧНОЙ ТКАНИ.\r\nМАТЕРИАЛ: КОСТЮМНЫЙ.\r\nСОСТАВ: ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %.\r\nЦЕНА: 1750 Р.\r\nФАРТУК\r\nОТШИТ ИЗ ДВУХ ВИДОВ ТКАНЕЙ: ТРИКОТАЖ И КРУЖЕВНОЕ ПОЛОТНО.\r\nЦЕНА: 600 Р.\r\nЕСТЬ ВОЗМОЖНОСТЬ ЗАКАЗАТЬ ИЗДЕЛИЯ ПО ОТДЕЛЬНОСТИ.\r\nТАКЖЕ САЛОН \"ВСЕГДА В ФОРМЕ\" ПРИНИМАЕТ ЗАКАЗЫ НА ИНДИВИДУАЛЬНОЕ ИЗГОТОВЛЕНИЕ \r\nПЛАТЬЕВ И ФАРТУКОВ К ПОСЛЕДНЕМУ ЗВОНКУ. ЛЮБЫЕ ФАСОНЫ! ЛЮБЫЕ МОДЕЛИ!', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '249', 'shkolnaya-forma-na-posledniy-zvonok-a28-dst', '', '0', NULL, NULL, NULL),
(250, '2018-06-29 20:39:25', 2, '2015-04-01 01:03:24', 2, 2, 7, 'N', NULL, NULL, 500, 'Юбка А14-НСТ, старшая школа', 938, '', 'text', 939, 'Юбка состоит из восьми клиньев, без молний.<br/>\r\nОтлично подходит для любой фигуры.<br/>\r\nМатериал: трикотаж.<br/>\r\nСостав: полиэстер 100 %', 'html', 'ЮБКА А14-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ, БЕЗ МОЛНИЙ.\r\nОТЛИЧНО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '250', 'yubka-a14nst', '', '0', NULL, NULL, NULL),
(251, '2017-06-01 23:08:44', 2, '2015-04-01 01:14:43', 2, 2, 11, 'N', NULL, NULL, 500, 'Комплект школьной формы В27-ДСТ, старшая школа', 1035, '', 'text', 1036, 'Комплект состоит из юбки и жилета.<br>\r\n <b>Юбка</b><br>\r\n Юбка состоит из восьми клиньев.<br>\r\n Материал: трикотаж.<br>\r\n Состав полиэстер 100 %.<br>\r\n <b>Жилет</b><br>\r\n Жилет на подкладе, полуприлегающего силуэта, застегивается на три пуговицы, объем регулируется при помощи хлястиков.<br>\r\n Материал: костюмная шотландка.<br>\r\n Состав: вискоза 30 %, полиэстер 70 %.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В27-ДСТ, СТАРШАЯ ШКОЛА\r\n\r\nКОМПЛЕКТ СОСТОИТ ИЗ ЮБКИ И ЖИЛЕТА.\r\nЮБКА\r\nЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ ПОЛИЭСТЕР 100 %.\r\nЖИЛЕТ\r\nЖИЛЕТ НА ПОДКЛАДЕ, ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА, ЗАСТЕГИВАЕТСЯ НА ТРИ ПУГОВИЦЫ, \r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ.\r\nМАТЕРИАЛ: КОСТЮМНАЯ ШОТЛАНДКА.\r\nСОСТАВ: ВИСКОЗА 30 %, ПОЛИЭСТЕР 70 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '251', 'komplekt-shkolnoy-formy-b27dst', '', '0', NULL, NULL, NULL),
(252, '2016-04-23 17:25:57', 2, '2015-04-01 15:16:04', 2, 1, NULL, 'Y', '2016-03-31 19:16:00', NULL, 500, 'Новые модели на учебный год 2016-2017!', 952, 'Представляем Вашему вниманию новые модели школьной формы на учебный год 2016-2017.<br/>\r\nВ этом году нами существенно расширен модельный ряд для девочек. В нашем интернет-каталоге Вы сможете найти платья и сарафаны различных фасонов – от облегающих и строгих до более праздничных с декором и кружевами.<br/>\r\nСущественно пополнилась линейка для средней и старшей школы и расширена цветовая гамма предлагаемой формы. Теперь у нас больше моделей в сером, черном и коричневом цветах.', 'html', 953, 'Представляем Вашему вниманию новые модели школьной формы на учебный год 2016-2017.<br/>\r\nВ этом году нами существенно расширен модельный ряд для девочек. В нашем интернет-каталоге Вы сможете найти платья и сарафаны различных фасонов – от облегающих и строгих до более праздничных с декором и кружевами.<br/>\r\nСущественно пополнилась линейка для средней и старшей школы и расширена цветовая гамма предлагаемой формы. Теперь у нас больше моделей в сером, черном и коричневом цветах.<br/>\r\nВ этом году есть возможность заказать понравившиеся модели из различных по составу тканей от российских или зарубежных производителей.<br/>\r\nДополнительно к нашим моделям школьной формы Вы можете приобрести водолазки, блузки и галстуки.<br/>\r\nМы будем рады приехать в Вашу школу и продемонстрировать образцы, материалы и каталоги.\r\n', 'html', 'НОВЫЕ МОДЕЛИ НА УЧЕБНЫЙ ГОД 2016-2017!\r\nПРЕДСТАВЛЯЕМ ВАШЕМУ ВНИМАНИЮ НОВЫЕ МОДЕЛИ ШКОЛЬНОЙ ФОРМЫ НА УЧЕБНЫЙ ГОД \r\n2016-2017.\r\nВ ЭТОМ ГОДУ НАМИ СУЩЕСТВЕННО РАСШИРЕН МОДЕЛЬНЫЙ РЯД ДЛЯ ДЕВОЧЕК. В НАШЕМ \r\nИНТЕРНЕТ-КАТАЛОГЕ ВЫ СМОЖЕТЕ НАЙТИ ПЛАТЬЯ И САРАФАНЫ РАЗЛИЧНЫХ ФАСОНОВ – \r\nОТ ОБЛЕГАЮЩИХ И СТРОГИХ ДО БОЛЕЕ ПРАЗДНИЧНЫХ С ДЕКОРОМ И КРУЖЕВАМИ.\r\nСУЩЕСТВЕННО ПОПОЛНИЛАСЬ ЛИНЕЙКА ДЛЯ СРЕДНЕЙ И СТАРШЕЙ ШКОЛЫ И РАСШИРЕНА \r\nЦВЕТОВАЯ ГАММА ПРЕДЛАГАЕМОЙ ФОРМЫ. ТЕПЕРЬ У НАС БОЛЬШЕ МОДЕЛЕЙ В СЕРОМ, \r\nЧЕРНОМ И КОРИЧНЕВОМ ЦВЕТАХ.\r\nПРЕДСТАВЛЯЕМ ВАШЕМУ ВНИМАНИЮ НОВЫЕ МОДЕЛИ ШКОЛЬНОЙ ФОРМЫ НА УЧЕБНЫЙ ГОД \r\n2016-2017.\r\nВ ЭТОМ ГОДУ НАМИ СУЩЕСТВЕННО РАСШИРЕН МОДЕЛЬНЫЙ РЯД ДЛЯ ДЕВОЧЕК. В НАШЕМ \r\nИНТЕРНЕТ-КАТАЛОГЕ ВЫ СМОЖЕТЕ НАЙТИ ПЛАТЬЯ И САРАФАНЫ РАЗЛИЧНЫХ ФАСОНОВ – \r\nОТ ОБЛЕГАЮЩИХ И СТРОГИХ ДО БОЛЕЕ ПРАЗДНИЧНЫХ С ДЕКОРОМ И КРУЖЕВАМИ.\r\nСУЩЕСТВЕННО ПОПОЛНИЛАСЬ ЛИНЕЙКА ДЛЯ СРЕДНЕЙ И СТАРШЕЙ ШКОЛЫ И РАСШИРЕНА \r\nЦВЕТОВАЯ ГАММА ПРЕДЛАГАЕМОЙ ФОРМЫ. ТЕПЕРЬ У НАС БОЛЬШЕ МОДЕЛЕЙ В СЕРОМ, \r\nЧЕРНОМ И КОРИЧНЕВОМ ЦВЕТАХ.\r\nВ ЭТОМ ГОДУ ЕСТЬ ВОЗМОЖНОСТЬ ЗАКАЗАТЬ ПОНРАВИВШИЕСЯ МОДЕЛИ ИЗ РАЗЛИЧНЫХ \r\nПО СОСТАВУ ТКАНЕЙ ОТ РОССИЙСКИХ ИЛИ ЗАРУБЕЖНЫХ ПРОИЗВОДИТЕЛЕЙ.\r\nДОПОЛНИТЕЛЬНО К НАШИМ МОДЕЛЯМ ШКОЛЬНОЙ ФОРМЫ ВЫ МОЖЕТЕ ПРИОБРЕСТИ ВОДОЛАЗКИ, \r\nБЛУЗКИ И ГАЛСТУКИ.\r\nМЫ БУДЕМ РАДЫ ПРИЕХАТЬ В ВАШУ ШКОЛУ И ПРОДЕМОНСТРИРОВАТЬ ОБРАЗЦЫ, МАТЕРИАЛЫ \r\nИ КАТАЛОГИ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '252', '', '', '0', NULL, 1994, '2015-04-01 15:19:08'),
(253, '2017-06-01 23:39:02', 2, '2015-04-01 19:06:30', 2, 2, 7, 'N', NULL, NULL, 500, 'Юбка школьная B08-НСТ, старшая школа', 1042, '', 'text', 1043, '', 'text', 'ЮБКА ШКОЛЬНАЯ B08-НСТ, СТАРШАЯ ШКОЛА\r\n\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '253', 'yubka-shkolnaya-b08-nst-starshaya-shkola', '', '0', NULL, NULL, NULL),
