(255, '2017-06-01 23:42:29', 2, '2015-04-01 19:11:08', 2, 2, 7, 'N', NULL, NULL, 500, 'Юбка школьная А16-НСТ, старшая школа', 960, '', 'text', 961, 'Юбка на кокетке, в складку.<br>\r\n Доступные цвета: черный, темно-синий. <br>\r\n<br>\r\n <b><span style=\"color: #ee1d24;\">На данный момент заказ данной модели&nbsp;не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'ЮБКА ШКОЛЬНАЯ А16-НСТ, СТАРШАЯ ШКОЛА\r\n\r\nЮБКА НА КОКЕТКЕ, В СКЛАДКУ.\r\nДОСТУПНЫЕ ЦВЕТА: ЧЕРНЫЙ, ТЕМНО-СИНИЙ. \r\n\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОЙ МОДЕЛИ&NBSP;НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '255', 'yubka-shkolnaya-a16nst', '', '0', NULL, NULL, NULL),
