(276, '2018-06-29 20:34:38', 2, '2015-04-11 23:34:44', 2, 2, 12, 'N', NULL, NULL, 2, 'Кардиган трикотажный С01-ДВСТ, старшая школа', 1095, '', 'text', 1096, 'Кардиган трикотажный с застежкой на пуговицы.<br>\r\n Полотно комбинированного переплетения.<br>\r\n Ворот обработан прикетлеванной бейкой, переходящей в планку.<br>\r\n По низу изделия вывязана резинка с добавлением нити «спандекс».<br>\r\n Состав: 30 % шерсть, 70 % нитрон.<br>\r\n Данную модель можно заказать в бордовом, черном, темно-синем и сером цветах.<br>\r\n<br>\r\n<b><span style=\"color: #ee1d24;\">На данный момент заказ данного комплекта не доступен для розничных покупателей. Только при заказе от 20 шт.</span></b><br>', 'html', 'КАРДИГАН ТРИКОТАЖНЫЙ С01-ДВСТ, СТАРШАЯ ШКОЛА\r\n\r\nКАРДИГАН ТРИКОТАЖНЫЙ С ЗАСТЕЖКОЙ НА ПУГОВИЦЫ.\r\nПОЛОТНО КОМБИНИРОВАННОГО ПЕРЕПЛЕТЕНИЯ.\r\nВОРОТ ОБРАБОТАН ПРИКЕТЛЕВАННОЙ БЕЙКОЙ, ПЕРЕХОДЯЩЕЙ В ПЛАНКУ.\r\nПО НИЗУ ИЗДЕЛИЯ ВЫВЯЗАНА РЕЗИНКА С ДОБАВЛЕНИЕМ НИТИ «СПАНДЕКС».\r\nСОСТАВ: 30 % ШЕРСТЬ, 70 % НИТРОН.\r\nДАННУЮ МОДЕЛЬ МОЖНО ЗАКАЗАТЬ В БОРДОВОМ, ЧЕРНОМ, ТЕМНО-СИНЕМ И СЕРОМ ЦВЕТАХ.\r\n\r\nНА ДАННЫЙ МОМЕНТ ЗАКАЗ ДАННОГО КОМПЛЕКТА НЕ ДОСТУПЕН ДЛЯ РОЗНИЧНЫХ ПОКУПАТЕЛЕЙ. \r\nТОЛЬКО ПРИ ЗАКАЗЕ ОТ 20 ШТ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '276', 'kardigan-trikotazhnyy-s01-dvst-starshaya-shkola', '', '0', NULL, NULL, NULL),
(277, '2018-07-15 17:09:41', 2, '2015-04-11 23:56:16', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка школьная А17-НС, средняя школа', 1097, '', 'text', 1098, 'Современная юбка состоит из восьми клиньев. Никаких молний.<br>\r\n Прекрасным образом хорошо подходит для любой фигуры.<br>\r\n Материал: трикотаж.<br>\r\nСостав: полиэстер 100 %', 'html', 'ЮБКА ШКОЛЬНАЯ А17-НС, СРЕДНЯЯ ШКОЛА\r\n\r\nСОВРЕМЕННАЯ ЮБКА СОСТОИТ ИЗ ВОСЬМИ КЛИНЬЕВ. НИКАКИХ МОЛНИЙ.\r\nПРЕКРАСНЫМ ОБРАЗОМ ХОРОШО ПОДХОДИТ ДЛЯ ЛЮБОЙ ФИГУРЫ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ПОЛИЭСТЕР 100 %', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '277', 'yubka-shkolnaya-a17-ns-srednyaya-shkola', '', '0', NULL, NULL, NULL),
