(300, '2017-06-01 23:33:33', 2, '2015-04-13 22:49:35', 2, 2, 12, 'N', NULL, NULL, 500, 'Жилет для девочки А07-ДВН, начальная школа', 1169, '', 'text', 1170, 'Жилет прилегающего силуэта с застежкой на три пуговицы.<br/>\r\nИзделия сшиты из тканей российского производства – известной фабрики «Победа труда».<br/>\r\nПереплетение: «рогожка».<br/>\r\nСостав: шерсть 50 % и полиэстер 50 %.', 'html', 'ЖИЛЕТ ДЛЯ ДЕВОЧКИ А07-ДВН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ ПРИЛЕГАЮЩЕГО СИЛУЭТА С ЗАСТЕЖКОЙ НА ТРИ ПУГОВИЦЫ.\r\nИЗДЕЛИЯ СШИТЫ ИЗ ТКАНЕЙ РОССИЙСКОГО ПРОИЗВОДСТВА – ИЗВЕСТНОЙ ФАБРИКИ «ПОБЕДА \r\nТРУДА».\r\nПЕРЕПЛЕТЕНИЕ: «РОГОЖКА».\r\nСОСТАВ: ШЕРСТЬ 50 % И ПОЛИЭСТЕР 50 %.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '300', 'zhilet-dlya-devochki-a07-dvn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
