(331, '2018-06-29 20:29:51', 2, '2016-06-22 14:34:33', 2, 2, 11, 'N', NULL, NULL, 1, 'Комплект школьной формы А30-ДН, начальная школа', 1175, '', 'text', 1176, '<b>Костюм для девочки:</b><br>\r\n <br>\r\n Жилет - с овальной горловиной и застежкой на 4 пуговицы, на подкладе. Силуэт полуприлегающий. Объем регулируется при помощи хлястиков, вшититых в боковы швы изделия.<br>\r\n Цвет темно-синий двух оттенков<br>\r\n Материал: костюмное полотно.<br>\r\n Состав: вискоза и полиэстер.<br>\r\n Легко стирается, гладится без особых усилий, не закатывается (проверено)<br>\r\n За год не теряет внешнего вида при правильной стирке - 30 градусов<br>\r\n <br>\r\n Юбка с клиньями.&nbsp;Подходит для девочки с любой фигурой<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А30-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nКОСТЮМ ДЛЯ ДЕВОЧКИ:\r\n\r\nЖИЛЕТ - С ОВАЛЬНОЙ ГОРЛОВИНОЙ И ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДЕ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТИТЫХ В БОКОВЫ \r\nШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ ТЕМНО-СИНИЙ ДВУХ ОТТЕНКОВ\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.\r\nЛЕГКО СТИРАЕТСЯ, ГЛАДИТСЯ БЕЗ ОСОБЫХ УСИЛИЙ, НЕ ЗАКАТЫВАЕТСЯ (ПРОВЕРЕНО)\r\nЗА ГОД НЕ ТЕРЯЕТ ВНЕШНЕГО ВИДА ПРИ ПРАВИЛЬНОЙ СТИРКЕ - 30 ГРАДУСОВ\r\n\r\nЮБКА С КЛИНЬЯМИ.&NBSP;ПОДХОДИТ ДЛЯ ДЕВОЧКИ С ЛЮБОЙ ФИГУРОЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '331', 'komplekt-shkolnoy-formy-a30-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(332, '2018-06-29 20:29:38', 2, '2016-06-22 14:39:01', 2, 2, 11, 'N', NULL, NULL, 1, 'Комплект школьной формы А30-ДС, средняя школа', 1197, '', 'text', 1198, '<b>Костюм для девочки для средней школы:</b><br>\r\n <br>\r\n Жилет - с овальной горловиной и застежкой на 4 пуговицы, на подкладе. Силуэт полуприлегающий. Объем регулируется при помощи хлястиков, вшититых в боковые швы изделия.<br>\r\n Цвет темно-синий двух оттенков<br>\r\n Материал: костюмное полотно.<br>\r\n Состав: вискоза и полиэстер.<br>\r\n Легко стирается, гладится без особых усилий, не закатывается (проверено)<br>\r\n За год не теряет внешнего вида при правильной стирке - 30 градусов<br>\r\n <br>\r\n Юбка с клиньями.&nbsp;Подходит для девочки с любой фигурой<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А30-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nКОСТЮМ ДЛЯ ДЕВОЧКИ ДЛЯ СРЕДНЕЙ ШКОЛЫ:\r\n\r\nЖИЛЕТ - С ОВАЛЬНОЙ ГОРЛОВИНОЙ И ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДЕ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТИТЫХ В БОКОВЫЕ \r\nШВЫ ИЗДЕЛИЯ.\r\nЦВЕТ ТЕМНО-СИНИЙ ДВУХ ОТТЕНКОВ\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭСТЕР.\r\nЛЕГКО СТИРАЕТСЯ, ГЛАДИТСЯ БЕЗ ОСОБЫХ УСИЛИЙ, НЕ ЗАКАТЫВАЕТСЯ (ПРОВЕРЕНО)\r\nЗА ГОД НЕ ТЕРЯЕТ ВНЕШНЕГО ВИДА ПРИ ПРАВИЛЬНОЙ СТИРКЕ - 30 ГРАДУСОВ\r\n\r\nЮБКА С КЛИНЬЯМИ.&NBSP;ПОДХОДИТ ДЛЯ ДЕВОЧКИ С ЛЮБОЙ ФИГУРОЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '332', 'komplekt-shkolnoy-formy-a30-ds-srednyaya-shkola', '', '0', NULL, NULL, NULL),
