(340, '2018-07-15 16:48:13', 2, '2016-06-22 17:48:01', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А28-Н, начальная школа', 1210, '', 'text', 1211, '<b>Сарафан с крылышками</b><br>\r\n <br>\r\n Силуэт полуприлегающий<br>\r\n Объем сарафана регулируется хлястиками, вшитыми в рельефные швы.<br>\r\n Материал: вискоза и полиэстер<b><span style=\"font-family: &quot;Arial Black&quot;, Gadget; font-size: 14pt;\"><br>\r\n </span></b><br>', 'html', 'САРАФАН А28-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН С КРЫЛЫШКАМИ\r\n\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В РЕЛЬЕФНЫЕ ШВЫ.\r\nМАТЕРИАЛ: ВИСКОЗА И ПОЛИЭСТЕР', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '340', 'sarafan-a28-n-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(341, '2018-07-15 17:17:48', 2, '2016-07-06 10:41:56', 2, 2, 15, 'Y', NULL, NULL, 500, 'Брюки для мальчика А08-МНН, начальная школа', 1213, '', 'text', 1214, 'Брюки черные, силуэт «школьник». Спереди расположены карманы. Застежка на молнию.<br>\r\n Объем пояса регулируется при помощи специальной перфорированной резинки.<br>\r\n Легко стираются и легко гладятся.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\nСостав: вискоза и полиэфирное волокно.', 'html', 'БРЮКИ ДЛЯ МАЛЬЧИКА А08-МНН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nБРЮКИ ЧЕРНЫЕ, СИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА \r\nНА МОЛНИЮ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nЛЕГКО СТИРАЮТСЯ И ЛЕГКО ГЛАДЯТСЯ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭФИРНОЕ ВОЛОКНО.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '341', 'bryuki-dlya-malchika-a08-mnn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(342, '2018-08-12 16:33:52', 2, '2016-07-06 10:44:05', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы А08-МН, начальная школа', 1223, '', 'text', 1224, '<b>Жилет</b><br>\r\n Жилет с V-образной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Материал: костюмное полотно. Состав: вискоза.<br>\r\n <b>Брюки</b><br>\r\n Силуэт «школьник». Спереди расположены карманы. Застежка на молнию.<br>\r\n Объем пояса регулируется при помощи специальной перфорированной резинки.<br>\r\n <br>\r\n Материал: костюмное полотно. Состав: вискоза + полиэфир.<br>\r\n <br>\r\n Для этого комплекта рекомендуется рубашка в белом, светло-сером и темно-сером цветах. Дополнительно можно использовать галстук.<br>\r\n <br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А08-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. \r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА + ПОЛИЭФИР.\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА В БЕЛОМ, СВЕТЛО-СЕРОМ И ТЕМНО-СЕРОМ \r\nЦВЕТАХ. ДОПОЛНИТЕЛЬНО МОЖНО ИСПОЛЬЗОВАТЬ ГАЛСТУК.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '342', 'komplekt-shkolnoy-formy-a08-mn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
