(345, '2018-08-12 16:33:19', 2, '2016-08-02 16:10:09', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы А08-МС, средняя школа', 1230, '', 'text', 1231, '<b>Жилет</b><br>\r\n Жилет с V-образной горловиной с застежкой на 4 пуговицы, на подкладке. Полочка и спинка продублированы клеевым прокладочным материалом. Силуэт полуприлегающий.<br>\r\n Объем жилета регулируется при помощи хлястиков, вшитых в боковые швы изделия.<br>\r\n Материал: костюмное полотно. Состав: вискоза.<br>\r\n <b>Брюки</b><br>\r\n Силуэт «школьник». Спереди расположены карманы. Застежка на молнию.<br>\r\n Объем пояса регулируется при помощи специальной перфорированной резинки.<br>\r\n <br>\r\n Материал: костюмное полотно. Состав: вискоза + полиэфир.<br>\r\n <br>\r\n Для этого комплекта рекомендуется рубашка в белом, светло-сером и темно-сером цветах. Дополнительно можно использовать галстук.<br>\r\n <br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А08-МС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ\r\nЖИЛЕТ С V-ОБРАЗНОЙ ГОРЛОВИНОЙ С ЗАСТЕЖКОЙ НА 4 ПУГОВИЦЫ, НА ПОДКЛАДКЕ. \r\nПОЛОЧКА И СПИНКА ПРОДУБЛИРОВАНЫ КЛЕЕВЫМ ПРОКЛАДОЧНЫМ МАТЕРИАЛОМ. СИЛУЭТ \r\nПОЛУПРИЛЕГАЮЩИЙ.\r\nОБЪЕМ ЖИЛЕТА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В БОКОВЫЕ ШВЫ ИЗДЕЛИЯ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА.\r\nБРЮКИ\r\nСИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО. СОСТАВ: ВИСКОЗА + ПОЛИЭФИР.\r\n\r\nДЛЯ ЭТОГО КОМПЛЕКТА РЕКОМЕНДУЕТСЯ РУБАШКА В БЕЛОМ, СВЕТЛО-СЕРОМ И ТЕМНО-СЕРОМ \r\nЦВЕТАХ. ДОПОЛНИТЕЛЬНО МОЖНО ИСПОЛЬЗОВАТЬ ГАЛСТУК.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '345', 'komplekt-shkolnoy-formy-a08-ms-srednyaya-shkola', '', '0', NULL, NULL, NULL),
