(347, '2018-07-15 17:22:07', 2, '2016-08-02 20:01:24', 2, 2, 15, 'Y', NULL, NULL, 500, 'Брюки для мальчика А08-МНС, средняя школа', 1240, '', 'text', 1241, 'Брюки черные, силуэт «школьник». Спереди расположены карманы. Застежка на молнию.<br>\r\n Объем пояса регулируется при помощи специальной перфорированной резинки.<br>\r\n Легко стираются и легко гладятся.<br>\r\n Материал: эластичное костюмное полотно.<br>\r\nСостав: вискоза и полиэфирное волокно.', 'html', 'БРЮКИ ДЛЯ МАЛЬЧИКА А08-МНС, СРЕДНЯЯ ШКОЛА\r\n\r\nБРЮКИ ЧЕРНЫЕ, СИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА \r\nНА МОЛНИЮ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ.\r\nЛЕГКО СТИРАЮТСЯ И ЛЕГКО ГЛАДЯТСЯ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА И ПОЛИЭФИРНОЕ ВОЛОКНО.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '347', 'bryuki-dlya-malchika-a08-mns-srednyaya-shkola', '', '0', NULL, NULL, NULL),
(348, '2018-07-15 16:13:47', 2, '2017-06-01 22:58:27', 2, 2, 15, 'N', NULL, NULL, 500, 'Брюки для мальчика А07-МНСТ, старшая школа', 1243, '', 'text', 1244, 'Брюки коричневые, силуэт «школьник». Спереди расположены карманы. Застежка на молнию.<br>Объем пояса регулируется при помощи специальной перфорированной резинки. Передняя часть брюк выполнена на подкладке.<br>Материал: эластичное костюмное полотно.<br>Состав: вискоза.', 'html', 'БРЮКИ ДЛЯ МАЛЬЧИКА А07-МНСТ, СТАРШАЯ ШКОЛА\r\n\r\nБРЮКИ КОРИЧНЕВЫЕ, СИЛУЭТ «ШКОЛЬНИК». СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА \r\nНА МОЛНИЮ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ ПЕРФОРИРОВАННОЙ РЕЗИНКИ. \r\nПЕРЕДНЯЯ ЧАСТЬ БРЮК ВЫПОЛНЕНА НА ПОДКЛАДКЕ.\r\nМАТЕРИАЛ: ЭЛАСТИЧНОЕ КОСТЮМНОЕ ПОЛОТНО.\r\nСОСТАВ: ВИСКОЗА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '348', 'a07-mnst', '', '0', NULL, NULL, NULL),
(349, '2018-07-15 17:04:40', 2, '2017-06-01 23:17:29', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А28-С, средняя школа', 1246, '', 'text', 1247, '<b>Сарафан с крылышками</b><br>\r\n <br>\r\n Силуэт полуприлегающий<br>\r\n Объем сарафана регулируется хлястиками, вшитыми в рельефные швы.<br>\r\n Материал: вискоза и полиэстер<b><span style=\"font-family: &quot;Arial Black&quot;, Gadget; font-size: 14pt;\"><br>\r\n </span></b><br>', 'html', 'САРАФАН А28-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН С КРЫЛЫШКАМИ\r\n\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В РЕЛЬЕФНЫЕ ШВЫ.\r\nМАТЕРИАЛ: ВИСКОЗА И ПОЛИЭСТЕР', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '349', 'sarafan-a28s', '', '0', NULL, NULL, NULL),
(350, '2018-07-15 17:04:27', 2, '2017-06-01 23:22:32', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А27-С, средняя школа', 1249, '', 'text', 1250, '<b>Сарафан с бантом</b><br>\r\n <br>\r\n Талия завышена, юбка солнце<br>\r\n Пояс с бантом<br>\r\nМатериал шотландка  -  шерсть, вискоза, полиэфир', 'html', 'САРАФАН А27-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН С БАНТОМ\r\n\r\nТАЛИЯ ЗАВЫШЕНА, ЮБКА СОЛНЦЕ\r\nПОЯС С БАНТОМ\r\nМАТЕРИАЛ ШОТЛАНДКА - ШЕРСТЬ, ВИСКОЗА, ПОЛИЭФИР', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '350', 'sarafan-a27s', '', '0', NULL, NULL, NULL),
(351, '2018-07-15 17:04:17', 2, '2017-06-01 23:25:49', 2, 2, 8, 'Y', NULL, NULL, 500, 'Платье А18-С, средняя школа', 1643, '', 'text', 1644, 'Платье для учениц средней школы.\r\nСилуэт трапеция. Воротник и манжеты съемные.\r\nМатериал: трикотаж.\r\nСостав: хлопок 95 %, эластан 5 %', 'text', 'ПЛАТЬЕ А18-С, СРЕДНЯЯ ШКОЛА\r\n\r\nПЛАТЬЕ ДЛЯ УЧЕНИЦ СРЕДНЕЙ ШКОЛЫ.\r\nСИЛУЭТ ТРАПЕЦИЯ. ВОРОТНИК И МАНЖЕТЫ СЪЕМНЫЕ.\r\nМАТЕРИАЛ: ТРИКОТАЖ.\r\nСОСТАВ: ХЛОПОК 95 %, ЭЛАСТАН 5 %', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '351', 'plate-a18s', '', '0', NULL, NULL, NULL),
(352, '2018-07-15 16:47:58', 2, '2017-07-24 10:56:37', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А29-Н, начальная школа', 1493, '', 'text', 1494, '<b>Сарафан с красным или синим поясом</b><br>\r\n Отрезной по линии талии. Застежка на молнию сзади. На юбке заложены встречные складки, а также 2 кармана. Вырез горловины овальный. Слева на полочке расположено декоративное украшение.<br>\r\n <br>\r\n <b>Используемые материалы:</b><br>\r\n Костюмное полотно-полиэфир 100% - 1650 р.<br>\r\n Вискоза 85% и полиэстер 15% - 1850 р.<br>\r\n <br>\r\n <b>Возможные цвета:</b> серый, темно-синий, черный, бордовый, клетка.<br>', 'html', 'САРАФАН А29-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН С КРАСНЫМ ИЛИ СИНИМ ПОЯСОМ\r\nОТРЕЗНОЙ ПО ЛИНИИ ТАЛИИ. ЗАСТЕЖКА НА МОЛНИЮ СЗАДИ. НА ЮБКЕ ЗАЛОЖЕНЫ ВСТРЕЧНЫЕ \r\nСКЛАДКИ, А ТАКЖЕ 2 КАРМАНА. ВЫРЕЗ ГОРЛОВИНЫ ОВАЛЬНЫЙ. СЛЕВА НА ПОЛОЧКЕ РАСПОЛОЖЕНО \r\nДЕКОРАТИВНОЕ УКРАШЕНИЕ.\r\n\r\nИСПОЛЬЗУЕМЫЕ МАТЕРИАЛЫ:\r\nКОСТЮМНОЕ ПОЛОТНО-ПОЛИЭФИР 100% - 1650 Р.\r\nВИСКОЗА 85% И ПОЛИЭСТЕР 15% - 1850 Р.\r\n\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, ЧЕРНЫЙ, БОРДОВЫЙ, КЛЕТКА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '352', 'sarafan-a29n', '', '0', NULL, NULL, NULL),
(353, '2018-07-15 17:04:03', 2, '2017-07-24 10:59:25', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А29-С, средняя школа', 1260, '', 'text', 1261, '<b>Сарафан с красным или синим поясом</b><br>\r\n Отрезной по линии талии. Застежка на молнию сзади. На юбке заложены встречные складки, а также 2 кармана. Вырез горловины овальный. Слева на полочке расположено декоративное украшение.<br>\r\n <br>\r\n <b>Используемые материалы:</b><br>\r\n Костюмное полотно-полиэфир 100% - 1650 р.<br>\r\n Вискоза 85% и полиэстер 15% - 1900 р.<br>', 'html', 'САРАФАН А29-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН С КРАСНЫМ ИЛИ СИНИМ ПОЯСОМ\r\nОТРЕЗНОЙ ПО ЛИНИИ ТАЛИИ. ЗАСТЕЖКА НА МОЛНИЮ СЗАДИ. НА ЮБКЕ ЗАЛОЖЕНЫ ВСТРЕЧНЫЕ \r\nСКЛАДКИ, А ТАКЖЕ 2 КАРМАНА. ВЫРЕЗ ГОРЛОВИНЫ ОВАЛЬНЫЙ. СЛЕВА НА ПОЛОЧКЕ РАСПОЛОЖЕНО \r\nДЕКОРАТИВНОЕ УКРАШЕНИЕ.\r\n\r\nИСПОЛЬЗУЕМЫЕ МАТЕРИАЛЫ:\r\nКОСТЮМНОЕ ПОЛОТНО-ПОЛИЭФИР 100% - 1650 Р.\r\nВИСКОЗА 85% И ПОЛИЭСТЕР 15% - 1900 Р.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '353', 'sarafan-a29s', '', '0', NULL, NULL, NULL),
(354, '2018-07-15 16:47:37', 2, '2017-07-24 11:04:31', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А30-Н, начальная школа', 1507, '', 'text', 1508, '<b>Сарафан с юбкой-полусолнце</b><br>\r\n Отрезной по линии талии. Застежка на молнию возможна как спереди, так и сзади. Юбка полусолнце. Вырез овальный. Размер регулируется поясом.<br>\r\n <br>\r\n <b>Используемые материалы:</b><br>\r\n Полиэстер и полушерсть - 1800 р.<br>\r\n Вискоза и полушерсть - 2000 р.<br>\r\n <br>', 'html', 'САРАФАН А30-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН С ЮБКОЙ-ПОЛУСОЛНЦЕ\r\nОТРЕЗНОЙ ПО ЛИНИИ ТАЛИИ. ЗАСТЕЖКА НА МОЛНИЮ ВОЗМОЖНА КАК СПЕРЕДИ, ТАК И \r\nСЗАДИ. ЮБКА ПОЛУСОЛНЦЕ. ВЫРЕЗ ОВАЛЬНЫЙ. РАЗМЕР РЕГУЛИРУЕТСЯ ПОЯСОМ.\r\n\r\nИСПОЛЬЗУЕМЫЕ МАТЕРИАЛЫ:\r\nПОЛИЭСТЕР И ПОЛУШЕРСТЬ - 1800 Р.\r\nВИСКОЗА И ПОЛУШЕРСТЬ - 2000 Р.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '354', 'sarafan-a30n', '', '0', NULL, NULL, NULL),
(355, '2018-07-15 17:03:51', 2, '2017-07-24 11:06:04', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А30-С, средняя школа', 1517, '', 'text', 1518, '<b>Сарафан с юбкой-полусолнце</b><br>\r\n Отрезной по линии талии. Застежка на молнию возможна как спереди, так и сзади. Юбка полусолнце. Вырез овальный. Размер регулируется поясом.<br>\r\n <br>\r\n <b>Используемые материалы:</b><br>\r\n Полиэстер и полушерсть - 1800 р.<br>\r\n Вискоза и полушерсть - 2000 р.<br>\r\n <br>', 'html', 'САРАФАН А30-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН С ЮБКОЙ-ПОЛУСОЛНЦЕ\r\nОТРЕЗНОЙ ПО ЛИНИИ ТАЛИИ. ЗАСТЕЖКА НА МОЛНИЮ ВОЗМОЖНА КАК СПЕРЕДИ, ТАК И \r\nСЗАДИ. ЮБКА ПОЛУСОЛНЦЕ. ВЫРЕЗ ОВАЛЬНЫЙ. РАЗМЕР РЕГУЛИРУЕТСЯ ПОЯСОМ.\r\n\r\nИСПОЛЬЗУЕМЫЕ МАТЕРИАЛЫ:\r\nПОЛИЭСТЕР И ПОЛУШЕРСТЬ - 1800 Р.\r\nВИСКОЗА И ПОЛУШЕРСТЬ - 2000 Р.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '355', 'sarafan-a30s', '', '0', NULL, NULL, NULL),
(356, '2018-07-15 16:54:23', 2, '2017-07-24 11:09:21', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка в складку В31-Н - начальная школа', 1273, '', 'text', 1274, '<b>Юбка в круговую складку</b><br>\r\nЗастежка на молнию. Пояс выполнен на регулируемой резинке.', 'html', 'ЮБКА В СКЛАДКУ В31-Н - НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЮБКА В КРУГОВУЮ СКЛАДКУ\r\nЗАСТЕЖКА НА МОЛНИЮ. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '356', 'yubka-b31n', '', '0', NULL, NULL, NULL),
(357, '2018-07-15 17:09:23', 2, '2017-07-24 11:13:33', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка в складку В31-С - средняя школа', 1276, '', 'text', 1277, '<b>Юбка в круговую складку</b><br>\r\nЗастежка на молнию. Пояс выполнен на регулируемой резинке.', 'html', 'ЮБКА В СКЛАДКУ В31-С - СРЕДНЯЯ ШКОЛА\r\n\r\nЮБКА В КРУГОВУЮ СКЛАДКУ\r\nЗАСТЕЖКА НА МОЛНИЮ. ПОЯС ВЫПОЛНЕН НА РЕГУЛИРУЕМОЙ РЕЗИНКЕ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '357', 'yubka-b31s', '', '0', NULL, NULL, NULL),
(358, '2018-07-15 19:25:37', 2, '2017-07-24 11:39:34', 2, 1, NULL, 'Y', '2018-07-13 00:00:00', NULL, 500, 'Акция на сарафаны, брюки и жилеты', 1279, 'В этом году мы снова пополнили наши коллекции новыми моделями. Стильная и качественная школьная форма в наличии и под заказ в нашем салоне \"Всегда в форме\".<br>\r\n Дополнительно мы объявляем акцию на сарафаны (950 р.), брюки и жилеты для мальчиков (от 500 р.). Все в наличии!<br>\r\n Все модели выполнены из качественных материалов и отличаются безукоризненным исполнением.<br>\r\n <br>', 'html', NULL, 'В этом году мы снова пополнили наши коллекции новыми моделями. Стильная школьная форма в наличии и под заказ в нашем салоне \"Всегда в форме\".<br>\r\n Дополнительно мы объявляем акцию на некоторые модели - очень качественные.<br>\r\n <b>Все в наличии!<br>\r\n </b><br>\r\n<table cellpadding=\"1\" cellspacing=\"1\">\r\n<tbody>\r\n<tr>\r\n	<td>\r\n		 &nbsp;<img width=\"277\" src=\"/news/forma_03.jpg\" height=\"369\">\r\n	</td>\r\n	<td>\r\n <b><span style=\"font-size: 13pt;\">Сарафан для начальной и средней школы, </span><a href=\"http://shkolno.ru/catalog/sarafany/340/\"><span style=\"font-size: 13pt;\">артикул А28</span></a><br>\r\n </b><br>\r\n <span style=\"font-size: 13pt;\">Силуэт полуприлегающий</span><br>\r\n <span style=\"font-size: 13pt;\">\r\n		Объем сарафана регулируется хлястиками, вшитыми в рельефные швы.</span><br>\r\n <span style=\"font-size: 13pt;\">\r\n		Материал: вискоза и полиэстер.</span><br>\r\n <span style=\"font-size: 13pt;\"> </span><br>\r\n <span style=\"font-size: 13pt;\"> </span><b><span style=\"font-size: 13pt;\">Цена: 950 р.</span></b><br>\r\n	</td>\r\n</tr>\r\n<tr>\r\n	<td>\r\n		 &nbsp;<img width=\"277\" src=\"/news/forma_02-2.jpg\" height=\"369\">\r\n	</td>\r\n	<td>\r\n <b><span style=\"font-size: 13pt;\">Брюки и жилеты при приобретении по-отдельности<br>\r\n </span></b><br>\r\n <span style=\"font-size: 13pt;\">Брюки (размеры 32-42) - </span><b><span style=\"font-size: 13pt;\">цена 500 руб</span></b><b><span style=\"font-size: 13pt;\">.</span></b><br>\r\n <span style=\"font-size: 13pt;\">\r\n		Жилет (размеры 32-42) - </span><b><span style=\"font-size: 13pt;\">цена 500</span></b><b><span style=\"font-size: 13pt;\">&nbsp;руб.</span></b><br>\r\n <span style=\"font-size: 13pt;\"> </span><br>\r\n		<span style=\"font-size: 17.3333px;\">Данные модели есть в наличии. Качественные материалы и изготовление.</span>\r\n	</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n <br>\r\n <br>\r\n <b>Все модели выполнены из качественных материалов и отличаются безукоризненным исполнением.</b>', 'html', 'АКЦИЯ НА САРАФАНЫ, БРЮКИ И ЖИЛЕТЫ\r\nВ ЭТОМ ГОДУ МЫ СНОВА ПОПОЛНИЛИ НАШИ КОЛЛЕКЦИИ НОВЫМИ МОДЕЛЯМИ. СТИЛЬНАЯ \r\nИ КАЧЕСТВЕННАЯ ШКОЛЬНАЯ ФОРМА В НАЛИЧИИ И ПОД ЗАКАЗ В НАШЕМ САЛОНЕ \"ВСЕГДА \r\nВ ФОРМЕ\".\r\nДОПОЛНИТЕЛЬНО МЫ ОБЪЯВЛЯЕМ АКЦИЮ НА САРАФАНЫ (950 Р.), БРЮКИ И ЖИЛЕТЫ ДЛЯ \r\nМАЛЬЧИКОВ (ОТ 500 Р.). ВСЕ В НАЛИЧИИ!\r\nВСЕ МОДЕЛИ ВЫПОЛНЕНЫ ИЗ КАЧЕСТВЕННЫХ МАТЕРИАЛОВ И ОТЛИЧАЮТСЯ БЕЗУКОРИЗНЕННЫМ \r\nИСПОЛНЕНИЕМ.\r\nВ ЭТОМ ГОДУ МЫ СНОВА ПОПОЛНИЛИ НАШИ КОЛЛЕКЦИИ НОВЫМИ МОДЕЛЯМИ. СТИЛЬНАЯ \r\nШКОЛЬНАЯ ФОРМА В НАЛИЧИИ И ПОД ЗАКАЗ В НАШЕМ САЛОНЕ \"ВСЕГДА В ФОРМЕ\".\r\nДОПОЛНИТЕЛЬНО МЫ ОБЪЯВЛЯЕМ АКЦИЮ НА НЕКОТОРЫЕ МОДЕЛИ - ОЧЕНЬ КАЧЕСТВЕННЫЕ.\r\nВСЕ В НАЛИЧИИ!\r\n\r\n\r\n &NBSP;[ /NEWS/FORMA_03.JPG ]      САРАФАН ДЛЯ НАЧАЛЬНОЙ И СРЕДНЕЙ ШКОЛЫ, \r\nАРТИКУЛ А28 [ HTTP://SHKOLNO.RU/CATALOG/SARAFANY/340/ ] \r\n\r\nСИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ\r\nОБЪЕМ САРАФАНА РЕГУЛИРУЕТСЯ ХЛЯСТИКАМИ, ВШИТЫМИ В РЕЛЬЕФНЫЕ ШВЫ.\r\nМАТЕРИАЛ: ВИСКОЗА И ПОЛИЭСТЕР.\r\n\r\nЦЕНА: 950 Р.\r\n     \r\n &NBSP;[ /NEWS/FORMA_02-2.JPG ]      БРЮКИ И ЖИЛЕТЫ ПРИ ПРИОБРЕТЕНИИ ПО-ОТДЕЛЬНОСТИ\r\n\r\nБРЮКИ (РАЗМЕРЫ 32-42) - ЦЕНА 500 РУБ.\r\nЖИЛЕТ (РАЗМЕРЫ 32-42) - ЦЕНА 500&NBSP;РУБ.\r\n\r\nДАННЫЕ МОДЕЛИ ЕСТЬ В НАЛИЧИИ. КАЧЕСТВЕННЫЕ МАТЕРИАЛЫ И ИЗГОТОВЛЕНИЕ.   \r\n   \r\n \r\n\r\nВСЕ МОДЕЛИ ВЫПОЛНЕНЫ ИЗ КАЧЕСТВЕННЫХ МАТЕРИАЛОВ И ОТЛИЧАЮТСЯ БЕЗУКОРИЗНЕННЫМ \r\nИСПОЛНЕНИЕМ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '358', '', '', '0', NULL, 898, '2017-07-24 11:43:01'),
(359, '2018-07-15 16:13:21', 2, '2018-07-03 16:42:51', 2, 2, 14, 'N', NULL, NULL, 500, 'Комплект школьной формы А10-МН, начальная школа', 1287, '', 'text', 1288, 'Комплект школьной формы для мальчика.<br>\r\n Жилет на подкладе с карманами. Застежка на 4 пуговицы. Силуэт полуприлегающий. Объем регулируется при помощи хлястиков, вшитых в рельефы.<br>\r\n Брюки малообъемные. Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной резинки.<br>\r\n <br>\r\n Материал: костюмное полотно-вискоза.<br>\r\nВозможно исполнение в темно-синем цвете.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А10-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nКОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ ДЛЯ МАЛЬЧИКА.\r\nЖИЛЕТ НА ПОДКЛАДЕ С КАРМАНАМИ. ЗАСТЕЖКА НА 4 ПУГОВИЦЫ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. \r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В РЕЛЬЕФЫ.\r\nБРЮКИ МАЛООБЪЕМНЫЕ. СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО-ВИСКОЗА.\r\nВОЗМОЖНО ИСПОЛНЕНИЕ В ТЕМНО-СИНЕМ ЦВЕТЕ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '359', 'komplekt-shkolnoy-formy-a10-mn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
