(362, '2018-07-04 16:16:07', 2, '2018-07-04 16:16:07', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А31-Н, начальная школа', 1299, '', 'text', 1300, 'Сарафан для начальной школы с крылышками, заложенными в складки.<br>\r\n Силуэт свободный.<br>\r\n <br>\r\n Материал: вискоза, полушерсть, хлопок, полиэстер.<br>\r\nВозможно выполнение в темно-синем, черном, бордовом цветах.<br>', 'html', 'САРАФАН А31-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН ДЛЯ НАЧАЛЬНОЙ ШКОЛЫ С КРЫЛЫШКАМИ, ЗАЛОЖЕННЫМИ В СКЛАДКИ.\r\nСИЛУЭТ СВОБОДНЫЙ.\r\n\r\nМАТЕРИАЛ: ВИСКОЗА, ПОЛУШЕРСТЬ, ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНО ВЫПОЛНЕНИЕ В ТЕМНО-СИНЕМ, ЧЕРНОМ, БОРДОВОМ ЦВЕТАХ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '362', 'sarafan-a31-n-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
