(366, '2018-07-15 17:11:57', 2, '2018-07-04 16:25:28', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А33-СТ, старшая школа', 1325, '', 'text', 1326, 'Сарафан полуприлегающего силуэта с застежкой на молнию.\r\n\r\nМатериал на выбор: хлопок, вискоза, полушерсть, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, клетка.', 'text', 'САРАФАН А33-СТ, СТАРШАЯ ШКОЛА\r\n\r\nСАРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА С ЗАСТЕЖКОЙ НА МОЛНИЮ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ХЛОПОК, ВИСКОЗА, ПОЛУШЕРСТЬ, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, КЛЕТКА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '366', 'sarafan-a33-st-starshaya-shkola', '', '0', NULL, NULL, NULL),
(367, '2018-07-16 17:09:23', 2, '2018-07-04 16:31:27', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В06-ДН, начальная школа', 1330, '', 'text', 1331, 'Жилет на подкладе, застегивается на молнию, с клапанами на полочке, на спинке шлевка для пояса. <br>\r\n Силуэт прямой.<br>\r\n <br>\r\n Юбка комбинированная в складку. Используются ткани-компаньоны.<br>\r\n Объем пояса регулируется специальной резинкой.<br>\r\n <br>\r\n Материал на выбор: полушерсть, вискоза, хлопок, полиэстер.<br>\r\nВозможно исполнение в двух цветовых вариациях: бордовый+бордовая клетка или темно-синий+синяя клетка.', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В06-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, С КЛАПАНАМИ НА ПОЛОЧКЕ, НА \r\nСПИНКЕ ШЛЕВКА ДЛЯ ПОЯСА. \r\nСИЛУЭТ ПРЯМОЙ.\r\n\r\nЮБКА КОМБИНИРОВАННАЯ В СКЛАДКУ. ИСПОЛЬЗУЮТСЯ ТКАНИ-КОМПАНЬОНЫ.\r\nОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ПОЛУШЕРСТЬ, ВИСКОЗА, ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНО ИСПОЛНЕНИЕ В ДВУХ ЦВЕТОВЫХ ВАРИАЦИЯХ: БОРДОВЫЙ+БОРДОВАЯ КЛЕТКА \r\nИЛИ ТЕМНО-СИНИЙ+СИНЯЯ КЛЕТКА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '367', 'komplekt-shkolnoy-formy-v06-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(368, '2018-07-16 17:08:34', 2, '2018-07-04 16:36:19', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А31-ДН, начальная школа', 1338, '', 'text', 1339, 'Жилет на подкладе с карманами, застегивается на 4 пуговицы.\r\nОбъем регулируется при помощи хлястика, расположенного на спинке.\r\n\r\nЮбка в складку, застегивается на молнию, объем регулируется при помощи специальной резинки.\r\n\r\nМатериал на выбор: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный.\r\n', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А31-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ С КАРМАНАМИ, ЗАСТЕГИВАЕТСЯ НА 4 ПУГОВИЦЫ.\r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКА, РАСПОЛОЖЕННОГО НА СПИНКЕ.\r\n\r\nЮБКА В СКЛАДКУ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '368', 'komplekt-shkolnoy-formy-a31-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
