(370, '2018-08-12 16:31:51', 2, '2018-07-04 16:39:10', 2, 2, 14, 'Y', NULL, NULL, 500, 'Комплект школьной формы А11-МН, начальная школа', 1346, '', 'text', 1347, 'Комплект школьной формы для мальчика.<br>\r\n Жилет на подкладе с карманами. Застежка на 4 пуговицы. Силуэт полуприлегающий. Объем регулируется при помощи хлястиков, вшитых в рельефы.<br>\r\n Брюки малообъемные. Спереди расположены карманы. Застежка на молнию. Объем пояса регулируется при помощи специальной резинки.<br>\r\n <br>\r\n Материал: костюмное полотно-вискоза.<br>\r\n Возможно исполнение в темно-синем цвете.<br>', 'html', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А11-МН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nКОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ ДЛЯ МАЛЬЧИКА.\r\nЖИЛЕТ НА ПОДКЛАДЕ С КАРМАНАМИ. ЗАСТЕЖКА НА 4 ПУГОВИЦЫ. СИЛУЭТ ПОЛУПРИЛЕГАЮЩИЙ. \r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКОВ, ВШИТЫХ В РЕЛЬЕФЫ.\r\nБРЮКИ МАЛООБЪЕМНЫЕ. СПЕРЕДИ РАСПОЛОЖЕНЫ КАРМАНЫ. ЗАСТЕЖКА НА МОЛНИЮ. ОБЪЕМ \r\nПОЯСА РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО-ВИСКОЗА.\r\nВОЗМОЖНО ИСПОЛНЕНИЕ В ТЕМНО-СИНЕМ ЦВЕТЕ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '370', 'komplekt-shkolnoy-formy-a11-mn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
