(374, '2018-07-05 11:18:56', 2, '2018-07-04 16:57:14', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В13-ДН, начальная школа', 1366, '', 'text', 1367, 'Жилет на подкладе, застегивается на молнию, с клапанами  на полочке. На спинке шлевка для пояса.  Силуэт прямой.\r\nЮбка с клиньями. Объем пояса регулируется специальной резинкой.\r\n\r\nМатериал на выбор: полушерсть, вискоза, хлопок, полиэстер.\r\nВозможно исполнение в бордовом или темно-синем цветах.\r\n', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В13-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, С КЛАПАНАМИ  НА ПОЛОЧКЕ. НА СПИНКЕ ШЛЕВКА ДЛЯ ПОЯСА.  СИЛУЭТ ПРЯМОЙ.\r\nЮБКА С КЛИНЬЯМИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ПОЛУШЕРСТЬ, ВИСКОЗА, ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНО ИСПОЛНЕНИЕ В БОРДОВОМ ИЛИ ТЕМНО-СИНЕМ ЦВЕТАХ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '374', 'komplekt-shkolnoy-formy-v13-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
