(376, '2018-07-15 17:09:04', 2, '2018-07-04 17:02:33', 2, 2, 7, 'Y', NULL, NULL, 500, 'Юбка А25-НС, средняя школа', 1377, '', 'text', 1378, 'Юбка с клиньями. Объем пояса регулируется специальной резинкой.\r\n\r\nМатериал: полушерсть, вискоза, хлопок, полиэстер.\r\nВозможные цвета: бордовый, темно-синий, черный, серый.', 'text', 'ЮБКА А25-НС, СРЕДНЯЯ ШКОЛА\r\n\r\nЮБКА С КЛИНЬЯМИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\n\r\nМАТЕРИАЛ: ПОЛУШЕРСТЬ, ВИСКОЗА, ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: БОРДОВЫЙ, ТЕМНО-СИНИЙ, ЧЕРНЫЙ, СЕРЫЙ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '376', 'yubka-a25-ns-srednyaya-shkola', '', '0', NULL, NULL, NULL),
(377, '2018-07-15 16:42:20', 2, '2018-07-04 17:08:40', 2, 2, 11, 'Y', NULL, NULL, 500, 'Школьный комплект из юбки и блузки А36-ДН, начальная школа', 1398, '', 'text', 1399, 'Юбка с клиньями. Объем пояса регулируется специальной резинкой.\r\nМатериал на выбор: полушерсть, вискоза, хлопок, полиэстер.\r\nВозможные цвета: бордовый, темно-синий, черный, серый.\r\n\r\nБлузка  с воротничком и украшением. Рукава и кокетка из эластичного шифона.\r\nМатериал: х/б с лайкрой.\r\n', 'text', 'ШКОЛЬНЫЙ КОМПЛЕКТ ИЗ ЮБКИ И БЛУЗКИ А36-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЮБКА С КЛИНЬЯМИ. ОБЪЕМ ПОЯСА РЕГУЛИРУЕТСЯ СПЕЦИАЛЬНОЙ РЕЗИНКОЙ.\r\nМАТЕРИАЛ НА ВЫБОР: ПОЛУШЕРСТЬ, ВИСКОЗА, ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: БОРДОВЫЙ, ТЕМНО-СИНИЙ, ЧЕРНЫЙ, СЕРЫЙ.\r\n\r\nБЛУЗКА  С ВОРОТНИЧКОМ И УКРАШЕНИЕМ. РУКАВА И КОКЕТКА ИЗ ЭЛАСТИЧНОГО ШИФОНА.\r\nМАТЕРИАЛ: Х/Б С ЛАЙКРОЙ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '377', 'komplekt-iz-shkolnoy-yubki-i-bluzki-a36-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
