(379, '2018-07-16 16:53:22', 2, '2018-07-04 17:19:22', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы А32-ДН, начальная школа', 1404, '', 'text', 1405, 'Жилет на подкладе, застегивается на 4 пуговицы. Объем регулируется при помощи хлястика, расположенного на спинке.\r\nЮбка с клиньями, застегивается на молнию, объем регулируется при помощи специальной резинки.\r\n\r\nМатериал на выбор: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный.\r\n', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ А32-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА 4 ПУГОВИЦЫ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКА, РАСПОЛОЖЕННОГО НА СПИНКЕ.\r\nЮБКА С КЛИНЬЯМИ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '379', 'komplekt-shkolnoy-formy-a32-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
