(381, '2018-07-16 16:52:34', 2, '2018-07-04 17:24:45', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В07-ДН, начальная школа', 1412, '', 'text', 1413, 'Жилет на подкладе, застегивается на 4 пуговицы. Объем регулируется при помощи хлястика, расположенного на спинке.\r\nЮбка с клиньями, застегивается на молнию, объем регулируется при помощи специальной резинки.\r\n\r\nМатериал на выбор: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный + клетка компаньон.\r\n', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В07-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА 4 ПУГОВИЦЫ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКА, РАСПОЛОЖЕННОГО НА СПИНКЕ.\r\nЮБКА С КЛИНЬЯМИ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ + КЛЕТКА КОМПАНЬОН.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '381', 'komplekt-shkolnoy-formy-v07-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(382, '2018-07-16 16:51:48', 2, '2018-07-04 17:25:52', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В07-ДС, средняя школа', 1417, '', 'text', 1418, 'Жилет на подкладе, застегивается на 4 пуговицы. Объем регулируется при помощи хлястика, расположенного на спинке.\r\nЮбка с клиньями, застегивается на молнию, объем регулируется при помощи специальной резинки.\r\n\r\nМатериал на выбор: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный + клетка компаньон.\r\n', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В07-ДС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА 4 ПУГОВИЦЫ. ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКА, РАСПОЛОЖЕННОГО НА СПИНКЕ.\r\nЮБКА С КЛИНЬЯМИ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ + КЛЕТКА КОМПАНЬОН.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '382', 'komplekt-shkolnoy-formy-v07-ds-srednyaya-shkola', '', '0', NULL, NULL, NULL),
(383, '2018-07-15 16:41:42', 2, '2018-07-04 17:33:08', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В08-ДН, начальная школа', 1422, '', 'text', 1423, 'Жилет на подкладе, застегивается на молнию. Силуэт прямой.\r\nНа полочке и спинке расположены шлевки для пояса или ремня (ремень не входит в комплект).\r\nЮбка полусолнце, пояс на резинке.\r\n\r\nМатериал на выбор: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный + клетка-компаньон.', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В08-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ. СИЛУЭТ ПРЯМОЙ.\r\nНА ПОЛОЧКЕ И СПИНКЕ РАСПОЛОЖЕНЫ ШЛЕВКИ ДЛЯ ПОЯСА ИЛИ РЕМНЯ (РЕМЕНЬ НЕ ВХОДИТ В КОМПЛЕКТ).\r\nЮБКА ПОЛУСОЛНЦЕ, ПОЯС НА РЕЗИНКЕ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ + КЛЕТКА-КОМПАНЬОН.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '383', 'komplekt-shkolnoy-formy-v08-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(384, '2018-07-15 16:41:30', 2, '2018-07-04 17:36:18', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В09-ДН, начальная школа', 1427, '', 'text', 1428, 'Жилет на подкладе, застегивается на молнию. Силуэт прямой. \r\nЮбка на запахе, застегивается на 6 пуговиц, с двумя карманами, пояс на резинке.\r\n\r\nМатериал на выбор: вискоза, полушерсть, хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный + клетка-компаньон', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В09-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ. СИЛУЭТ ПРЯМОЙ. \r\nЮБКА НА ЗАПАХЕ, ЗАСТЕГИВАЕТСЯ НА 6 ПУГОВИЦ, С ДВУМЯ КАРМАНАМИ, ПОЯС НА РЕЗИНКЕ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ, ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ + КЛЕТКА-КОМПАНЬОН', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '384', 'komplekt-shkolnoy-formy-v09-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(385, '2018-07-16 16:50:49', 2, '2018-07-04 17:44:07', 2, 2, 11, 'Y', NULL, NULL, 500, 'Школьный комплект из юбки и блузки А33-ДН, начальная школа', 1433, '', 'text', 1434, 'Блузка с воротничком и украшением.\r\nМатериал: х/б с лайкрой. Рукава и кокетка из эластичного шифона \r\nЦвета: белый, темно-синий.\r\n\r\nЮбка на запахе, застегивается на 6 пуговиц, с двумя карманами, пояс на резинке.\r\n', 'text', 'ШКОЛЬНЫЙ КОМПЛЕКТ ИЗ ЮБКИ И БЛУЗКИ А33-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nБЛУЗКА С ВОРОТНИЧКОМ И УКРАШЕНИЕМ.\r\nМАТЕРИАЛ: Х/Б С ЛАЙКРОЙ. РУКАВА И КОКЕТКА ИЗ ЭЛАСТИЧНОГО ШИФОНА \r\nЦВЕТА: БЕЛЫЙ, ТЕМНО-СИНИЙ.\r\n\r\nЮБКА НА ЗАПАХЕ, ЗАСТЕГИВАЕТСЯ НА 6 ПУГОВИЦ, С ДВУМЯ КАРМАНАМИ, ПОЯС НА РЕЗИНКЕ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '385', 'shkolnyy-komplekt-iz-yubki-i-bluzki-a33-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(386, '2018-07-15 17:03:24', 2, '2018-07-04 17:47:31', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А34-С, средняя школа', 1438, '', 'text', 1439, 'Сарафан полуприлегающего силуэта с застежкой на молнию.\r\n\r\nМатериал на выбор: хлопок, вискоза, полушерсть, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, клетка.', 'text', 'САРАФАН А34-С, СРЕДНЯЯ ШКОЛА\r\n\r\nСАРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА С ЗАСТЕЖКОЙ НА МОЛНИЮ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ХЛОПОК, ВИСКОЗА, ПОЛУШЕРСТЬ, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, КЛЕТКА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '386', 'sarafan-a34-s-srednyaya-shkola', '', '0', NULL, NULL, NULL),
(387, '2018-07-15 17:11:47', 2, '2018-07-04 17:48:55', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан А34-СТ, старшая школа', 1445, '', 'text', 1446, 'Сарафан полуприлегающего силуэта с застежкой на молнию.\r\n\r\nМатериал на выбор: хлопок, вискоза, полушерсть, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, клетка.', 'text', 'САРАФАН А34-СТ, СТАРШАЯ ШКОЛА\r\n\r\nСАРАФАН ПОЛУПРИЛЕГАЮЩЕГО СИЛУЭТА С ЗАСТЕЖКОЙ НА МОЛНИЮ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ХЛОПОК, ВИСКОЗА, ПОЛУШЕРСТЬ, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, КЛЕТКА.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '387', 'sarafan-a34-st-starshaya-shkola', '', '0', NULL, NULL, NULL),
(388, '2018-07-15 16:10:55', 2, '2018-07-04 17:54:28', 2, 2, 8, 'N', NULL, NULL, 500, 'Платье А35-Н, начальная школа', 1452, '', 'text', 1453, 'Платье облегающего силуэта, отрезное по талии, с длинными рукавами.\r\nНа полочке вышивка  - имитация воротника.\r\n\r\nМатериал: трикотажное полотно (вискоза с добавлением полиэстера и эластана).\r\nВозможные цвета: серый, темно-синий.\r\n', 'text', 'ПЛАТЬЕ А35-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОБЛЕГАЮЩЕГО СИЛУЭТА, ОТРЕЗНОЕ ПО ТАЛИИ, С ДЛИННЫМИ РУКАВАМИ.\r\nНА ПОЛОЧКЕ ВЫШИВКА  - ИМИТАЦИЯ ВОРОТНИКА.\r\n\r\nМАТЕРИАЛ: ТРИКОТАЖНОЕ ПОЛОТНО (ВИСКОЗА С ДОБАВЛЕНИЕМ ПОЛИЭСТЕРА И ЭЛАСТАНА).\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '388', 'plate-a35-n-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(389, '2018-07-15 17:03:11', 2, '2018-07-04 17:56:04', 2, 2, 8, 'Y', NULL, NULL, 500, 'Платье А35-С, средняя школа', 1457, '', 'text', 1458, 'Платье облегающего силуэта, отрезное по талии, с длинными рукавами.\r\nНа полочке вышивка  - имитация воротника.\r\n\r\nМатериал: трикотажное полотно (вискоза с добавлением полиэстера и эластана).\r\nВозможные цвета: серый, темно-синий.\r\n', 'text', 'ПЛАТЬЕ А35-С, СРЕДНЯЯ ШКОЛА\r\n\r\nПЛАТЬЕ ОБЛЕГАЮЩЕГО СИЛУЭТА, ОТРЕЗНОЕ ПО ТАЛИИ, С ДЛИННЫМИ РУКАВАМИ.\r\nНА ПОЛОЧКЕ ВЫШИВКА  - ИМИТАЦИЯ ВОРОТНИКА.\r\n\r\nМАТЕРИАЛ: ТРИКОТАЖНОЕ ПОЛОТНО (ВИСКОЗА С ДОБАВЛЕНИЕМ ПОЛИЭСТЕРА И ЭЛАСТАНА).\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '389', 'plate-a35-s-srednyaya-shkola', '', '0', NULL, NULL, NULL),
(390, '2018-07-15 16:41:08', 2, '2018-07-04 18:00:55', 2, 2, 11, 'Y', NULL, NULL, 500, 'Школьный комплект из юбки и блузки А34-ДН, начальная школа', 1462, '', 'text', 1463, 'Блузка с воротничком и украшением. \r\nМатериал: х/б с лайкрой. Рукава и кокетка из эластичного шифона.\r\nЦвета: белый, темно-синий.\r\n\r\nЮбка-гофре с бантом. Пояс – декоративная резинка. \r\nЦвет темно-синий.\r\n', 'text', 'ШКОЛЬНЫЙ КОМПЛЕКТ ИЗ ЮБКИ И БЛУЗКИ А34-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nБЛУЗКА С ВОРОТНИЧКОМ И УКРАШЕНИЕМ. \r\nМАТЕРИАЛ: Х/Б С ЛАЙКРОЙ. РУКАВА И КОКЕТКА ИЗ ЭЛАСТИЧНОГО ШИФОНА.\r\nЦВЕТА: БЕЛЫЙ, ТЕМНО-СИНИЙ.\r\n\r\nЮБКА-ГОФРЕ С БАНТОМ. ПОЯС – ДЕКОРАТИВНАЯ РЕЗИНКА. \r\nЦВЕТ ТЕМНО-СИНИЙ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '390', 'shkolnyy-komplekt-iz-yubki-i-bluzki-a34-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(391, '2018-07-15 16:40:56', 2, '2018-07-04 18:04:32', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В10-ДН, начальная школа', 1469, '', 'text', 1470, 'Жилет на подкладе, застегивается на молнию. Силуэт прямой.\r\nНа полочке и спинке расположены шлевки для пояса или ремня ( не входят в комплект).\r\nЮбка полусолнце, пояс на резинке.\r\n\r\nВозможные материалы: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный + клетка-компаньон.', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В10-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ. СИЛУЭТ ПРЯМОЙ.\r\nНА ПОЛОЧКЕ И СПИНКЕ РАСПОЛОЖЕНЫ ШЛЕВКИ ДЛЯ ПОЯСА ИЛИ РЕМНЯ ( НЕ ВХОДЯТ В КОМПЛЕКТ).\r\nЮБКА ПОЛУСОЛНЦЕ, ПОЯС НА РЕЗИНКЕ.\r\n\r\nВОЗМОЖНЫЕ МАТЕРИАЛЫ: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ + КЛЕТКА-КОМПАНЬОН.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '391', 'komplekt-shkolnoy-formy-v10-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(392, '2018-07-15 16:47:15', 2, '2018-07-04 18:08:16', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан В30-Н, начальная школа', 1474, '', 'text', 1475, 'Сарафан отрезной по талии, с застежкой на молнию на полочке.\r\nЮбка в складку. На полочке и спинке по линии талии  расположены шлевки для пояса.\r\n\r\nВозможные материалы: костюмное полотно, вискоза, полиэстер, полушерсть.\r\n', 'text', 'САРАФАН В30-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН ОТРЕЗНОЙ ПО ТАЛИИ, С ЗАСТЕЖКОЙ НА МОЛНИЮ НА ПОЛОЧКЕ.\r\nЮБКА В СКЛАДКУ. НА ПОЛОЧКЕ И СПИНКЕ ПО ЛИНИИ ТАЛИИ  РАСПОЛОЖЕНЫ ШЛЕВКИ ДЛЯ ПОЯСА.\r\n\r\nВОЗМОЖНЫЕ МАТЕРИАЛЫ: КОСТЮМНОЕ ПОЛОТНО, ВИСКОЗА, ПОЛИЭСТЕР, ПОЛУШЕРСТЬ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '392', 'sarafan-v30-n-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
