(396, '2018-07-15 16:40:16', 2, '2018-07-04 18:35:54', 2, 2, 11, 'Y', NULL, NULL, 500, 'Комплект школьной формы В12-ДН, начальная школа', 1498, '', 'text', 1499, 'Жилет на подкладе, застегивается на молнию. Силуэт прямой.\r\nМатериал: костюмное полотно в клетку.\r\n\r\nЮбка с клиньями, застегивается на молнию, объем регулируется при помощи специальной резинки.', 'text', 'КОМПЛЕКТ ШКОЛЬНОЙ ФОРМЫ В12-ДН, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ. СИЛУЭТ ПРЯМОЙ.\r\nМАТЕРИАЛ: КОСТЮМНОЕ ПОЛОТНО В КЛЕТКУ.\r\n\r\nЮБКА С КЛИНЬЯМИ, ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ, ОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ СПЕЦИАЛЬНОЙ РЕЗИНКИ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '396', 'komplekt-shkolnoy-formy-v12-dn-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
(397, '2018-07-15 16:47:04', 2, '2018-07-04 18:45:25', 2, 2, 8, 'Y', NULL, NULL, 500, 'Сарафан В31-Н, начальная школа', 1527, '', 'text', 1528, 'Сарафан отрезной по талии с застежкой на молнию на полочке.<br>\r\n Юбка-полусолнце. На полочке и спинке по линии талии расположены шлевки для пояса.<br>\r\n <br>\r\n <b>Используемые материалы:</b><br>\r\n Полиэстер и полушерсть - 1800 р.<br>\r\n Вискоза и полушерсть - 2000 р.<br>\r\n <br>', 'html', 'САРАФАН В31-Н, НАЧАЛЬНАЯ ШКОЛА\r\n\r\nСАРАФАН ОТРЕЗНОЙ ПО ТАЛИИ С ЗАСТЕЖКОЙ НА МОЛНИЮ НА ПОЛОЧКЕ.\r\nЮБКА-ПОЛУСОЛНЦЕ. НА ПОЛОЧКЕ И СПИНКЕ ПО ЛИНИИ ТАЛИИ РАСПОЛОЖЕНЫ ШЛЕВКИ \r\nДЛЯ ПОЯСА.\r\n\r\nИСПОЛЬЗУЕМЫЕ МАТЕРИАЛЫ:\r\nПОЛИЭСТЕР И ПОЛУШЕРСТЬ - 1800 Р.\r\nВИСКОЗА И ПОЛУШЕРСТЬ - 2000 Р.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '397', 'sarafan-v31-n-nachalnaya-shkola', '', '0', NULL, NULL, NULL),
