(411, '2018-07-15 17:29:14', 2, '2018-07-04 20:13:02', 2, 2, 12, 'Y', NULL, NULL, 500, 'Жилет для девочки А11-ДВС, средняя школа', 1624, '', 'text', 1625, 'Жилет на подкладе с карманами, застегивается на 4 пуговицы.\r\nОбъем регулируется при помощи хлястика, расположенного на спинке.\r\n\r\nМатериал на выбор: вискоза, полушерсть хлопок, полиэстер.\r\nВозможные цвета: серый, темно-синий, бордовый, черный.', 'text', 'ЖИЛЕТ ДЛЯ ДЕВОЧКИ А11-ДВС, СРЕДНЯЯ ШКОЛА\r\n\r\nЖИЛЕТ НА ПОДКЛАДЕ С КАРМАНАМИ, ЗАСТЕГИВАЕТСЯ НА 4 ПУГОВИЦЫ.\r\nОБЪЕМ РЕГУЛИРУЕТСЯ ПРИ ПОМОЩИ ХЛЯСТИКА, РАСПОЛОЖЕННОГО НА СПИНКЕ.\r\n\r\nМАТЕРИАЛ НА ВЫБОР: ВИСКОЗА, ПОЛУШЕРСТЬ ХЛОПОК, ПОЛИЭСТЕР.\r\nВОЗМОЖНЫЕ ЦВЕТА: СЕРЫЙ, ТЕМНО-СИНИЙ, БОРДОВЫЙ, ЧЕРНЫЙ.', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '411', 'zhilet-dlya-devochki-a11-dvs-srednyaya-shkola', '', '0', NULL, NULL, NULL),
