(414, '2018-07-15 19:36:04', 2, '2018-07-15 19:33:48', 2, 1, NULL, 'Y', '2018-07-15 00:00:00', NULL, 500, 'Новая коллекция на новый учебный год', 1655, 'Мы обновили коллекции на новый учебный год и добавили множество красивых и интересных моделей. Вся одежда выполнена из качественных материалов, а безукоризненное исполнение порадует даже самых требовательных родителей.\r\nДля большинства моделей вы можете выбрать материал из наших образцов: вискоза, полиэстер, полушерсть или хлопок исходя из ваших требований.\r\nМы работаем как с розничными клиентами, так и с целыми классами или школами.', 'text', NULL, 'Мы обновили коллекции на новый учебный год и добавили множество красивых и интересных моделей. Вся одежда выполнена из качественных материалов, а безукоризненное исполнение порадует даже самых требовательных родителей.<br>\r\n Для большинства моделей вы можете выбрать материал из наших образцов: вискоза, полиэстер, полушерсть или хлопок исходя из ваших требований.<br>\r\n Мы работаем как с розничными клиентами, так и с целыми классами или школами.<br>\r\n <br>\r\n <img width=\"322\" src=\"/news/site_01.png\" height=\"326\">&nbsp;<a href=\"http://shkolno.ru/catalog/sarafany/\"><img width=\"322\" src=\"/news/site_02.png\" height=\"326\"></a>&nbsp;&nbsp;<a href=\"http://shkolno.ru/catalog/kletki/\"><img width=\"322\" src=\"/news/site_03.png\" height=\"326\"></a>&nbsp;&nbsp;<a href=\"http://shkolno.ru/catalog/yubki/\"><img width=\"322\" src=\"/news/site_04.png\" height=\"326\"></a>&nbsp;&nbsp;<a href=\"http://shkolno.ru/catalog/element/\"><img width=\"322\" src=\"/news/site_05.png\" height=\"326\"></a><br>', 'html', 'НОВАЯ КОЛЛЕКЦИЯ НА НОВЫЙ УЧЕБНЫЙ ГОД\r\nМЫ ОБНОВИЛИ КОЛЛЕКЦИИ НА НОВЫЙ УЧЕБНЫЙ ГОД И ДОБАВИЛИ МНОЖЕСТВО КРАСИВЫХ И ИНТЕРЕСНЫХ МОДЕЛЕЙ. ВСЯ ОДЕЖДА ВЫПОЛНЕНА ИЗ КАЧЕСТВЕННЫХ МАТЕРИАЛОВ, А БЕЗУКОРИЗНЕННОЕ ИСПОЛНЕНИЕ ПОРАДУЕТ ДАЖЕ САМЫХ ТРЕБОВАТЕЛЬНЫХ РОДИТЕЛЕЙ.\r\nДЛЯ БОЛЬШИНСТВА МОДЕЛЕЙ ВЫ МОЖЕТЕ ВЫБРАТЬ МАТЕРИАЛ ИЗ НАШИХ ОБРАЗЦОВ: ВИСКОЗА, ПОЛИЭСТЕР, ПОЛУШЕРСТЬ ИЛИ ХЛОПОК ИСХОДЯ ИЗ ВАШИХ ТРЕБОВАНИЙ.\r\nМЫ РАБОТАЕМ КАК С РОЗНИЧНЫМИ КЛИЕНТАМИ, ТАК И С ЦЕЛЫМИ КЛАССАМИ ИЛИ ШКОЛАМИ.\r\nМЫ ОБНОВИЛИ КОЛЛЕКЦИИ НА НОВЫЙ УЧЕБНЫЙ ГОД И ДОБАВИЛИ МНОЖЕСТВО КРАСИВЫХ \r\nИ ИНТЕРЕСНЫХ МОДЕЛЕЙ. ВСЯ ОДЕЖДА ВЫПОЛНЕНА ИЗ КАЧЕСТВЕННЫХ МАТЕРИАЛОВ, А \r\nБЕЗУКОРИЗНЕННОЕ ИСПОЛНЕНИЕ ПОРАДУЕТ ДАЖЕ САМЫХ ТРЕБОВАТЕЛЬНЫХ РОДИТЕЛЕЙ.\r\nДЛЯ БОЛЬШИНСТВА МОДЕЛЕЙ ВЫ МОЖЕТЕ ВЫБРАТЬ МАТЕРИАЛ ИЗ НАШИХ ОБРАЗЦОВ: ВИСКОЗА, \r\nПОЛИЭСТЕР, ПОЛУШЕРСТЬ ИЛИ ХЛОПОК ИСХОДЯ ИЗ ВАШИХ ТРЕБОВАНИЙ.\r\nМЫ РАБОТАЕМ КАК С РОЗНИЧНЫМИ КЛИЕНТАМИ, ТАК И С ЦЕЛЫМИ КЛАССАМИ ИЛИ ШКОЛАМИ.\r\n\r\n[ /NEWS/SITE_01.PNG ] &NBSP;[ /NEWS/SITE_02.PNG ] [ HTTP://SHKOLNO.RU/CATALOG/SARAFANY/ ] \r\n&NBSP;&NBSP;[ /NEWS/SITE_03.PNG ] [ HTTP://SHKOLNO.RU/CATALOG/KLETKI/ ] \r\n&NBSP;&NBSP;[ /NEWS/SITE_04.PNG ] [ HTTP://SHKOLNO.RU/CATALOG/YUBKI/ ] &NBSP;&NBSP;[ /NEWS/SITE_05.PNG ] \r\n[ HTTP://SHKOLNO.RU/CATALOG/ELEMENT/ ]', 1, NULL, NULL, NULL, NULL, NULL, 'N', '414', '', '', '0', NULL, 377, '2018-07-15 19:34:37'),
