INSERT INTO `b_user_stored_auth` VALUES
(1, 1, '2019-08-03 19:01:38', '2019-08-03 19:48:30', 'e96ac8196b5cb30fa6f33e2e78fcea42', 'N', 1406923885);
INSERT INTO `b_uts_iblock_2_section` VALUES
(1, 'Коллекция \"Элемент\", выпущенная на учебный год 2016-2017, представляет собой строгие классические модели школьной формы из гладкокрашеных тканей: жилеты, юбки, брюки, сарафаны. Каждая модель существует в двух позициях - для мальчика и для девочки, которые идеально сочетаются друг с другом.', NULL, 'Строгая форма всегда была и остается популярной и востребованной школьной одеждой. Она повышает чувство дисциплины и ответственности учащихся. \r\nВ данной коллекции Вы найдете модели в классической палитре: синие, серые, темно-серые, и коричневые юбки, брюки, жилеты, сарафаны и комплекты.\r\nВо всех наших коллекциях используются только дышащие качественные материалы. Они не сковывают движения, а чувство комфорта позволяет сосредоточиться на процессе обучения.', 1),
(2, 'Коллекция \"Пазлы\" представляет собой сочетание элементов школьной формы из однотонных тканей или тканей в клетку с трикотажными жилетами различных расцветок.', NULL, '<b>Школьная форма с трикотажными жилетами</b>\r\n<p>\r\nСовременная и практичная школьная форма из высококачественных материалов пришла на смену безразмерных и мешковатых моделей, которые дети носили в Советском Союзе или в 90-е годы. Одной из современных тенденций является использование трикотажных жилетов в сочетании с юбками или брюками из однотонных тканей или тканей в клетку.\r\n<p>\r\n<b>Трикотажные жилеты - модно и актуально</b>\r\n<p>\r\nИспользование трикотажных жилетов в школьной форме очень актуально. Они могут быть различных расцветок, что с легкостью позволяет подобрать вязаный трикотажный верх под юбку или брюки любой цветовой гаммы. Школьный трикотажный жилет подходит как для младшей возрастной группы учащихся, так и для старшеклассников.\r\n<p>\r\n<b>Продажа школьных трикотажных жилетов</b>\r\n<p>\r\nМы предлагаем модели школьной формы с использованием трикотажных жилетов для классов и школ. Вязаные жилеты выполнены из тонкого трикотажного полотна, в которых не жарко.', 1),
(3, 'Коллекция \"Клетки\" - это модели из однотонных тканей и тканей в клетку \"шотландка\". Такая школьная форма не выглядит скучно или однообразно, но одновременно является классической школьной одеждой.', NULL, '<b>Школьная форма в клетку</b>\r\n<p>\r\nШкольная форма в клетку в течение многих лет является модным трендом. Она подчеркивает стиль и индивидуальность школьников, но полностью соответствует школьному дресс-коду. Мы предлагаем несколько моделей юбок, сарафанов и комплектов в клетку в различных цветовых гаммах: от нейтральных и строгих до более ярких, с красными вставками.\r\n<p>\r\n<b>Купить школьную форму в клетку для девочек</b>\r\n<p>\r\nСегодня форма из цветной ткани в клетку пользуется огромным спросом. Вы можете приобрести модели из коллекции \"Клетка\" в нашем интернет-магазине или заказать в салоне «Всегда в форме».\r\n', 1),
(4, 'Наш каталог школьной формы постоянно обновляется. Мы работаем, создавая новые коллекции и модели, соответствуя тенденциям современной школьной моды и требованиям практичности и удобства. \r\n', NULL, '<p>В нашем каталоге представлены коллекции школьной формы в трех разных направлениях. <br/><b>Коллекция \"Элемент\"</b> - это модели из гладкокрашеных тканей, выполненные в различных цветовых гаммах, строгие и классические: жилеты и брюки для мальчиков и девочек, различные типы юбок (колокол, с запахом и др.), сарафаны с кружевным воротничком и многое другое.<br/>\r\n<b>Коллекция \"Клетки\"</b> представляет собой сочетание элементов школьной одежды из однотонных материалов и модной ткани \"шотландки\". Из ткани в клетку мы предлагаем только нижнюю часть комплекта. Это позволяет не отвлекать внимание преподавателей и учеников от образовательного процесса во время уроков, а во время перемен создает более непринужденную атмосферу.<br/>\r\n<b>Коллекция \"Пазлы\"</b> представляет собой модели школьной формы с использованием трикотажных жилетов, которые очень практичны в носке.', 0),
(5, 'Стильная и удобная школьная форма для девочек представлена юбками, жилетами, сарафанами, брюками и водолазками. Все модели выполнены с учетом особенностей фигуры девочек как начальных классов, так и средней и старшей школы. Большое внимание уделено используемым материалам и качеству изготовления. Все это позволяет школьнице чувствовать себя уверенно и по-настоящему комфортно.', NULL, '<b>Где купить школьную форму для девочек?</b>\r\n<p>\r\nЕсли Вы задаетесь вопросом «Где купить школьную форму для девочек», то Вы попали по адресу. У нас представлены новые коллекции современной и модной школьной формы: различные модели сарафанов, юбок, жилетов, а также брюки и водолазки, которые Вы можете приобрести, не выходя из дома. Наша школьная форма для девочек – это очень нарядные и красивые костюмы на каждый день, продуманные до мелочей. Такая форма будет приносить удовольствие и надолго останется в памяти школьниц. Большое внимание уделено используемым материалам и качеству изготовления. Вся школьная одежда практична, удобна, комфортна и не стесняет движений, а школьницы почувствуют себя настоящими бизнес-леди.</p>\r\n<p>\r\n<b>Интернет-магазин школьной формы для девочек.</b>\r\n<p>\r\nКупить школьную форму для девочек Вы можете как в нашем интернет-магазине SHKOLNO.RU, так и заказать в салоне «Всегда в форме» в г. Красноярск. Мы будем рады проконсультировать по всем интересующим Вас вопросам, продемонстрировать образцы моделей из наших коллекций или разработать уникальный дизайн школьной формы для Вашего класса или учебного заведения.</p>\r\n', 0),
(6, 'Удобная, строгая и практичная школьная форма для мальчиков представлена брюками, жилетами и водолазками. Применяются преимущественно натуральные материалы. Жилеты могут быть как из гладкокрашеных тканей, так и вязаные. Все представленные модели школьной формы для мальчиков отлично сочетаются с комплектами для девочек, что позволит детям одного класса или школы почувствовать себя единым коллективом.', NULL, '<b>Школьная форма для мальчиков</b>\r\n<p>\r\nМодели, представленные в нашем каталоге, удобные, модные и стильные: жилеты из гладкокрашеных тканей, трикотажные жилеты, брюки и водолазки. Все это отлично сочетается с комплектами для девочек. Такая школьная форма позволит ребятам почувствовать себя частью единого коллектива и повысить дисциплину в классе.\r\n<p>\r\n<b>Интернет-магазин школьной формы для мальчиков</b>\r\n<p>\r\nВ нашем интернет-магазине мы предлагаем изделия высокого качества по приемлемым ценам. Вы можете купить школьную форму для мальчика прямо не выходя из дома. Также мы будем рады видеть Вас в нашем салоне «Всегда в форме» в Красноярске, где мы с удовольствием покажем Вам имеющиеся образцы.\r\n<p>\r\n<b>Школьная форма для мальчиков в розницу и для классов и школ</b>\r\n<p>\r\nМы рады предложить школьную форму как в розницу, так и для школьных коллективов. Для классов и школ возможна разработка индивидуального стиля.\r\n', 0),
(7, 'Различного покроя школьные юбки (колокол, в складку, с запахом, с карманами и без), выполненные из однотонных тканей и тканей в клетку завершат образ маленьких модниц.', NULL, '<b>Юбка - элемент школьной формы</b>\r\n<p>\r\nЮбки – это неотъемлемый элемент школьного гардероба любой девочки. Юбки подчеркивают женственность старшеклассниц, а совсем юные школьницы в наших моделях почувствуют себя настоящими модницами.\r\nСалон \"Всегда в форме\" предлагает стильные модели юбок, рассчитанные на длительный срок эксплуатации. У нас Вы можете приобрести различные типы юбок для младшеклассниц, для средней и старшей школы.\r\n<p>\r\n<b>Основные фасоны в нашем ассортименте</b>\r\n<p>\r\nЮбка с клиньями на кокетке. Такая модель рассчитана на младшую и среднюю школу. Она хорошо скрывает недостатки подростковой фигуры. Такой покрой выглядит строго и очень удобен для подвижных ребят. Мы предлагаем модели из ткани в клетку, а также с цветными клиньями из ткани-компаньона.\r\n<p>\r\nЮбка на запахе. Такая юбка отлично подходит всем возрастам школьниц. Отлично подгоняется под фигуру путем перестановки пуговиц. Выглядит строго и очень стильно!\r\n<p>\r\nЮбка-колокол. Данная модель снабжена двумя карманами спереди, что очень удобно. Объем регулируется при помощи резинки на поясе.', 0),
(8, 'Сарафаны для девочек – это практичный предмет школьного гардероба. Выглядят женственно и удобны в использовании. К сарафанам Вы можете подобрать комплект из жилета и юбки, выполненные из той же ткани и в той же стилистике.', NULL, '<b>Школьный сарафан для девочки</b><br/>\r\nВ новом учебном году сарафаны как никогда популярны и являются хитами наших продаж. \r\nНа данный момент салон \"Всегда в форме\" предлагает сарафаны для девочек начальных классов и для средней школы: светло-серые, темно-серые, темно-синие, коричневые и с использованием ткани в клетку.<br/>\r\nВсе модели удобного кроя, практичные и выполнены из износостойкой ткани. Школьный сарафан отлично подчеркивает достоинства и скрывает недостатки фигуры. Некоторые из наших моделей оформлены декоративной тесьмой и выглядят более нарядно.\r\nСарафаны отлично сочетаются со светлой водолазкой или блузкой.\r\n<p>\r\n<b>Где купить сарафан для школы</b><br/>\r\nКупить сарафан для школьницы Вы можете в нашем интернет-магазине \"Школьно.ру\" или заказать в салоне \"Всегда в форме\". Для школьных коллективов возможна разработка индивидуального стиля. Ожидается пополнение коллекции более нарядными сарафанами, а также моделями для старшеклассниц.', 0),
(10, 'Брюки для девочек являются более универсальным элементом школьной формы, дают полную свободу движений.', NULL, 'Брюки для девочки - это наиболее практичный элемент школьной формы, который не сковывает движения.', 0),
(11, 'На данной странице представлены комплекты школьной формы для девочек. Вы можете приобрести полный комплект школьной формы,  включающий жилет и брюки или жилет и юбку.', NULL, '<b>Комплекты школьной формы для девочек</b><br/>\r\nКомплект школьной формы для девочки - это полноценный костюм, состоящий из жилета и юбки или жилета и брюк, где верхняя и нижняя часть подобраны и подогнаны друг под друга с особой тщательностью как с точки зрения кроя, так и в цветовой гамме.<br/>\r\nВсе комплекты представлены в двойном исполнении - для мальчиков и для девочек. Они выполнены из одинаковых тканей и в одной стилистике, что позволяет создать единый законченный стиль в школьном коллективе.\r\n<p>\r\n<b>Купить комплект школьной формы</b><br/>\r\nСалон \"Всегда в форме\" и наше школьное направление \"Школьно.ру\"  предлагает самые различные комплекты в нескольких цветах: однотонные, с использованием ткани в клетку и с трикотажными жилетами, строгие, классические и более нарядные.<br/>\r\n<p>\r\nУверены, что в нашем каталоге Вы обязательно подберете то, что придется по вкусу Вам и Вашему ребенку.', 0),
(12, 'Мы предлагаем два типа жилетов: из однотонных гладкокрашеных\r\nтканей и вязанные, более практичные и комфортные.', NULL, '<b>Школьный жилет для девочки</b><br/>\r\nЖилет, как элемент школьной формы - это неотъемлемая часть гардероба ребенка.\r\nПреимущества наших жилетов в том, что они удобны в носке и не сковывают движения детей.\r\nНаши жилеты практичны, они долго сохраняют свой первоначальный вид.\r\nВ них комфортно, т.к. они изготовлены из дышащих тканей. Жилеты для девочек являются многофункциональным элементом - их можно носить с юбками и брюками.\r\nКроме того жилеты элегантны. Они подчеркнут индивидуальность ребенка и настроят на учебный процесс.<br/>\r\n<b>Купить жилет для девочки</b><br/>\r\nПриобрести жилет для девочки из гладкокрашеных тканей Вы можете в любое время и в любом количестве. Данные модели доступны для заказа как для розничных покупателей в нашем интернет-магазине и салоне \"Всегда в форме\", так и для классов или школ.<br/>\r\n<b>Трикотажные вязаные жилеты</b><br/>\r\nТрикотажные вязаные жилеты также доступны для розничных покупателей, но более подробную информацию о конкретных моделях Вы сможете найти на страницах товаров.<br/>\r\nДля классов и школ при заказе от 20 шт. ограничений нет.', 0),
(13, 'Здесь представлены школьные блузки и водолазки различных цветов и фактур.', NULL, '<b>Школьные блузки и водолазки для девочек</b><br/>\r\nБлузки и водолазки – это важный элемент школьной формы, без которого не обходится ни один школьный гардероб. Данный элемент комплекта подвержен наиболее частым стиркам и находится в непосредственном контакте с телом ребенка, поэтому важно, чтобы данные изделия были износостойки, легко стирались и в то же время выглядели строго или празднично.<br/>\r\nМы предлагаем очень красивые кружевные блузки, блузки с длинными и короткими рукавами, а также водолазки для ежедневного использования.<br/>\r\nДоступны различные цвета, что позволяет подобрать одну или несколько блузок и водолазок под любой школьный комплект.', 0),
(14, 'На данной странице представлены комплекты школьной формы для мальчиков. Вы можете приобрести как полный комплект школьной формы, включающий жилет и брюки, так и по-отдельности.', NULL, '<b>Комплекты школьной формы для мальчиков</b><br/>\r\nКомплект школьной формы для мальчика - это школьный костюм, состоящий из жилета и брюк, где верхняя и нижняя часть подогнаны друг под друга с особой тщательностью как с точки зрения кроя, так и в цветовой гамме.<br/>\r\nВсе комплекты представлены в двойном исполнении - для мальчиков и для девочек. Они выполнены из одинаковых тканей и в одной стилистике, что позволяет создать единый законченный стиль в школьном коллективе, а мальчикам почувствовать себя настоящими джентльменами.\r\n<p>\r\n<b>Купить комплект школьной формы для мальчика</b><br/>\r\nСалон \"Всегда в форме\" и наше школьное направление \"Школьно.ру\"  предлагает различные комплекты для мальчиков в нескольких цветах: однотонные и с трикотажными жилетами, строгие или более практичные.<br/>\r\nВы можете выбрать как комплект школьной формы целиком, так и его элементы по-отдельности.\r\n<p>\r\nУверены, что в нашем каталоге Вы обязательно подберете то, что придется по вкусу Вам и Вашему ребенку.', 0),
(15, 'Мы предлагаем брюки для мальчиков для начальной и средней школы. Вы можете приобрести брюки различных цветов: черные, серые, коричневые и синие, подобрав их под верх - жилет или пиджак. Брюки выполнены из качественных материалов и практичны в использовании.', NULL, NULL, 0),
(16, 'Жилеты для мальчиков выполнены из однотонных тканей, т.к. верхняя часть школьной одежды всегда на виду у школьников и преподавателей и не должна раздражать глаза. Мы предлагаем два типа жилетов: из однотонных гладкокрашеных тканей и вязанные, более практичные и комфортные.', NULL, NULL, 0);
