(1500, 300, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте! \r\n \r\nОт создателей шоу «Metallicaromance»: новая уникальная программа «QueenClassics». Любимые песни Queen в исполнении рок-группы и струнного квартета. Шоу «QueenClassics» представляет новый взгляд на творчество одной из самых популярных групп в истории рок-музыки. \r\nГлавная звезда программы: лучший голос, появившийся на рок-сцене в XXI веке, El Magnifico РОННИ РОМЕРО, вокалист Ritchie Blackmore\'s RAINBOW. Первый вокалист со времен Фредди, способный петь песни Queen на уровне самого Меркьюри и вызывать такой же восторг во всем зале. Как говорил сам Ричи Блэкмор: «Ронни — уникальный вокалист. Он способен петь как Ронни Джеймс Дио и как Фредди Меркьюри». В правоте слов гения музыки XX века уже смогли убедиться те, кто слышал песни Queen в исполнении Ромеро. \r\n \r\nШоу должно продолжаться! И рождаться заново. \r\n \r\n \r\nПродажа билетов: https://simferopol.kassa24.ru/event/ronni-romero', 'ЗДРАВСТВУЙТЕ! \r\n \r\nОТ СОЗДАТЕЛЕЙ ШОУ «METALLICAROMANCE»: НОВАЯ УНИКАЛЬНАЯ ПРОГРАММА «QUEENCLASSICS». ЛЮБИМЫЕ ПЕСНИ QUEEN В ИСПОЛНЕНИИ РОК-ГРУППЫ И СТРУННОГО КВАРТЕТА. ШОУ «QUEENCLASSICS» ПРЕДСТАВЛЯЕТ НОВЫЙ ВЗГЛЯД НА ТВОРЧЕСТВО ОДНОЙ ИЗ САМЫХ ПОПУЛЯРНЫХ ГРУПП В ИСТОРИИ РОК-МУЗЫКИ. \r\nГЛАВНАЯ ЗВЕЗДА ПРОГРАММЫ: ЛУЧШИЙ ГОЛОС, ПОЯВИВШИЙСЯ НА РОК-СЦЕНЕ В XXI ВЕКЕ, EL MAGNIFICO РОННИ РОМЕРО, ВОКАЛИСТ RITCHIE BLACKMORE\'S RAINBOW. ПЕРВЫЙ ВОКАЛИСТ СО ВРЕМЕН ФРЕДДИ, СПОСОБНЫЙ ПЕТЬ ПЕСНИ QUEEN НА УРОВНЕ САМОГО МЕРКЬЮРИ И ВЫЗЫВАТЬ ТАКОЙ ЖЕ ВОСТОРГ ВО ВСЕМ ЗАЛЕ. КАК ГОВОРИЛ САМ РИЧИ БЛЭКМОР: «РОННИ — УНИКАЛЬНЫЙ ВОКАЛИСТ. ОН СПОСОБЕН ПЕТЬ КАК РОННИ ДЖЕЙМС ДИО И КАК ФРЕДДИ МЕРКЬЮРИ». В ПРАВОТЕ СЛОВ ГЕНИЯ МУЗЫКИ XX ВЕКА УЖЕ СМОГЛИ УБЕДИТЬСЯ ТЕ, КТО СЛЫШАЛ ПЕСНИ QUEEN В ИСПОЛНЕНИИ РОМЕРО. \r\n \r\nШОУ ДОЛЖНО ПРОДОЛЖАТЬСЯ! И РОЖДАТЬСЯ ЗАНОВО. \r\n \r\n \r\nПРОДАЖА БИЛЕТОВ: HTTPS://SIMFEROPOL.KASSA24.RU/EVENT/RONNI-ROMERO', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
