(1530, 306, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте \r\nЯ коммерческая писательница \r\n \r\nИщу проекты на ведение страниц/групп в соцсетях (ВК, FB, ОК, Instagram). \r\nСформирую нужный имидж у ЦА. \r\nЧто умею: \r\n- составлять интересные контент-планы \r\n- модерировать сообщества \r\n- работать с негативом \r\n \r\nВ предложение (ведение страниц) входит; \r\n- интересные публикации для вовлечения ЦА, \r\n- рекламные и продающие тексты для коммерческих целей, \r\n- ответы клиентам и  нейтрализация негатива. \r\n \r\nПрошу за работу всего 15 000р.  в месяц \r\n \r\nА также я могу: \r\n- писать качественные тексты с описанием услуг/товаров для сайта \r\nCтoимocть услуг всего - 300 p/1000 знаков. \r\n1 текст будет стоить от 450 p \r\n \r\nСпасибо, что прочли мое сообщение. \r\nХорошего вам дня и продуктивной недели \r\n \r\nP S \r\nЕсли вы сомневаетесь, подумайте, сколько клиентов теряете сейчас?', 'ЗДРАВСТВУЙТЕ \r\nЯ КОММЕРЧЕСКАЯ ПИСАТЕЛЬНИЦА \r\n \r\nИЩУ ПРОЕКТЫ НА ВЕДЕНИЕ СТРАНИЦ/ГРУПП В СОЦСЕТЯХ (ВК, FB, ОК, INSTAGRAM). \r\nСФОРМИРУЮ НУЖНЫЙ ИМИДЖ У ЦА. \r\nЧТО УМЕЮ: \r\n- СОСТАВЛЯТЬ ИНТЕРЕСНЫЕ КОНТЕНТ-ПЛАНЫ \r\n- МОДЕРИРОВАТЬ СООБЩЕСТВА \r\n- РАБОТАТЬ С НЕГАТИВОМ \r\n \r\nВ ПРЕДЛОЖЕНИЕ (ВЕДЕНИЕ СТРАНИЦ) ВХОДИТ; \r\n- ИНТЕРЕСНЫЕ ПУБЛИКАЦИИ ДЛЯ ВОВЛЕЧЕНИЯ ЦА, \r\n- РЕКЛАМНЫЕ И ПРОДАЮЩИЕ ТЕКСТЫ ДЛЯ КОММЕРЧЕСКИХ ЦЕЛЕЙ, \r\n- ОТВЕТЫ КЛИЕНТАМ И  НЕЙТРАЛИЗАЦИЯ НЕГАТИВА. \r\n \r\nПРОШУ ЗА РАБОТУ ВСЕГО 15 000Р.  В МЕСЯЦ \r\n \r\nА ТАКЖЕ Я МОГУ: \r\n- ПИСАТЬ КАЧЕСТВЕННЫЕ ТЕКСТЫ С ОПИСАНИЕМ УСЛУГ/ТОВАРОВ ДЛЯ САЙТА \r\nCТOИМOCТЬ УСЛУГ ВСЕГО - 300 P/1000 ЗНАКОВ. \r\n1 ТЕКСТ БУДЕТ СТОИТЬ ОТ 450 P \r\n \r\nСПАСИБО, ЧТО ПРОЧЛИ МОЕ СООБЩЕНИЕ. \r\nХОРОШЕГО ВАМ ДНЯ И ПРОДУКТИВНОЙ НЕДЕЛИ \r\n \r\nP S \r\nЕСЛИ ВЫ СОМНЕВАЕТЕСЬ, ПОДУМАЙТЕ, СКОЛЬКО КЛИЕНТОВ ТЕРЯЕТЕ СЕЙЧАС?', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
