(1575, 315, 1, 5, 5, '', NULL, '', NULL, 'Как мы создаем бизнес-дизайн, который увеличивает продажи и улучшает внешний вид компании? \r\nPromoArts - это мощная сеть команд дизайнеров, которая работает по отрисовке дизайн-проектов по выгодным ценам. \r\nЧто мы рисуем: \r\n•	Логотипы и фирменные стили \r\n•	Дизайн полиграфии, вывесок и так далее \r\n•	Дизайн и разработка сайтов \r\n•	Мобильные приложения \r\n…и многое другое. Мы специализируемся на качественном дизайне в хорошие сроки, поэтому наши клиенты не нанимают дизайнеров в штат и экономят на затратах. \r\nЧем мы отличаемся от других компаний: \r\nОбъем и сложность проекта не имеют значения. \r\nБолее низкая цена при сохранении качества. \r\nГарантируем результат. \r\nУвеличение прибыли. Дизайн – это не только рисунки, сделанные для «галочки». Это составной элемент в продажах – привлекательный дизайн продает лучше. \r\nКонкурентный подход. \r\nМеждународный опыт. \r\nПишите: info@arts86.ru \r\nКоммерческое предложение: https://yadi.sk/i/aTxFCuEffzjCEg \r\nНаш сайт: http://www.arts86.ru \r\nТел.: 8(992)3574514', 'КАК МЫ СОЗДАЕМ БИЗНЕС-ДИЗАЙН, КОТОРЫЙ УВЕЛИЧИВАЕТ ПРОДАЖИ И УЛУЧШАЕТ ВНЕШНИЙ ВИД КОМПАНИИ? \r\nPROMOARTS - ЭТО МОЩНАЯ СЕТЬ КОМАНД ДИЗАЙНЕРОВ, КОТОРАЯ РАБОТАЕТ ПО ОТРИСОВКЕ ДИЗАЙН-ПРОЕКТОВ ПО ВЫГОДНЫМ ЦЕНАМ. \r\nЧТО МЫ РИСУЕМ: \r\n•	ЛОГОТИПЫ И ФИРМЕННЫЕ СТИЛИ \r\n•	ДИЗАЙН ПОЛИГРАФИИ, ВЫВЕСОК И ТАК ДАЛЕЕ \r\n•	ДИЗАЙН И РАЗРАБОТКА САЙТОВ \r\n•	МОБИЛЬНЫЕ ПРИЛОЖЕНИЯ \r\n…И МНОГОЕ ДРУГОЕ. МЫ СПЕЦИАЛИЗИРУЕМСЯ НА КАЧЕСТВЕННОМ ДИЗАЙНЕ В ХОРОШИЕ СРОКИ, ПОЭТОМУ НАШИ КЛИЕНТЫ НЕ НАНИМАЮТ ДИЗАЙНЕРОВ В ШТАТ И ЭКОНОМЯТ НА ЗАТРАТАХ. \r\nЧЕМ МЫ ОТЛИЧАЕМСЯ ОТ ДРУГИХ КОМПАНИЙ: \r\nОБЪЕМ И СЛОЖНОСТЬ ПРОЕКТА НЕ ИМЕЮТ ЗНАЧЕНИЯ. \r\nБОЛЕЕ НИЗКАЯ ЦЕНА ПРИ СОХРАНЕНИИ КАЧЕСТВА. \r\nГАРАНТИРУЕМ РЕЗУЛЬТАТ. \r\nУВЕЛИЧЕНИЕ ПРИБЫЛИ. ДИЗАЙН – ЭТО НЕ ТОЛЬКО РИСУНКИ, СДЕЛАННЫЕ ДЛЯ «ГАЛОЧКИ». ЭТО СОСТАВНОЙ ЭЛЕМЕНТ В ПРОДАЖАХ – ПРИВЛЕКАТЕЛЬНЫЙ ДИЗАЙН ПРОДАЕТ ЛУЧШЕ. \r\nКОНКУРЕНТНЫЙ ПОДХОД. \r\nМЕЖДУНАРОДНЫЙ ОПЫТ. \r\nПИШИТЕ: INFO@ARTS86.RU