(1590, 318, 1, 5, 5, '', NULL, '', NULL, 'Добрый день. Предлагаем Вам создать простой и эффективный видеоролик о Вашей компании. В «живой» видеосъемке нет необходимости! \r\n \r\nСоздание 60 секундного рекламного видеоролика о Вашей компании. В нем мы сможем рассказать и показать сильные стороны Вашей организации. \r\n \r\nСтоимость создания видеоролика \"под ключ\" - 6500 рублей, срок изготовления видеоролика от 4 до 6 рабочих дней. Форма оплаты - банковская карта или яндекс деньги. По Вашему запросу отправим примеры наших видеороликов и подробную информацию о том, как заказать видеоролик. Напишите нам на электронную почту rus.order@yandex.ru \r\n \r\nС Уважением, «Бизнес Продвижение» \r\nг. Москва, ул. Автозаводская, 1 \r\nЭлектронная почта: rus.order@yandex.ru', 'ДОБРЫЙ ДЕНЬ. ПРЕДЛАГАЕМ ВАМ СОЗДАТЬ ПРОСТОЙ И ЭФФЕКТИВНЫЙ ВИДЕОРОЛИК О ВАШЕЙ КОМПАНИИ. В «ЖИВОЙ» ВИДЕОСЪЕМКЕ НЕТ НЕОБХОДИМОСТИ! \r\n \r\nСОЗДАНИЕ 60 СЕКУНДНОГО РЕКЛАМНОГО ВИДЕОРОЛИКА О ВАШЕЙ КОМПАНИИ. В НЕМ МЫ СМОЖЕМ РАССКАЗАТЬ И ПОКАЗАТЬ СИЛЬНЫЕ СТОРОНЫ ВАШЕЙ ОРГАНИЗАЦИИ. \r\n \r\nСТОИМОСТЬ СОЗДАНИЯ ВИДЕОРОЛИКА \"ПОД КЛЮЧ\" - 6500 РУБЛЕЙ, СРОК ИЗГОТОВЛЕНИЯ ВИДЕОРОЛИКА ОТ 4 ДО 6 РАБОЧИХ ДНЕЙ. ФОРМА ОПЛАТЫ - БАНКОВСКАЯ КАРТА ИЛИ ЯНДЕКС ДЕНЬГИ. ПО ВАШЕМУ ЗАПРОСУ ОТПРАВИМ ПРИМЕРЫ НАШИХ ВИДЕОРОЛИКОВ И ПОДРОБНУЮ ИНФОРМАЦИЮ О ТОМ, КАК ЗАКАЗАТЬ ВИДЕОРОЛИК. НАПИШИТЕ НАМ НА ЭЛЕКТРОННУЮ ПОЧТУ RUS.ORDER@YANDEX.RU \r\n \r\nС УВАЖЕНИЕМ, «БИЗНЕС ПРОДВИЖЕНИЕ» \r\nГ. МОСКВА, УЛ. АВТОЗАВОДСКАЯ, 1 \r\nЭЛЕКТРОННАЯ ПОЧТА: RUS.ORDER@YANDEX.RU', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
