(1615, 323, 1, 5, 5, '', NULL, '', NULL, 'Выполнение работ и разработка проектно-сметной документации по усилению фундаментов частных домов, административных зданий, многоквартирных домов, производственных сооружений методом инъекционного закрепления с закачкой полимер-бетонного раствора. \r\n \r\nПолимер-бетонный раствор глубокого проникновения, безусадочный и саморасширяющийся, благодаря чему создается гидрофобизированный массив грунта, повышенной несущей способности в основании фундамента. \r\n \r\nРаботы выполняются как при новом строительстве, в замен буро-набивных, буро-забивных свай, так и при эксплуатации существующих зданий. Применимо для всех типов фундаментов, столбчатые, свайные, ленточные, плитные. \r\n \r\nТак же, закрепление стен котлованов, склонов, траншей. Выполнение закрепления грунтов гидротехнических сооружений, насыпных – разуплотненных грунтов, создание гидро завес в грунте. \r\n \r\nПрименение инъекционного метода с закачкой полимер-бетонного раствора, позволяет снизить влияние сейсмоактивности до 2 баллов. Опыт выполнения работ более 7 лет, выполненные объекты от Тюмени до Анапы. \r\n \r\nПолное оснащение собственным оборудованием и профессиональными кадрами. \r\n \r\nГарантия на выполняемые работы 5 лет. \r\nПодробнее на нашем сайте www.крепкийгрунт.рф или www.strongsoil.ru \r\n \r\nКонтактный телефон: \r\nРуководитель проектов – Герасьянов Андрей Юрьевич \r\n8-965-7777-286', 'ВЫПОЛНЕНИЕ РАБОТ И РАЗРАБОТКА ПРОЕКТНО-СМЕТНОЙ ДОКУМЕНТАЦИИ ПО УСИЛЕНИЮ ФУНДАМЕНТОВ ЧАСТНЫХ ДОМОВ, АДМИНИСТРАТИВНЫХ ЗДАНИЙ, МНОГОКВАРТИРНЫХ ДОМОВ, ПРОИЗВОДСТВЕННЫХ СООРУЖЕНИЙ МЕТОДОМ ИНЪЕКЦИОННОГО ЗАКРЕПЛЕНИЯ С ЗАКАЧКОЙ ПОЛИМЕР-БЕТОННОГО РАСТВОРА. \r\n \r\nПОЛИМЕР-БЕТОННЫЙ РАСТВОР ГЛУБОКОГО ПРОНИКНОВЕНИЯ, БЕЗУСАДОЧНЫЙ И САМОРАСШИРЯЮЩИЙСЯ, БЛАГОДАРЯ ЧЕМУ СОЗДАЕТСЯ ГИДРОФОБИЗИРОВАННЫЙ МАССИВ ГРУНТА, ПОВЫШЕННОЙ НЕСУЩЕЙ СПОСОБНОСТИ В ОСНОВАНИИ ФУНДАМЕНТА. \r\n \r\nРАБОТЫ ВЫПОЛНЯЮТСЯ КАК ПРИ НОВОМ СТРОИТЕЛЬСТВЕ, В ЗАМЕН БУРО-НАБИВНЫХ, БУРО-ЗАБИВНЫХ СВАЙ, ТАК И ПРИ ЭКСПЛУАТАЦИИ СУЩЕСТВУЮЩИХ ЗДАНИЙ. ПРИМЕНИМО ДЛЯ ВСЕХ ТИПОВ ФУНДАМЕНТОВ, СТОЛБЧАТЫЕ, СВАЙНЫЕ, ЛЕНТОЧНЫЕ, ПЛИТНЫЕ. \r\n \r\nТАК ЖЕ, ЗАКРЕПЛЕНИЕ СТЕН КОТЛОВАНОВ, СКЛОНОВ, ТРАНШЕЙ. ВЫПОЛНЕНИЕ ЗАКРЕПЛЕНИЯ ГРУНТОВ ГИДРОТЕХНИЧЕСКИХ СООРУЖЕНИЙ, НАСЫПНЫХ – РАЗУПЛОТНЕННЫХ ГРУНТОВ, СОЗДАНИЕ ГИДРО ЗАВЕС В ГРУНТЕ. \r\n \r\nПРИМЕНЕНИЕ ИНЪЕКЦИОННОГО МЕТОДА С ЗАКАЧКОЙ ПОЛИМЕР-БЕТОННОГО РАСТВОРА, ПОЗВОЛЯЕТ СНИЗИТЬ ВЛИЯНИЕ СЕЙСМОАКТИВНОСТИ ДО 2 БАЛЛОВ. ОПЫТ ВЫПОЛНЕНИЯ РАБОТ БОЛЕЕ 7 ЛЕТ, ВЫПОЛНЕННЫЕ ОБЪЕКТЫ ОТ ТЮМЕНИ ДО АНАПЫ. \r\n \r\nПОЛНОЕ ОСНАЩЕНИЕ СОБСТВЕННЫМ ОБОРУДОВАНИЕМ И ПРОФЕССИОНАЛЬНЫМИ КАДРАМИ. \r\n \r\nГАРАНТИЯ НА ВЫПОЛНЯЕМЫЕ РАБОТЫ 5 ЛЕТ. \r\nПОДРОБНЕЕ НА НАШЕМ САЙТЕ WWW.КРЕПКИЙГРУНТ.РФ ИЛИ WWW.STRONGSOIL.RU \r\n \r\nКОНТАКТНЫЙ ТЕЛЕФОН: \r\nРУКОВОДИТЕЛЬ ПРОЕКТОВ – ГЕРАСЬЯНОВ АНДРЕЙ ЮРЬЕВИЧ \r\n8-965-7777-286', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
