(1620, 324, 1, 5, 5, '', NULL, '', NULL, 'Приветствуем! \r\nВы знаете о том, что чем больше вы отдаете, тем больше получаете?! \r\nПомогайте тем кто нуждается, и вам вернются в 1000 раз больше! \r\nБлаготворительный фонд «Анна Мария»: https://bf-annamariya.ru/. \r\nВы можете помочь как напрямую, так и открыв бесплатно счёт в банке Тинькоф по ссылке: http://tinkoff-annamariya.ru/, и банк перечислит до 3000 руб в фонд. \r\nЕсли у вас есть вопросы, вы можете связаться с нами по указанным контактам. \r\nДобро доступно каждому.', 'ПРИВЕТСТВУЕМ! \r\nВЫ ЗНАЕТЕ О ТОМ, ЧТО ЧЕМ БОЛЬШЕ ВЫ ОТДАЕТЕ, ТЕМ БОЛЬШЕ ПОЛУЧАЕТЕ?! \r\nПОМОГАЙТЕ ТЕМ КТО НУЖДАЕТСЯ, И ВАМ ВЕРНЮТСЯ В 1000 РАЗ БОЛЬШЕ! \r\nБЛАГОТВОРИТЕЛЬНЫЙ ФОНД «АННА МАРИЯ»: HTTPS://BF-ANNAMARIYA.RU/. \r\nВЫ МОЖЕТЕ ПОМОЧЬ КАК НАПРЯМУЮ, ТАК И ОТКРЫВ БЕСПЛАТНО СЧЁТ В БАНКЕ ТИНЬКОФ ПО ССЫЛКЕ: HTTP://TINKOFF-ANNAMARIYA.RU/, И БАНК ПЕРЕЧИСЛИТ ДО 3000 РУБ В ФОНД. \r\nЕСЛИ У ВАС ЕСТЬ ВОПРОСЫ, ВЫ МОЖЕТЕ СВЯЗАТЬСЯ С НАМИ ПО УКАЗАННЫМ КОНТАКТАМ. \r\nДОБРО ДОСТУПНО КАЖДОМУ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
