(1625, 325, 1, 5, 5, '', NULL, '', NULL, 'Привет! \r\nЯ занимаюсь созданием информационных сайтов :) Три месяца назад я узнал о крутой программе <a href=\"https://vk.cc/9fyfuG\">Видеопоток</a>. Вы устанавливаете на свой сайт код с видеорекламой и зарабатываете 80 рублей за каждую тысячу просмотров. \r\n \r\nДавайте посчитаем. Если трафик на сайте составляет 4000 человек в сутки, при этом просмотров будет около 5000, то ваш ДОПОЛНИТЕЛЬНЫЙ доход в день составит 80 * 5000 = 400 рублей, а это 12 400 рублей в месяц. А если посещаемость у вас больше? :) Важно - данный вид рекламы не мешает другой рекламе, поэтому видеореклама - дополнительный доход. \r\n \r\nА еще пессимизации от Yandex и Гугла нету. Вообщем рекомендую! Я пользуюсь уже три недели. Вот мои скромные результаты (за последние 8 дней заработок составил 19901.28 рублей) - https://vk.cc/9fYJCH \r\n \r\n<a href=\"https://vk.cc/9fyfuG\">Регистрируйся прямо сейчас </a>', 'ПРИВЕТ! \r\nЯ ЗАНИМАЮСЬ СОЗДАНИЕМ ИНФОРМАЦИОННЫХ САЙТОВ :) ТРИ МЕСЯЦА НАЗАД Я УЗНАЛ О КРУТОЙ ПРОГРАММЕ <A HREF=\"HTTPS://VK.CC/9FYFUG\">ВИДЕОПОТОК</A>. ВЫ УСТАНАВЛИВАЕТЕ НА СВОЙ САЙТ КОД С ВИДЕОРЕКЛАМОЙ И ЗАРАБАТЫВАЕТЕ 80 РУБЛЕЙ ЗА КАЖДУЮ ТЫСЯЧУ ПРОСМОТРОВ. \r\n \r\nДАВАЙТЕ ПОСЧИТАЕМ. ЕСЛИ ТРАФИК НА САЙТЕ СОСТАВЛЯЕТ 4000 ЧЕЛОВЕК В СУТКИ, ПРИ ЭТОМ ПРОСМОТРОВ БУДЕТ ОКОЛО 5000, ТО ВАШ ДОПОЛНИТЕЛЬНЫЙ ДОХОД В ДЕНЬ СОСТАВИТ 80 * 5000 = 400 РУБЛЕЙ, А ЭТО 12 400 РУБЛЕЙ В МЕСЯЦ. А ЕСЛИ ПОСЕЩАЕМОСТЬ У ВАС БОЛЬШЕ? :) ВАЖНО - ДАННЫЙ ВИД РЕКЛАМЫ НЕ МЕШАЕТ ДРУГОЙ РЕКЛАМЕ, ПОЭТОМУ ВИДЕОРЕКЛАМА - ДОПОЛНИТЕЛЬНЫЙ ДОХОД. \r\n \r\nА ЕЩЕ ПЕССИМИЗАЦИИ ОТ YANDEX И ГУГЛА НЕТУ. ВООБЩЕМ РЕКОМЕНДУЮ! Я ПОЛЬЗУЮСЬ УЖЕ ТРИ НЕДЕЛИ. ВОТ МОИ СКРОМНЫЕ РЕЗУЛЬТАТЫ (ЗА ПОСЛЕДНИЕ 8 ДНЕЙ ЗАРАБОТОК СОСТАВИЛ 19901.28 РУБЛЕЙ) - HTTPS://VK.CC/9FYJCH \r\n \r\n<A HREF=\"HTTPS://VK.CC/9FYFUG\">РЕГИСТРИРУЙСЯ ПРЯМО СЕЙЧАС </A>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
