(1685, 337, 1, 5, 5, '', NULL, '', NULL, 'Добрый день! \r\n \r\nНа подарок любимым, семье, сотрудникам, клиентам, партнерам. \r\nСувенирные и именные ложки. Сделаем любую надпись по Вашему заказу. \r\nПри заказе комплекта можно выбрать дизайн, заказать разные надписи и вариант упаковки. \r\nhttp://golden-spoon.ru \r\nP.S. \r\nВы можете стать нашим партнером в Вашем городе. \r\nМы являемся крупнейшими производителями сувенирных ложек в России и можем поставлять их в любых количествах.', 'ДОБРЫЙ ДЕНЬ! \r\n \r\nНА ПОДАРОК ЛЮБИМЫМ, СЕМЬЕ, СОТРУДНИКАМ, КЛИЕНТАМ, ПАРТНЕРАМ. \r\nСУВЕНИРНЫЕ И ИМЕННЫЕ ЛОЖКИ. СДЕЛАЕМ ЛЮБУЮ НАДПИСЬ ПО ВАШЕМУ ЗАКАЗУ. \r\nПРИ ЗАКАЗЕ КОМПЛЕКТА МОЖНО ВЫБРАТЬ ДИЗАЙН, ЗАКАЗАТЬ РАЗНЫЕ НАДПИСИ И ВАРИАНТ УПАКОВКИ. \r\nHTTP://GOLDEN-SPOON.RU \r\nP.S. \r\nВЫ МОЖЕТЕ СТАТЬ НАШИМ ПАРТНЕРОМ В ВАШЕМ ГОРОДЕ. \r\nМЫ ЯВЛЯЕМСЯ КРУПНЕЙШИМИ ПРОИЗВОДИТЕЛЯМИ СУВЕНИРНЫХ ЛОЖЕК В РОССИИ И МОЖЕМ ПОСТАВЛЯТЬ ИХ В ЛЮБЫХ КОЛИЧЕСТВАХ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
