(1735, 347, 1, 5, 5, '', NULL, '', NULL, 'Пожалуйста проверьте свою организацию на наличие СОУТ на официальном сайте РОСТРУД \r\nhttp://akot.rosmintrud.ru/sout/Statistics/varorganization \r\n \r\nЕсли вы не нашли себя в списках наберите 8 800 511 36 35  или оставьте заявку на сайте https://arkons.biz/#sout \r\n \r\nГК \"Арконс\" – основным направлением деятельности является спецоценка условий труда. Выполняем работы по измерению и оценке факторов производственной среды для спецоценки условий труда и мониторинга производственной среды. Учитываем специфику организации. \r\nРаботаем оперативно – от заключения договора до получения Вами готовых документов и внесения в реестр ФГИС \r\n \r\n-грамотно выявляем и суммируем аналогичные рабочие места \r\n-помогаем сократить компенсации сотрудникам, связанные с устаревшими регламентами и ошибками предыдущих проверок \r\n-помогаем вернуть часть средств на проведение специальной оценки труда через ФСС \r\n-предоставляем заверенную документально гарантию на весь срок действия своих работ (СОУТ – 5 лет) \r\n \r\nЗвоните! 8 800 511 36 35 Работаем по РФ', 'ПОЖАЛУЙСТА ПРОВЕРЬТЕ СВОЮ ОРГАНИЗАЦИЮ НА НАЛИЧИЕ СОУТ НА ОФИЦИАЛЬНОМ САЙТЕ РОСТРУД \r\nHTTP://AKOT.ROSMINTRUD.RU/SOUT/STATISTICS/VARORGANIZATION \r\n \r\nЕСЛИ ВЫ НЕ НАШЛИ СЕБЯ В СПИСКАХ НАБЕРИТЕ 8 800 511 36 35  ИЛИ ОСТАВЬТЕ ЗАЯВКУ НА САЙТЕ HTTPS://ARKONS.BIZ/#SOUT \r\n \r\nГК \"АРКОНС\" – ОСНОВНЫМ НАПРАВЛЕНИЕМ ДЕЯТЕЛЬНОСТИ ЯВЛЯЕТСЯ СПЕЦОЦЕНКА УСЛОВИЙ ТРУДА. ВЫПОЛНЯЕМ РАБОТЫ ПО ИЗМЕРЕНИЮ И ОЦЕНКЕ ФАКТОРОВ ПРОИЗВОДСТВЕННОЙ СРЕДЫ ДЛЯ СПЕЦОЦЕНКИ УСЛОВИЙ ТРУДА И МОНИТОРИНГА ПРОИЗВОДСТВЕННОЙ СРЕДЫ. УЧИТЫВАЕМ СПЕЦИФИКУ ОРГАНИЗАЦИИ. \r\nРАБОТАЕМ ОПЕРАТИВНО – ОТ ЗАКЛЮЧЕНИЯ ДОГОВОРА ДО ПОЛУЧЕНИЯ ВАМИ ГОТОВЫХ ДОКУМЕНТОВ И ВНЕСЕНИЯ В РЕЕСТР ФГИС \r\n \r\n-ГРАМОТНО ВЫЯВЛЯЕМ И СУММИРУЕМ АНАЛОГИЧНЫЕ РАБОЧИЕ МЕСТА \r\n-ПОМОГАЕМ СОКРАТИТЬ КОМПЕНСАЦИИ СОТРУДНИКАМ, СВЯЗАННЫЕ С УСТАРЕВШИМИ РЕГЛАМЕНТАМИ И ОШИБКАМИ ПРЕДЫДУЩИХ ПРОВЕРОК \r\n-ПОМОГАЕМ ВЕРНУТЬ ЧАСТЬ СРЕДСТВ НА ПРОВЕДЕНИЕ СПЕЦИАЛЬНОЙ ОЦЕНКИ ТРУДА ЧЕРЕЗ ФСС \r\n-ПРЕДОСТАВЛЯЕМ ЗАВЕРЕННУЮ ДОКУМЕНТАЛЬНО ГАРАНТИЮ НА ВЕСЬ СРОК ДЕЙСТВИЯ СВОИХ РАБОТ (СОУТ – 5 ЛЕТ) \r\n \r\nЗВОНИТЕ! 8 800 511 36 35 РАБОТАЕМ ПО РФ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
