(1900, 380, 1, 5, 5, '', NULL, '', NULL, 'Сделайте доброе дело! \r\nМы нуждаемся в помощи! \r\n \r\nЧерез неделю нам необходимо оплатить лечение маленькому замечательному ребенку, Сердюкову Денису.Но мы не смогли набрать необходимую сумму. Обращаемся к вам с просьбой помочь нам. Любая даже самая не значительная сумма приблизит ребенка к выздоровлению. Помочь Дениске можно на его персональной страничке https://popechitelstvo-zabota.ru/need-help/serdyukov-denis/ \r\n \r\nИли просто отправив СМС на короткий номер 3443 С текстом: Добрый пробел сумма пожертвования \r\nНапример: Добрый 100 \r\n \r\nВнимание: В ответном СМС подтвердите платеж! \r\n \r\nО НАС: \r\nНаш фонд создан заслуженным деятелем России Григорием Гладковым. Председателем попечительского совета фонда является всемирно известный парапутешественник Игорь Скикевич. \r\n \r\nЯ обращаюсь к вам за любой самой не значительной помощью! \r\n \r\nТак же предлагаем вам постоянное сотрудничество. Благотворительность набирает популярность, а наш фонд довольно популярный в России. Мы можем быть вам полезны и ассоциировать вас как нашего партнера. Фонд является учредителем Всероссийскойского инклюзивного фестиваля детского творчества для детей с инвалидностью. \r\n \r\nОзнакомится с нашим фондом вы можете на сайте фонда https://popechitelstvo-zabota.ru \r\n \r\nНаши контакты: \r\n347922, Ростовская обл, г. Таганрог ул. Петровская, 44 \r\n+7 (8634)45-47-27 +7 (951)824-77-34 \r\nfond@popechitelstvo-zabota.ru \r\n \r\nС Уважением. \r\nЮлия Жуковская.', 'СДЕЛАЙТЕ ДОБРОЕ ДЕЛО! \r\nМЫ НУЖДАЕМСЯ В ПОМОЩИ! \r\n \r\nЧЕРЕЗ НЕДЕЛЮ НАМ НЕОБХОДИМО ОПЛАТИТЬ ЛЕЧЕНИЕ МАЛЕНЬКОМУ ЗАМЕЧАТЕЛЬНОМУ РЕБЕНКУ, СЕРДЮКОВУ ДЕНИСУ.НО МЫ НЕ СМОГЛИ НАБРАТЬ НЕОБХОДИМУЮ СУММУ. ОБРАЩАЕМСЯ К ВАМ С ПРОСЬБОЙ ПОМОЧЬ НАМ. ЛЮБАЯ ДАЖЕ САМАЯ НЕ ЗНАЧИТЕЛЬНАЯ СУММА ПРИБЛИЗИТ РЕБЕНКА К ВЫЗДОРОВЛЕНИЮ. ПОМОЧЬ ДЕНИСКЕ МОЖНО НА ЕГО ПЕРСОНАЛЬНОЙ СТРАНИЧКЕ HTTPS://POPECHITELSTVO-ZABOTA.RU/NEED-HELP/SERDYUKOV-DENIS/ \r\n \r\nИЛИ ПРОСТО ОТПРАВИВ СМС НА КОРОТКИЙ НОМЕР 3443 С ТЕКСТОМ: ДОБРЫЙ ПРОБЕЛ СУММА ПОЖЕРТВОВАНИЯ \r\nНАПРИМЕР: ДОБРЫЙ 100 \r\n \r\nВНИМАНИЕ: В ОТВЕТНОМ СМС ПОДТВЕРДИТЕ ПЛАТЕЖ! \r\n \r\nО НАС: \r\nНАШ ФОНД СОЗДАН ЗАСЛУЖЕННЫМ ДЕЯТЕЛЕМ РОССИИ ГРИГОРИЕМ ГЛАДКОВЫМ. ПРЕДСЕДАТЕЛЕМ ПОПЕЧИТЕЛЬСКОГО СОВЕТА ФОНДА ЯВЛЯЕТСЯ ВСЕМИРНО ИЗВЕСТНЫЙ ПАРАПУТЕШЕСТВЕННИК ИГОРЬ СКИКЕВИЧ. \r\n \r\nЯ ОБРАЩАЮСЬ К ВАМ ЗА ЛЮБОЙ САМОЙ НЕ ЗНАЧИТЕЛЬНОЙ ПОМОЩЬЮ! \r\n \r\nТАК ЖЕ ПРЕДЛАГАЕМ ВАМ ПОСТОЯННОЕ СОТРУДНИЧЕСТВО. БЛАГОТВОРИТЕЛЬНОСТЬ НАБИРАЕТ ПОПУЛЯРНОСТЬ, А НАШ ФОНД ДОВОЛЬНО ПОПУЛЯРНЫЙ В РОССИИ. МЫ МОЖЕМ БЫТЬ ВАМ ПОЛЕЗНЫ И АССОЦИИРОВАТЬ ВАС КАК НАШЕГО ПАРТНЕРА. ФОНД ЯВЛЯЕТСЯ УЧРЕДИТЕЛЕМ ВСЕРОССИЙСКОЙСКОГО ИНКЛЮЗИВНОГО ФЕСТИВАЛЯ ДЕТСКОГО ТВОРЧЕСТВА ДЛЯ ДЕТЕЙ С ИНВАЛИДНОСТЬЮ. \r\n \r\nОЗНАКОМИТСЯ С НАШИМ ФОНДОМ ВЫ МОЖЕТЕ НА САЙТЕ ФОНДА HTTPS://POPECHITELSTVO-ZABOTA.RU \r\n \r\nНАШИ КОНТАКТЫ: \r\n347922, РОСТОВСКАЯ ОБЛ, Г. ТАГАНРОГ УЛ. ПЕТРОВСКАЯ, 44 \r\n+7 (8634)45-47-27 +7 (951)824-77-34 \r\nFOND@POPECHITELSTVO-ZABOTA.RU \r\n \r\nС УВАЖЕНИЕМ. \r\nЮЛИЯ ЖУКОВСКАЯ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
