(1920, 384, 1, 5, 5, '', NULL, '', NULL, 'Здравствуйте! Извините за беспокойство и сразу по существу. \r\n \r\nМы, экспертная команда веб-разработчиков по CMS WordPress(эта система управления занимает 34% среди всех сайтов мира). Владеем самыми крупными сообществами по данной тематике в России и СНГ. \r\n \r\nСоздаем сайты любой сложности, от сайтов-визиток до Интернет-магазинов и агрегаторов, а также продвигаем их в Google и Yandex, вне зависимости от ниши бизнеса и страны. \r\n \r\nПредоставляем весь цикл создания проекта: дизайн, верстка, программирование, создание плагинов, исправление ошибок на уже созданном сайте. \r\n \r\nПортфолио: https://one-pix.ru/m \r\nПрезентация команды: one-pix.ru/doc/presentation.pdf \r\n \r\nЕсли Вам интересно сотрудничество, просим написать нам в ответном письме: \r\nE-mail: max@one-pix.com \r\n \r\nНадеемся на продуктивное сотрудничество! \r\nС уважением, команда One-Pix.', 'ЗДРАВСТВУЙТЕ! ИЗВИНИТЕ ЗА БЕСПОКОЙСТВО И СРАЗУ ПО СУЩЕСТВУ. \r\n \r\nМЫ, ЭКСПЕРТНАЯ КОМАНДА ВЕБ-РАЗРАБОТЧИКОВ ПО CMS WORDPRESS(ЭТА СИСТЕМА УПРАВЛЕНИЯ ЗАНИМАЕТ 34% СРЕДИ ВСЕХ САЙТОВ МИРА). ВЛАДЕЕМ САМЫМИ КРУПНЫМИ СООБЩЕСТВАМИ ПО ДАННОЙ ТЕМАТИКЕ В РОССИИ И СНГ. \r\n \r\nСОЗДАЕМ САЙТЫ ЛЮБОЙ СЛОЖНОСТИ, ОТ САЙТОВ-ВИЗИТОК ДО ИНТЕРНЕТ-МАГАЗИНОВ И АГРЕГАТОРОВ, А ТАКЖЕ ПРОДВИГАЕМ ИХ В GOOGLE И YANDEX, ВНЕ ЗАВИСИМОСТИ ОТ НИШИ БИЗНЕСА И СТРАНЫ. \r\n \r\nПРЕДОСТАВЛЯЕМ ВЕСЬ ЦИКЛ СОЗДАНИЯ ПРОЕКТА: ДИЗАЙН, ВЕРСТКА, ПРОГРАММИРОВАНИЕ, СОЗДАНИЕ ПЛАГИНОВ, ИСПРАВЛЕНИЕ ОШИБОК НА УЖЕ СОЗДАННОМ САЙТЕ. \r\n \r\nПОРТФОЛИО: HTTPS://ONE-PIX.RU/M \r\nПРЕЗЕНТАЦИЯ КОМАНДЫ: ONE-PIX.RU/DOC/PRESENTATION.PDF \r\n \r\nЕСЛИ ВАМ ИНТЕРЕСНО СОТРУДНИЧЕСТВО, ПРОСИМ НАПИСАТЬ НАМ В ОТВЕТНОМ ПИСЬМЕ: \r\nE-MAIL: MAX@ONE-PIX.COM \r\n \r\nНАДЕЕМСЯ НА ПРОДУКТИВНОЕ СОТРУДНИЧЕСТВО! \r\nС УВАЖЕНИЕМ, КОМАНДА ONE-PIX.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
